  `wage` enum('1000~1500/月','1500~2000/月','2000~3000/月','3000~5000/月','5000~10000/月','10000以上/月','面议') DEFAULT '1000~1500/月' COMMENT '期望薪资',
  `nature` enum('全职','兼职','实习') DEFAULT '全职' COMMENT '工作性质',
