INSERT INTO `ey_article_content` VALUES ('2', '7', '&lt;p&gt;12月16日至18日,2022年广东省老年人钓鱼比赛在惠州巽寮湾温泉度假生态园落下帷幕。&lt;/p&gt;&lt;p&gt;此次交流，全省共有11支队伍、33名运动员参赛。钓友们冒着寒风，顶着中雨，经过两天三场的技术和技能竞赛，大家赛出了好成绩、好风格、好水平，收获满满、心情喜悦。我市代表一队在这次比赛中，表现优秀，夺得了团体第三名。队员王军同志获得了个人第一名的成绩，载誉归来。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '1673421709', '1673421709', '');
INSERT INTO `ey_article_content` VALUES ('3', '8', '&lt;p&gt;2022年12月13日至15日，深圳市候鸟老年冂球协会，在美丽的中山公园四连片门球场，举办了为期三天的《省籍球友》门球联谊赛。来自天南地北的老年门球人，踊跃组队报名。共计40支队伍，运动员、裁判员以及工作人员共200多人参加了这场赛事。&lt;/p&gt;&lt;p&gt;多年来，市候鸟老年冂球协会秉承“来了就是深圳人”的理念，把提高老年门球人的生活质量作为协会开展工作的宗旨。通过以球会友，互叙乡情，传递友谊，乐在健身等一系列做法，把来自全国各地的老年门球人汇聚在绿茵场上。他们积极筹划，克服—波波的疫情影响，主动与有关部门沟通，让计划中的赛事得以实施。此次赛事，就得到了南山区门球协会的大力支持。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;此次交流，经过三天、92场激烈的角逐，广东湛江队荣获冠军，湖北三队获得亚军，湖南潇湘队、湖南一队分获第三、第四名。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '1673421723', '1673421723', '');
INSERT INTO `ey_article_content` VALUES ('4', '9', '&lt;p&gt;&lt;img src=&quot;/uploads/allimg/20230111/1-230111153559196.jpg&quot; alt=&quot;202171311312723010.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '1673422562', '1673422562', '');
INSERT INTO `ey_article_content` VALUES ('5', '10', '&lt;p&gt;&lt;img src=&quot;/uploads/allimg/20230111/1-23011115361N02.jpg&quot; alt=&quot;20208191113321112.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '1673422582', '1673422582', '');
INSERT INTO `ey_article_content` VALUES ('6', '11', '&lt;p&gt; &lt;span &gt;    &lt;/span&gt;&lt;span &gt;春节，是中华民族的传统节日，也是&lt;/span&gt;&lt;span &gt;万&lt;/span&gt;&lt;span &gt;家团圆的日子&lt;/span&gt;&lt;span &gt;。为进一步营造社区居民家庭和睦，营造社区&lt;/span&gt;&lt;span &gt;团结友爱、和谐亲密的&lt;/span&gt;&lt;span &gt;家文化氛围，提升社区&lt;/span&gt;&lt;span &gt;居民的获得感和&lt;/span&gt;&lt;span &gt;幸福感。&lt;/span&gt;&lt;span &gt;在禾花社区党委的领导下，党群服务中心、新时代文明实践站&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;围绕团圆的幸福瞬间开展&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;幸福禾花，乐享团圆&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;--&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;禾花社区最美全家福线上投票活动&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;span &gt;让&lt;/span&gt;&lt;span &gt;社区&lt;/span&gt;&lt;span &gt;家庭成员&lt;/span&gt;&lt;span &gt;亲密&lt;/span&gt;&lt;span &gt;互动，感受浓浓的亲情&lt;/span&gt;&lt;span &gt;团圆&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;记录家人团聚的美好场景。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;    &lt;font face=&quot;宋体&quot;&gt;据悉，活动以展示全家福&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;团圆为切入点，深入挖掘每个家庭的幸福时刻，记录美好瞬间。本次活动共有&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;30&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;个家庭参与，经过朋友圈转发获得&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;3819&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;的访问量、累计投票&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;1341&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;票。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Arial&quot;&gt;张张&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;全家福&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Arial&quot;&gt;，人人笑开颜，如果幸福有形状，那一定是&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;团圆&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Arial&quot;&gt;的模样&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;    &lt;font face=&quot;宋体&quot;&gt;生活需要仪式感，一张喜气洋洋的团圆全家福，既能记录了美好团圆时光，又能增添满满的年味和仪式感。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843769', '1675843769', '');
INSERT INTO `ey_article_content` VALUES ('7', '12', '&lt;p&gt;  &lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;section data-support=&quot;96编辑器&quot; data-style-id=&quot;43260&quot;&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;span &gt;       2023年2月6日上午，针对老人对第一波新冠&quot;阳康&quot;仍有余悸的心理，由南山区老年协会武智慧会长、办公室主任王丽、副秘书长张苗，开展重点走访慰问，探望家住南山区前海路阳光棕榈园&quot;阳康&quot;后的离退休干部张桂祥同志，向老干部张桂祥致以新年的慰问金，为老干部送上老协的关怀和温暖，鼓励张桂祥安心修养。&lt;/span&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;section data-support=&quot;96编辑器&quot; data-style-id=&quot;43260&quot;&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;/section&gt;&lt;section&gt;\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\n&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;section data-support=&quot;96编辑器&quot; data-style-id=&quot;43265&quot;&gt;&lt;section data-align=&quot;title&quot;&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;span &gt;武智慧会长与老干部张桂祥促膝交谈&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;section data-support=&quot;96编辑器&quot; data-style-id=&quot;43260&quot;&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;span &gt;       武智慧会长与老干部张桂祥促膝谈心，嘘寒问暖，殷切叮嘱老干部要做好自身防护、保重身体，同时向老干部张桂祥汇报近期开展的各项工作，虚心听取他对老协工作的意见建议，祝愿他身体健康、安享晚年。&lt;/span&gt; &lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;section data-support=&quot;96编辑器&quot; data-style-id=&quot;43260&quot;&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\n&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;section data-support=&quot;96编辑器&quot; data-style-id=&quot;43260&quot;&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;section data-support=&quot;96编辑器&quot; data-style-id=&quot;43260&quot;&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;&lt;/section&gt;           &lt;/section&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;section data-support=&quot;96编辑器&quot; data-style-id=&quot;43260&quot;&gt;&lt;span &gt;       老干部张桂祥对老协的关心表示感谢。张桂祥表示，今后一定继续尽己所能，为南山老协的发展贡献银辉力量。&lt;/span&gt; &lt;/section&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;  &lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843772', '1675843772', '');
INSERT INTO `ey_article_content` VALUES ('8', '13', '&lt;h2 class=&quot;mp-article-caption-title title&quot; &gt;\r\n\r\n&lt;span &gt;&lt;span &gt;松泉老协2023年元宵节灯谜活动&lt;/span&gt;&lt;/span&gt;\r\n \r\n&lt;span &gt;&lt;span &gt; &lt;/span&gt;&lt;/span&gt;\r\n \r\n \r\n \r\n&lt;br /&gt;\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n&lt;span &gt; &lt;/span&gt;\r\n&lt;/h2&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;　　2023年2月4日，松泉社区小公园里张灯结彩，锣鼓喧天，热闹非凡，打破了三年疫情以来的寂静，春回大地，一派生机勃勃。这里是松泉社区老年人协会正在举办的2023年元宵佳节猜灯谜活动。过年的喜庆还在兴头，又迎来了中华民族的传统节日元宵佳节，为了传承和欢庆这个具有文化内涵，象征团圆、和谐、追求的节日，丰富社区老年人的文化生活，促进社区和谐，老年打协会举办的这场猜灯谜活动更增添了节日气氛，为社区老年人带来了欢乐。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;腰鼓队的表演气势磅礴，拉开了灯谜活动的序幕。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n  \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n&lt;p &gt;                  &lt;span &gt;&lt;span &gt;一条条象征中华汉字文化构造和内函的谜语语吸引了大家的注目，并引发活动者聚精会神，深思熟虑。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n[!\r\n&lt;p &gt;&lt;wx-open-launch-weapp id=&quot;launch-btn-7&quot; username=&quot;gh_ebfb250249c1&quot; path=&quot;pages/previewImg/index.html?id=4m0dcygi&amp;c=h5&amp;cn=h5wx_article_picture_01_mini&amp;idx=5&amp;enwater=true&amp;nickname=张美玉&amp;uid=29221376&quot;&gt; &lt;/wx-open-launch-weapp&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;一份耕耘一份收获，谜底一一被揭晓，收获兑奖后的喜悦&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;                  &lt;span &gt;&lt;span &gt;猜谜活动不仅给老年人带来了欢乐，更是在欢乐中增长了知识，启迪了智慧，充分展现出老年人的聪明才智和积极向上、对生活充满了热情和希望！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt;  &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843790', '1675843790', '');
INSERT INTO `ey_article_content` VALUES ('9', '14', '&lt;p&gt; &lt;span &gt;&quot;月圆向吉，花开向喜&quot;春节喜庆余味未尽，正月十五元宵节即将来临。国展社区于&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Times New Roman&quot;&gt;2&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;月&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;3&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;日开展了&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&quot;闹元宵，制花灯&quot;社区邻里融入活动，现场吸引近&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Times New Roman&quot;&gt;20&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;对社区亲子参加活动，让他们感受传统节日魅力。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;活动中，工作者首先为参与者讲解了元宵节的由来及元宵节中国各地方习俗。古时候的花灯是驱魔降福、祈求光明的，现今代表人们希望今年能够平安喜乐又一年。&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;带着文化的气息和美好的祝福，开始制作花灯。此次活动邀请社区骨干力量&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;-&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;三位剪纸老师现场指导。老师拿着制作好的花灯样品，一边示范一边向参与者详细讲解了花灯制作的步骤。在老师的指导下，大家积极的动起手来，他们相互帮助、相互学习，其乐融融。经过一个多小时的不懈努力，一个个漂亮的花灯呈现在大家眼前，每个人的脸上都洋溢着幸福的笑容。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;小小的花灯，展现的是&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;国展&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;社区的&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;烟火气&quot;和&quot;人情味&quot;，搭建起的是社区&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;居民&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;们相互交流沟通的桥梁，也进一步增强了&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;社区&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;凝聚力和向心力，&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;促进社区融入&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;。&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843794', '1675843794', '');
INSERT INTO `ey_article_content` VALUES ('10', '15', '&lt;p&gt;          &lt;span &gt;&lt;font face=&quot;Calibri&quot;&gt;2023&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;年&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;2&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;月&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;3&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;日上午，赤岭头社区组织开展网络防诈主题座谈分享活动，邀请&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;来自社区内的&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Calibri&quot;&gt;25&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;名&lt;/font&gt;&lt;/span&gt;&lt;span &gt;长者&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;参加此次活动。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;活动现场，志愿者讲师先是回顾了以往的课程，再次为大家讲解防诈骗知识，对之前开展的知识讲座中普及的知识进行温故知新。紧接着，便让学员们分享一下自己身边发生或听说的欺诈案例，长者轮流进行分享。有长者分享接到电话说自己小孩晕倒了被送去医院，要往账号里面打&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;5000&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;块钱，当时就问了一句班长叫什么名字，是男的是女的，对方就把电话挂断了。还有长者分享很早就听说冒充公检法，要人转钱过去等等，骗子的手段层出不穷，但是，大多数人在遇到这种情况还是能够谨慎处理的。最后，让大家根据所学知识填写了调查问卷，并拍照发放礼品，大家纷纷表示遇到诈骗行为，一定要沉着冷静，将所学到的防诈骗知识运用到现实中，要树立意识。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;此次&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;活动既&lt;/span&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;考验了&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;老年人对防诈知识的储备量&lt;/span&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;，&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;又&lt;/span&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;进一步&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;加深了&lt;/span&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;老&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;年&lt;/span&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;人&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;的防诈意识&lt;/span&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:16.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843794', '1675843794', '');
INSERT INTO `ey_article_content` VALUES ('11', '16', '&lt;p&gt; &lt;span &gt;为&lt;/span&gt;&lt;span &gt;弘扬我国传统文化节日&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;传达尊老、爱老、敬老、助老的中华民族传统美德，营造元宵欢乐祥和的节日氛围，&lt;/span&gt;&lt;span &gt;2月&lt;/span&gt;&lt;span &gt;5&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋_GB2312&quot;&gt;日&lt;/font&gt;&lt;font face=&quot;仿宋_GB2312&quot;&gt;,葵涌办事处助老项目社工&lt;/font&gt;&lt;/span&gt;&lt;span &gt;联合社区工作人员&lt;/span&gt;&lt;span &gt;在溪涌社区开展了&lt;/span&gt;&lt;span &gt;&quot;元宵送暖，欢度佳节&quot;溪涌社区元宵节花灯喜庆会&lt;/span&gt;&lt;span &gt;，本次活动共有&lt;/span&gt;&lt;span &gt;50&lt;/span&gt;&lt;span &gt;名社区长者参加。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; &gt;&lt;b&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;活动&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;签到&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;justify&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;此次活动设置了猜灯谜、品汤圆和制花灯三个环节，活动形式丰富多样，活动氛围热闹温馨。高悬的灯笼旁挂着一条条灯谜，涵盖古今中外的文化知识，谜底包罗万象，吸引参与者争相竞猜。在社工的引导下，参与者积极制作汤圆，搓面粉、揉面团、放馅料等工序一气呵成，没一会儿就煮出一锅热气腾腾的汤圆，吃进嘴里，暖在心中。制花灯环节中，志愿者给长者发放花灯材料并耐心讲解制作步骤，长者沉浸在制作花灯的乐趣中，一盏盏五彩花灯很快就被制作出来，为节日增添了浓厚的喜庆色彩。&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;猜灯谜&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;本次&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;元宵节花灯喜庆会&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;活动&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;极大地丰富了社区长者晚年精神文化生活，促使社区长者在活动过程中收获愉快体验感，有利于促进社区长者的身心健康发展。&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;制作汤圆&lt;/span&gt;&lt;span yes\';font-family:仿宋_GB2312;mso-hansi-font-family:宋体;&amp;#10;font-size:16.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843795', '1675843795', '');
INSERT INTO `ey_article_content` VALUES ('12', '17', '&lt;p&gt;        &lt;span &gt;&quot;花灯贺岁，福满元宵&quot;每年农历正月十五为元宵节，又称上元节、元夕或灯节；元宵节素有赏花灯、吃汤圆、猜灯谜等一系列传统民俗活动。为弘扬中华传统文化，让社区居民们度过一个幸福、安康、充实的元宵节，2023年2月4日下午，在五和社区党委和公益基金的支持下，党群服务中心的社工们组织开展了&quot;闹&quot;元宵活动。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;         &lt;span &gt;&quot;汤圆汤圆，团团圆圆&quot;，活动当天，社工准备好包汤圆的食材：糯米面粉、各种馅料，食盒等，邀请了社区志愿者们现场制作，随着香甜的馅料在白白的糯米面中滚动，一个个白胖胖、圆滚滚的汤圆逐渐摆满桌面。不一会儿，一阵扑鼻的香气袭来，热腾腾的白胖汤圆出锅了；随后，大家端着热腾腾的汤圆在党群文化广场派发给社区居民。五和社区党委&lt;/span&gt;&lt;span &gt;陈委员&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;为暖蜂驿站的快递员们上门送温暖，&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;希望大家吃了这碗热热的汤圆，往后的日子甜甜蜜蜜，阖家团团圆圆。&quot;同时，志愿者们打包好三百多份汤圆，社区领导在元宵节来临之际慰问社区物业、环卫工人等。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&quot;小灯谜大智慧&quot;，灯笼摇福星照，社工和志愿者们将红红的灯笼挂在帐篷里，下面挂着丰富的谜题，既有通俗易懂的趣味猜题，也有较为复杂的抽象谜题，兼具娱乐性与知识性，吸引了社区居民的热情参与。大家积极开动脑筋，或是相互讨论、集思广益，整场活动欢声笑语不断，其乐融融；&quot;巧手做花灯&quot;， 灯笼，又称灯彩，是一种古老的中国传统工艺品，挂起象征团圆意义的灯笼，欢声笑语又一年。活动中准备了两款兔子手工灯，居民们猜对谜语后，可以凭奖券兑换一份手工灯材料，大家现场制作，并展示拍照，活动现场热闹非凡。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;    本次活动通过挂灯笼猜灯谜、制作手工花灯、搓汤圆吃汤圆等方式闹元宵，共同建设居民和善、邻里和睦、生活和乐的文化氛围。五和社区党群服务中心在&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;2023年将持续开展形式多样、群众喜闻乐见的文化惠民活动，进一步丰富社区居民的精神文化生活，不断增强居民的获得感、幸福感。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843815', '1675843815', '');
INSERT INTO `ey_article_content` VALUES ('13', '18', '&lt;p&gt;福兔贺元宵 欢乐满鹿丹&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; 有灯无月不娱人，有月无灯不算春。俗话说&amp;quot;不出十五都是年&amp;quot;，过完元宵才算给春节画上句号。2月4日，在鹿丹村社区党委的引领下，鹿丹村社区新时代文明实践站、鹿丹村社区长者服务站、中海鹿丹名苑物业服务中心联合开展迎元宵，庆佳节活动。组织社区居民观看表演、猜灯谜，吃汤圆引导群众过一个健康、文明、祥和的节日。&lt;/p&gt;&lt;p&gt;&lt;br type=&quot;_moz&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br type=&quot;_moz&quot;/&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;活动现场共七个精彩的表演正进行中，以小小舞蹈家《中华孝道》表演节目开场.在一阵阵的掌声、欢笑声中，也迎来了鹿丹村社区高龄长者2023年第一个集体生日会，吴副书记与寿星们一同许下美好心愿，并与寿星们一同切开蛋糕。在场的工作人员及长者纷纷为老寿星们送上生日祝福，齐声合唱《生日快乐》歌，并祝福各位老人健康长寿。长者们脸上都洋溢着幸福的笑脸。&lt;/p&gt;&lt;p&gt;&lt;br type=&quot;_moz&quot;/&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;悬挂在树上的灯谜，内容涵盖了党风廉政、精神文明、安全生产、民生工程、科普保健、法律常识等方面，各式各样的灯谜也吸引了居民们的踊跃参与。很快一条条谜语就被居民猜出,兑换成一份小小的礼物。在猜灯谜的活动中体验别样的乐趣，细细品味浓浓元宵节的团圆和喜庆。一碗碗热气腾腾的汤圆也被端上了桌子，大家围坐在一起，观看表演并品尝着甜丝丝的汤圆，脸上都洋溢着满满的笑容，心中有说不完的幸福。&lt;br type=&quot;_moz&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;通过此次活动，使鹿丹村社区广大居民的精神文化需求得到了满足，同时弘扬了民族文化，丰富了社区居民的文化知识，开阔了视野，让居民过上一个温馨、愉悦、轻松的元宵节。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;挂满树上的灯谜&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;一碗碗热气腾腾的汤圆&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;幼舞蹈—中华孝道 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;团体舞蹈—新年快乐舞蹈—书简舞&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp;走秀—东方旗袍&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;口琴演奏—《喜洋洋》 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;古筝演奏—《女人花》&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;《卖汤圆》表演&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p class=&quot;pageLink&quot; style=&quot;text-align:center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;', '', '1675844468', '1675844468', '');
