t; Name=&quot;List Table 2 Accent 5&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;48&quot; Name=&quot;List Table 3 Accent 5&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;49&quot; Name=&quot;List Table 4 Accent 5&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;50&quot; Name=&quot;List Table 5 Dark Accent 5&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\nName=&quot;List Table 6 Colorful Accent 5&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\nName=&quot;List Table 7 Colorful Accent 5&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;46&quot;\r\nName=&quot;List Table 1 Light Accent 6&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;47&quot; Name=&quot;List Table 2 Accent 6&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;48&quot; Name=&quot;List Table 3 Accent 6&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;49&quot; Name=&quot;List Table 4 Accent 6&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;50&quot; Name=&quot;List Table 5 Dark Accent 6&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\nName=&quot;List Table 6 Colorful Accent 6&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\nName=&quot;List Table 7 Colorful Accent 6&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Mention&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Smart Hyperlink&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Hashtag&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Unresolved Mention&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Smart Link&quot; /&gt;\r\n&lt;/w:LatentStyles&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!---ecms [if gte mso 10]&gt;\r\n&lt;style&gt;\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:普通表格;\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-parent:&quot;&quot;;\r\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\nmso-para-margin:0cm;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.5pt;\r\nmso-bidi-font-size:11.0pt;\r\nfont-family:等线;\r\nmso-ascii-font-family:等线;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:等线;\r\nmso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:等线;\r\nmso-hansi-theme-font:minor-latin;\r\nmso-font-kerning:1.0pt;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n&lt;p class=&quot;MsoNormal&quot;  align=&quot;center&quot;&gt;&lt;br /&gt;\r\n&lt;span  lang=&quot;EN-US&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 春天来了，万物复苏，草长莺飞，最适合与自然来一场美好的春天约会。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 面对生机盎然的春天，乐群社区老协于&lt;span lang=&quot;EN-US&quot;&gt;2023&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;7&lt;/span&gt;日在深圳人才公园组织绿道踏青活动，成为人才公园里的一道风景线。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 深圳人才公园，地处深圳市南山区后海片区，毗邻深圳湾超级总部基地，与深圳湾滨海休闲带相连，占地面积&lt;span lang=&quot;EN-US&quot;&gt;77&lt;/span&gt;万平方米，其中湖体面积&lt;span lang=&quot;EN-US&quot;&gt;30&lt;/span&gt;万平方米。该公园通过将大量的人才元素融入自然景观的方式，打造出内涵丰富、景观多元的现代化滨海公园，是全国第一个人才主题公园。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 乐群社区老协的骨干们，沿着绿道邂逅在春花烂漫时光里，漫步在绿意盎然、花香四溢的花丛中，呼吸着春天的气息，用脚步丈量着美丽绿道，用一路摄影留住春天的风景。在这里，大家全身心地释放快乐的因素，在美丽风景里充分享受公园城市生活，与大自然和谐相融。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 时间在漫步绿道中慢慢流走，乐群社区老协的人才公园绿道行活动在轻松且身心快乐中结束。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span  lang=&quot;EN-US&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843832', '1675843832', '');
INSERT INTO `ey_article_content` VALUES ('15', '20', '&lt;p &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;农历兔年春节即将来临之际，在社区党委的领导下，茂业社区党群服务中心于&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;16-17&lt;/span&gt;日开展了&quot;义写春联送祝福 喜庆祥和迎兔年&quot;迎春送福活动，活动共向&lt;span lang=&quot;EN-US&quot;&gt;60&lt;/span&gt;位社区居民、&lt;span lang=&quot;EN-US&quot;&gt;20&lt;/span&gt;多个辖区内单位和组织送去春联和福字，表达新春的问候和祝福。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span lang=&quot;EN-US&quot; &gt;16&lt;/span&gt;&lt;span &gt;日，活动邀请了汪长旭、贾卫红等两位社区书法家同时也是党员志愿者为社区书写了&lt;span lang=&quot;EN-US&quot;&gt;60&lt;/span&gt;副对联和&lt;span lang=&quot;EN-US&quot;&gt;100&lt;/span&gt;个福字，多名中小学生义工在现场协助老师写春联、协助党群工作人员晾春联以及分装和整理。活动现场翰墨飘香、年味渐浓，义工们身着红马甲，忙碌的身影给寒冷冬日带来阵阵暖意。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span lang=&quot;EN-US&quot; &gt;17&lt;/span&gt;&lt;span &gt;日，多支&quot;送福小分队&quot;分赴茂业城、康达尔、名城国际等社区各个花园小区，把春联和福字送到有需要的居民家里以及社康、医院、残协、物业、花园党支部等辖区内各个单位和组织，同时报名参加活动的居民也纷纷前来党群服务中心领取春联和福字。&quot;送福&quot;现场欢声笑语，红红火火的春联福字和居民脸上洋溢的笑容给社区带来浓浓的新春喜庆的氛围。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span lang=&quot;EN-US&quot; &gt;2023&lt;/span&gt;&lt;span &gt;年春节是疫情政策优化后的首个春节，人民群众心中对美好生活的向往随着新春佳节的到来愈发强烈。&lt;span lang=&quot;EN-US&quot;&gt;2023&lt;/span&gt;年茂业社区党群服务中心将继续携手多方力量，共同为社区居民办实事、增福祉，共建共享美好生活。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;right&quot; &gt;&lt;span &gt;通讯员：尹宇华&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span lang=&quot;EN-US&quot; &gt;&lt;o:p&gt; &lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span lang=&quot;EN-US&quot; &gt;&lt;o:p&gt; &lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span lang=&quot;EN-US&quot; &gt;&lt;o:p&gt; &lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span lang=&quot;EN-US&quot; &gt;&lt;o:p&gt; &lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843835', '1675843835', '');
INSERT INTO `ey_article_content` VALUES ('16', '21', '&lt;p &gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;为弘扬中华民族传统文化，丰富青少年文化生活，营造文明和谐、喜庆祥和的节日氛围。&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;2&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;月&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;5&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;日在茂业社区党委的指导支持下，茂业社区新时代文明实践站&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;联动哏好教育党支部&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;举办&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;浓浓邻里情 欢乐庆元宵&quot;茂业社区元宵节活动，让大家过上一个有温度、有年味的节日。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;活动中，&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Arial;&amp;#10;mso-hansi-font-family:Arial;mso-bidi-font-family:Arial;font-size:12.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;社区工作人员&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;为小朋友介绍了元宵节的由来和习俗，&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;&quot;&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;元宵节的习俗有哪些？&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;&quot;&quot;&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;我来回答，有猜灯谜、吃汤圆、赏花灯、踩高跷&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;…&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Arial;&amp;#10;mso-hansi-font-family:Arial;mso-bidi-font-family:Arial;font-size:12.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;..&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&quot;&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;小朋友和家长们欢聚一堂，小朋友们唱歌、&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Arial;&amp;#10;mso-hansi-font-family:Arial;mso-bidi-font-family:Arial;color:rgb(25,25,25);&amp;#10;font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;弹琴&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;、表演才艺，一起感受传统节日的喜乐氛围，收获喜悦和美好记忆！&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;灯笼&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Arial;&amp;#10;mso-hansi-font-family:Arial;mso-bidi-font-family:Arial;font-size:12.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;DIY&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;环节，&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;工作人员将灯笼的制作材料分发给孩子们，并逐步讲解制作过程及注意事项，小朋友们跃跃欲试，小心翼翼地进行绘画、镂空图案、粘贴、组装，家长在一旁细&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;心协助。不一会儿，各式各样色彩斑斓的灯笼就映入眼帘，小朋友们脸上洋溢着喜悦的笑容。工作人员精心准备了灯谜，灯谜内容丰富，趣味盎然，同时，工作人员还邀请居民一起品尝甜蜜汤圆，整个场面热闹、温馨、其乐融融。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;小小的灯笼，传递的是一份节日的问候、一份祝福。在欢&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Arial;&amp;#10;mso-hansi-font-family:Arial;mso-bidi-font-family:Arial;color:rgb(25,25,25);&amp;#10;font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;庆&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;元宵的活动过程中，不仅提高了青少年的动手动脑能力，丰富了青少年们的精神文化生活，让青少年感受到了中华传统文化的独特魅力，更传递了文明和谐的良好家风。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; align=&quot;right&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Arial;&amp;#10;mso-hansi-font-family:Arial;mso-bidi-font-family:Arial;color:rgb(25,25,25);&amp;#10;font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;通讯员：陈子如&lt;/span&gt;&lt;span yes\';font-family:Arial;mso-fareast-font-family:宋体;&amp;#10;color:rgb(25,25,25);font-size:12.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;mso-font-kerning:1.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843837', '1675843837', '');
INSERT INTO `ey_article_content` VALUES ('17', '22', '&lt;p &gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;在元宵佳节来临之际，茂业社区党群服务中心&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;在&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;2月4日上午&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;开展&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;红歌唱响闹元宵&quot;长者节日活动，向社区20余名长者送去节日的祝福，组织社区长者一起分享元宵习俗、制作元宵、猜灯谜、唱红歌。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;首先，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;工作人员&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;带领长者们一起分享自己家乡的元宵习俗，有的长者说是吃饺子，有的是逛灯会、踩高跷表演等等。热情地向大家介绍自己家乡的元宵习俗。接着&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;工作人员&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;介绍本次元宵制作需要用到的物资，电器等，并将现场人员进行分组，讲解过程中的注意事项，在每组中选出一名元宵制作达人进行带领，并作出教学示范。在制作过程中大家互相讨论包汤圆的手法，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;有的说不放黑芝麻，有的说要放白糖，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;亲手作出一个个圆溜溜的大&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;元宵&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;。&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;在制作完成后，大家一起煮元宵，热气腾腾的元宵出锅，大家品尝自己的劳动果实更觉得美味无比。接着，工作人员组织长者们进行猜灯谜活动。本次灯谜以成语类为主，采用个人抢答的形式，大家积极举手，互相帮助，欢声笑语不断。长者们一起合唱红色主题歌曲，歌颂美丽中国。最后长者们分组演唱了歌曲《卖汤圆》，&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;卖汤圆卖汤圆，小二哥的汤圆是圆又圆&quot;。活动在长者们的悦耳的歌声中结束。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;right&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;通讯员：梁桃&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843839', '1675843839', '');
INSERT INTO `ey_article_content` VALUES ('18', '23', '&lt;p &gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;span &gt;2023年2月2日，茂业社区党群服务中心举行寒假课堂结班仪式活动。本次寒假课堂面向社区小学生、初中生共提供70人次的服务，除了写作业及课业辅导、图书阅读等常规服务，还有多名学生参与了社区写春联、送春联活动协助志愿服务。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:14.0000pt;&quot;&gt;在结班仪式上，党群工作人员带领青少年共同回顾了寒假课堂服务，并向积极参与的青少年发放文具表示鼓励。&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:14.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:14.0000pt;&quot;&gt;&quot;我在春节收获了红包；我在寒假课堂读了好几本有意思的书；我想要提高我的读后感写作能力；我希望在寒假课堂可以玩有趣的游戏；我希望在寒假课堂可以和小伙伴一起下棋&quot;……在工作人员的带领下，同学们纷纷分享在春节及寒假期间的收获并提出对寒假课堂的期望和建议。&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:14.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:14.0000pt;&quot;&gt;活动最后，通过讨论分享，工作人员引导青少年在新学期即将来临之际调整作息、规律饮食、减少娱乐、增加学习、总结收获、反思遗憾、积极准备、做好计划，以崭新的面貌迎接新学期的到来。&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:14.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;right&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:14.0000pt;&quot;&gt;通讯员：尹宇华&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:14.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843840', '1675843840', '');
INSERT INTO `ey_article_content` VALUES ('19', '24', '&lt;span &gt;      为了进一步推动文明城市创建，让居民充分了解文明公约，弘扬中华民族传统美德，2月8日上午，翠鹏老协志愿者给居民发放创建文明城市宣传单。&lt;/span&gt;\r\n \r\n&lt;span &gt;      志愿者前往人流量大的社区主干道向过路居民和沿街商铺进行创建文明城市的倡议书的发放，广泛宣传创建文明城市的意义和标准，普及文明礼仪知识，增强居民对创建文明城市工作的认同感。&lt;/span&gt;\r\n \r\n&lt;span &gt;      此次活动旨在让居民们更好地参与创建文明城市工作中，成为文明城市的创建者，让居民充分了解社区为创建文明城市各项内容，从中获得参与感，共同打造一个文明、和谐、美好的家园。&lt;/span&gt;\r\n \r\n&lt;span &gt;     创建文明城市没有完成时，只有进行时，老协志愿者应当发挥模范带头作用，充分调动居民创建文明城市的积极性，倡导大家从自身做起，自觉做好健康行为习惯管理，自觉养成文明习惯，自觉遵守文明交通，倡导环境保护，健康生活，引导广大居民从身边小事做起，讲文明，树新风，自觉践行社会主义核心价值观。社区居民也应该自觉捡起掉落城市的每一片垃圾，让我们共同生活的社区变得更加干净整洁，共同打造一个&quot;花园社区魅力的翠鹏&quot;。&lt;/span&gt;\r\n \r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n&lt;p align=&quot;center&quot; class=&quot;pageLink&quot;&gt;&lt;/p&gt;', '', '1675843854', '1675843854', '');
INSERT INTO `ey_article_content` VALUES ('20', '25', '&lt;p &gt;&lt;span &gt;     农历正月十五是一年之中第一个月圆之夜，古人称夜晚为&quot;宵&quot;，所以这一天又被称为元宵节。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;     在这一天，人们会结伴出门，上街游玩，庆祝大地回春，祝福亲友在新的一年喜乐安康。疫情三年后第一个开放年，清水河社区老年人协会在这个中国传统节日里与全国人民同欢乐举行节日活动。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      会员们都说今天好开心哦，真正的过了一个元宵节，我们举着龙敲锣打鼓庆祝我们今天的幸福生活。正月十五大家在一起热热闹闹，这样才能消灾解难，处处张灯结彩，热闹非凡。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt;&lt;span &gt;&lt;/span&gt;&lt;wx-open-launch-weapp id=&quot;launch-btn-4&quot; username=&quot;gh_ebfb250249c1&quot; path=&quot;pages/previewImg/index.html?id=4lx1waw4&amp;c=h5&amp;cn=h5wx_article_picture_01_mini&amp;idx=2&amp;enwater=true&amp;nickname=罗英&amp;uid=24651949&quot;&gt;&lt;span &gt;&lt;/span&gt;&lt;/wx-open-launch-weapp&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      元宵节可不能少了圆汤圆。香甜软糯，团团圆圆，和和美美，会员们都是一家亲。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      元宵佳节闹花灯，谜语人人猜。社区居民一起参加了猜出谜语送祝福。你看这个小朋友猜的多认真啊猜出灯谜笑容满面。一起欢歌唱喜悦，幸福生活身边围绕！&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844212', '1675844212', '');
INSERT INTO `ey_article_content` VALUES ('21', '26', '&lt;p&gt; 为了丰富社区文化生活，让社区居民度过一个愉快祥和的元宵佳节，在高峰社区党委的支持下，2月5日下午，赤岭头社区党群服务中心在社区篮球场开展以&quot;共建共享玉兔年，居民亲情闹元宵&quot;为主题的元宵节活动，以传统猜灯谜为中心点，玩游戏，品汤圆。活动现场吸引了近二百多名居民的参与，欢声笑语萦绕着整个活动现场。&lt;/p&gt;\r\n活动在热闹，和谐的气氛中开展。当天上午，工作人员组织社区志愿者亲手包汤圆，煮汤圆。搓、捏、按、团，一块块白色的糯米面团在志愿者手中变成诱人的汤圆。下午，在社区篮球场，猜灯谜、玩游戏、品汤圆。上百条谜语涵盖科普知识，法律知识医药知识、统计知识等，形式上处理字谜，还有词语迷、地名职业名词科普环保等，几句娱乐性，又具知识性。汤圆分成咸、甜两种口味，到场的居民朋友自行根据口味选择，端上一碗热腾腾的汤圆，个个脸上洋溢着欢快的笑容。\r\n元宵节活动为居民们营造了一个温馨、欢乐、祥和的节日氛围，受到广大居民的一致好评。负责活动的社工介绍，在后疫情时代开展这样的活动不仅传承了传统节日的民俗，同时，激发了大家参加社区活动的积极性为构建和谐社区起到了积极作用。', '', '1675844212', '1675844212', '');
INSERT INTO `ey_article_content` VALUES ('22', '27', '&lt;p&gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;strong&gt;&lt;span &gt;&lt;span &gt;春风习习荡漾中&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;&lt;br type=&quot;_moz&quot; /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       春风荡漾，马蹄疾飞。疫情三年中时停时起的社区便民服务义工队又活跃起来了。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       这便民服务义工队包括为居民免费理发，缝纫，诊疗服务。在理发义工队伍里有一位头发全白，胡子花白，身材瘦削，佩戴老花眼镜的老人，他，就是年过八旬的，服务时间长达二十年的深圳市五星级党员志愿者杨大金老师。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       初识杨大金，是我初到这个社区的事。那是一个便民服务日，人群中有一位神采奕奕的老人，手拿本子走着问着写着什么，一打听才知他在担任当天便民服务日的记工员。他就是杨大金。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       简谈后才知他来自四川省阆中中学，年年教高三，曾担任过一个完全中学的副校长。2002年退休后跟随子女来到深圳坂田四季花城落户。我们顿时套近乎起来，咱哥俩都是中学高级教师出身，他与我的人生经历经有许多相似之处。其后，我常向深圳老年网站写通讯，他就给我提供义工素材。再其后，更知他有热爱公益事业的义工情结。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;        一．热心社区奉献。当时的社区开盘不久，居住环境优越，但周边偶有噪音骚扰，居民生活环境不够安静。2003年起，社区就组织了护守苑落的义工巡逻队，杨大金就参加了社区的巡逻队，为社区居民安全站岗放哨，他手中至今还保存有一张当年发给的&quot;优秀巡逻队员&quot;的荣誉证书。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;        2004年起，他又参加了党员活动室义务值班，直到2019年，共计十六年。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       2005年起参加了便民服务，当记工员、理发，直到现在。服务过的老人无以计数。平时常为高龄老人，独居老人和离退休老人上门服务。社区义工日是社区的节日，到时，居民们从四面八方来到服务现场接受服务，杨大金总是最早到达服务现场，忙碌地搬桌凳，抬机器，布电线，继而是分流居民，维护服务秩序，记录当天战绩。十多年的义工日记录一天不缺。义工日结束，又搭手将桌凳，机器放回原处。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       细看他的本子，都记录着每位专职义工理发、缝补衣物、医疗义诊、家电维修、缝补衣物、心理咨询、磨菜刀、打狂犬疫苗服务居民人数，各项累记。一年结束，就有一张总表，记录着全年每个义工的服务人数，整个义工队的服务总时数。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;        后来，他又直接为居民理发。我问他&quot;杨老师，您怎么会理发呢？&quot;杨大金说，那是在上学时学来的，当时班上同学互相理发，我是偷师学艺。我还会缝纫呢！&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       二．参加党建社建。2004年起，他参加了党员活动室义务值班，直到2019年，共计十六年。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       由于是新建社区，四季花城2002年9月才建立党支部，当时只有5个党员。扩大队伍寻找流动党员是当务之急。杨大金便参加了这项工作。当时没有手机，较少电话，只有靠双腿白天晚上跑苑串户。他便同一些党员一道，大力宣传中组部&quot;退休党员人在哪组织关系就在哪&quot;的指示。很多来自内地的党员也在寻找党组织，但不知找谁，怎样办理组织关系转移手续，办来后又交给谁。杨大金便给与一一作答，几年后，在社区党委和全体党员共同努力下，社区党员增到二百多人，流动党员管理成了全国先进社区，社区党委书记上北京开会，领回了中组部颁布发的全国&quot;先进离退休干部党支部&quot;的光荣金牌。社区党支部也逐渐由支部扩大到总支、党委，而今的社区党委，下设离退休老干部党委。杨大金还参加了老干党委下的关工委工作，向小学生自愿捐书，学生放学时带着红袖章站在马路边当维护交通秩序的纠察员。多年来，年逾八旬的杨大金老师可谓名副其实的&quot;优秀党员志愿者&quot;！。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;        在义工队里，杨大金每年都达五百小时以上的服务时数，2006年就被深圳市义工联评为&quot;深圳市五星级义工&quot;。杨大金老师还多才多艺，他还爱好书法、古典诗词、还经常在有关杂志媒体上参加征文活动并频频获奖！在我的眼里，杨大金老师不仅是一位名副其实的为民服务的优秀党员志愿者义工，而且他还是一位为社区文化建设作出过不凡业绩的&quot;优秀文化义工&quot;！兔年开春之际，特祝杨大金老师全家吉祥安康！幸福快乐！心想事成，晚霞生辉！&lt;/span&gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;span &gt;钟胜兆&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;span &gt;于2023年2月5日&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p &gt;作者与杨大金老师合影&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;', '', '1675844213', '1675844213', '');
INSERT INTO `ey_article_content` VALUES ('23', '28', '&lt;p &gt; &lt;span data-font-family=&quot;default&quot; &gt;元宵&lt;/span&gt;&lt;span data-font-family=&quot;default&quot; &gt;  &lt;/span&gt;&lt;/p&gt;\r\n \r\n\r\n\r\n\r\n&lt;p class=&quot;paragraph text-align-type-left&quot; &gt;&lt;span data-font-family=&quot;default&quot; &gt;月出山头四友催，元宵今夜又轮回。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;paragraph text-align-type-left&quot; &gt;&lt;span data-font-family=&quot;default&quot; &gt;观灯猜谜无眠夜，户户贏来奖品归。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;paragraph text-align-type-left&quot; &gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844213', '1675844213', '');
INSERT INTO `ey_article_content` VALUES ('24', '29', '&lt;p&gt;            &lt;font face=&quot;微软雅黑&quot; &gt;临近元宵之际，为了增添社区的节日氛围，同时为居民之间搭建相互交流沟通的平台，增进亲子之间的感情，新洲社区于&lt;/font&gt;&lt;font face=&quot;微软雅黑&quot; &gt;2月4日下午开展了一场&quot;元宵灯谜会，等你来狂欢&quot;的活动，让居民感受到节日的温暖，并借活动弘扬我国的传统文化。&lt;br /&gt;\r\n&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;微软雅黑&quot;&gt;活动中，社区工作者通过&lt;/font&gt;&lt;font face=&quot;微软雅黑&quot;&gt;PPT课件向大家讲解元宵节的由来及民间习俗习惯；&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;微软雅黑&quot;&gt;猜灯谜是元宵节的保留项目，谜面设置精巧，谜底出人意料。参加活动的居民朋友们时而脱口而出，时而眉头紧锁，给节日的氛围中增添了思考的趣味&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;微软雅黑&quot;&gt;。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;微软雅黑&quot;&gt;最期待的环节就是亲子手工制作花灯和吃汤圆啦！工作人员一边讲解花灯的制作过程和注意事项，一边派发材料包。现场热闹非凡，小朋友们摩拳擦掌，跃跃欲试。有的自己动手小心翼翼地进行折叠、粘贴、衔接，家长在一旁细心协助；有的两两联合，互帮互助，在欢快氛围中不一会儿，小兔子花灯便做好了。大家看着自己的成品，都赞叹太漂亮了，陈女士还说：&lt;/font&gt;&lt;font face=&quot;微软雅黑&quot;&gt;&quot;这活动真棒，学习知识、动手制作、还可以和大家一起过节，真开心！&quot;最后大家一起围着喜笑颜开品尝工作人员为大家煮好的汤圆，热气腾腾的汤圆入口，满满的福气滚滚而来！&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;微软雅黑&quot;&gt;活动结束后，居民纷纷感叹这次元宵节很有意思，也很有意义，非常感谢社区工作人员的付出。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;本次与活动既传承了中华民族传统节日的文化魅力，又活跃了社区文化生活，拉近了社区和居民的距离，同时增进了亲子交流，增强了社区的凝聚力。&lt;/span&gt;&lt;/p&gt;', '', '1675844214', '1675844214', '');
INSERT INTO `ey_article_content` VALUES ('25', '30', '&lt;p &gt; &lt;b &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;我们的节日&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;——怡心社区开展&quot;欢乐闹元宵，趣味猜灯谜&quot;主题活动&lt;/font&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;为迎接即将到来的元宵佳节，让社区长者、新就业群体家庭感受祥和喜乐的节日气氛，&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;2023&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;年&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;2&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;月&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;3&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;日下午，怡心社区党委、新时代文明实践站、怡心社区长青老龄大学联合开展我们的节日——&quot;欢乐闹元宵，趣味猜灯谜&quot;活动，活动共吸引了&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;30&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;名居民踊跃参与。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;本次活动共设置了&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;话元宵&quot;&quot;品元宵&quot;&quot;猜灯谜&quot;环节。社工先给居民讲述了元宵佳节的由来和风俗习惯，吃汤圆、看花灯、猜灯谜、耍龙灯、舞狮子、踩高跷等。在活动过程中，大家也踊跃分享了不同地方的元宵习俗，现场的各位居民听得津津有味。通过分享环节，让大家贴近了传统生活，了解不同的民间风俗和文化传承。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;参加活动的陈阿姨说：&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;很开心参加今天的活动，大家聚在一起过节啦，吃了汤圆，今年会更加幸福，圆满。&quot;&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;在猜灯谜环节中，大家&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;都积极参与其中，&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;有的与身旁的朋友&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;窃窃私语&quot;，有的自己在手里不停地比划、沉思。内容丰富的灯谜吸引了大家，谜面有趣而通俗，你一言、我一语地互相提示和讨论。猜对答案的长者欢欢喜喜地领取了一份小礼品。活动现场洋溢着欢乐、祥和、喜庆的气氛，让现场居民充分享受传统灯谜文化带来的乐趣。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;本次的元宵节主题活动，得到了现场居民的一致好评，弘扬了中华民族传统文化，让现场居民对传统的灯谜文化有了进一步的了解，也丰富了社区节日文化生活，增加了邻里间的感情，让大家感受到了怡心社区大家庭的温暖。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;center&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;', '', '1675844214', '1675844214', '');
INSERT INTO `ey_article_content` VALUES ('26', '31', '&lt;p &gt;       &lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&quot;日月春辉渐，光华万物兴&quot;元宵节承载着丰厚的历史文化底蕴，是中华民族的传统佳节。为&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;了让&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;社区居民们进一步了解传统节日，在传统节日中感受传统文化魅力，进而尊重我们的民间风俗习惯，热爱我们中华民族的传统文化。&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;2023年2月4日上午10：00—11：30，新洲社区开展&quot;诗歌&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;话&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;情谊，团圆幸福年&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;主题活动&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;,&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;以诗的情怀，用诗的语言歌颂传统文化。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;活动开始主持人简单介绍了一下元宵节：&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;元宵节，又称上元节、小正月、元夕或灯节，时间为每年农历正月十五。古人称&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;夜&quot;为&quot;宵&quot;，正月十五是一年中第一个月圆之夜，所以称正月十五为&quot;元宵节&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;接着便进入了活动环节：每位小朋友进行自我介绍并朗诵了一首自己喜爱的关于春节、元宵节、新年或春天的诗歌，并简要说明了喜爱的理由！活动现场气氛热烈，高潮迭起，个人才艺展示环节，每个小朋友们都争先恐后展示自己的拿手绝活，掌声此起彼伏，喝彩声不绝于耳&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;……&lt;/font&gt;&lt;/span&gt;&lt;span &gt;  &lt;font face=&quot;宋体&quot;&gt;此次迎元宵活动的诗歌朗诵，不仅为小朋友们提供了一个展示自我的舞台，增强了孩子的自信心，而且在中国传统文化的熏陶下，小朋友们与同伴分享诗词之美，感受古人的智慧，从中汲取营养，涵养心灵。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;font face=&quot;宋体&quot; &gt;  &lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;font face=&quot;宋体&quot; &gt;       元宵节是&lt;/font&gt;&lt;font face=&quot;宋体&quot; &gt;&quot;火树银花合，星桥铁锁开&quot;的热闹，是&quot;春到人间人似玉，灯烧月下月如银&quot;的诗情，是&quot;热泪盈眶啥滋味？久别重逢分外喜&quot;的团圆，是&quot;艳艳灯笼高高挂,唯求福祉百万年&quot;的祝愿。冬将尽，春可期，愿我们的生活能如这元宵诗会一般红红火火，喜气洋洋！&lt;/font&gt;&lt;/p&gt;', '', '1675844215', '1675844215', '');
INSERT INTO `ey_article_content` VALUES ('27', '32', '&lt;p &gt;          &lt;span &gt;&lt;span &gt;&quot;辞岁鞭炮催春潮，迎新锣鼓闹元宵&quot;&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;元宵节，又称上元节，是中国春节年俗中最后一个重要节令。正月十五吃元宵，在我国也由来已久。&lt;/span&gt;&lt;span &gt;桂园街道红村社区特殊的历史背景，&lt;/span&gt;&lt;span &gt;社区内的高龄空巢老人和独居老人较多，这也一直是社区党委重点关心关注的重点。为了&lt;/span&gt;&lt;span &gt;提升社区居民的归属感，增进邻里间的感情提升社区长者的生活幸福感，&lt;/span&gt;&lt;span &gt;由红村社区党委的主导&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;深圳市东西方社工服务驻红村社工协办，&lt;/span&gt;&lt;span &gt;2月3日下午，在红村社区&lt;/span&gt;&lt;span &gt;新时代文明实践站二楼举办的&quot;浓浓邻里情，佳节庆元宵&quot;构建邻里互动互助工作坊，&lt;/span&gt;&lt;span &gt;来自红村社区的30多位居民欢聚在一起，看节目、聊家常、玩游戏、猜灯谜、吃汤圆&lt;/span&gt;&lt;span &gt;……&lt;/span&gt;&lt;span &gt;，热热闹闹、其乐融融庆元宵。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;下午14:30参与活动者如期而至，参加本次活动的长者大部分是社区的独居老人，由于担心老人上楼不便，红村社区义工早在楼下等待并搀扶。&lt;/span&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;活动开始&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;红村社区党群服务中心党委书记陈珊珊发表了祝福讲话，祝愿社区的叔叔阿姨新年快乐、身体健康，社区工作人员和社工将持续关注困难居民和倾听居民需求&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;及时提供帮助，并预祝大家元宵节快乐。&lt;/span&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;深圳是一个文明城市，也是一个没有方言、包容性很大城市，有句话说得好&quot;来了就是深圳人&quot;，在主持人的介绍下迎来精彩的开场舞&quot;来了就是深圳人&quot;、&lt;/span&gt;&lt;span &gt;互动游戏环节&quot;大风吹&quot;和&quot;古代投壶&quot;，参加者有点手忙脚乱&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;惹得大家哈哈大笑，活动现场充满了欢声笑语，洋溢着祥和喜庆的气氛。&lt;/span&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;热身游戏过后&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;主持人着重地介绍过去一年 &quot;老伙伴&lt;/span&gt;&lt;span &gt;、&lt;/span&gt;&lt;span &gt;志愿行&quot;项目总结和未来展望&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;随着一张张照片的回放&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;主持人对其中的故事娓娓道来&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;span &gt;&quot;老伙伴&lt;/span&gt;&lt;span &gt;、&lt;/span&gt;&lt;span &gt;志愿行&quot;项目是社工挖掘培养低龄老人志愿者，为高龄老人进行结对精准帮扶服务，从而形成邻里守望相助、敬老爱老的社会氛围&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;span &gt;去年共开展了上门服务&lt;/span&gt;&lt;span &gt;15&lt;/span&gt;&lt;span &gt;次&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;总服务时长达到&lt;/span&gt;&lt;span &gt;30&lt;/span&gt;&lt;span &gt;多个小时&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;接受过服务的老人们反应热烈&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;志愿者优秀表现也获得长者们的充分肯定&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;span &gt;因此在新的一年&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;社区会大力开展这个活动&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;继续构建互助型的社区助老养老环境&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;/span&gt;&lt;span yes\';font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;pre&quot; &gt;&lt;span &gt;&lt;span &gt;节目继续进行，到了大家最翘首以盼的环节&lt;/span&gt;&lt;span &gt;&quot;&lt;/span&gt;&lt;span &gt;猜灯谜&quot;有奖竞猜环节。活动现场有冥思苦想的居民，有猜出谜语豁然开朗的居民，猜对谜底的居民都能获得一份社区精心准备的小礼品&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;pre&quot; &gt;&lt;span &gt;&lt;span &gt;。&lt;/span&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'PingFang SC\';&amp;#10;mso-hansi-font-family:\'PingFang SC\';mso-bidi-font-family:\'PingFang SC\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;pre&quot; &gt;&lt;span &gt;随着妙趣横生的猜灯谜游戏的告一断落，最后来到我们团团圆圆品汤圆看表演环节。由&lt;/span&gt;&lt;span &gt;&quot;心之灵&quot;红村社区健身操队伍就为老人们献上 &quot;防诈骗&quot; 健身操表演&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;热情洋溢的动作引得大家拍掌叫好&lt;/span&gt;&lt;span &gt;，表演结束居民和工作人员一起煮汤圆，不一会热腾腾的汤圆端上了桌，&lt;/span&gt;&lt;span &gt;大家吃着美味甜糯的汤圆，聊着元宵节话题，吃在嘴里，甜在心里。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 活动尾声，社工派发参加者意见表收集大家的意见，居民们纷纷为我们点&quot;赞&quot;，并建议社区内多开展类似的活动，活跃社区气氛、增进邻里之间的感情。&lt;/span&gt;&lt;span &gt;大家一起玩，时间过得很快，独居老人何绍娟表示社区组织这样的活动，为我们孤寡老人增添了节日气氛也给我们带来关爱和温暖，我们就愿意参加这样的活动，感谢社区党委，没有忘记我们。&lt;/span&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;此次活动的开展，构建了社区邻里互动互助，提高了老人们生活的幸福感，营造了一个和谐互助文明的社区氛围，给持续构建美好红村添上了浓墨重彩的一笔。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;span &gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;(来源：红村社区   通讯员：刘海琳)&lt;/span&gt;&lt;/span&gt;&lt;span yes\';font-family:Calibri;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844216', '1675844216', '');
INSERT INTO `ey_article_content` VALUES ('28', '33', '&lt;p class=&quot;p&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;元宵节，是我国重要的传统节日，为营造欢乐祥和的气氛，丰富社区居民的文化生活，&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;202&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;3&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;年&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;2&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;月&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;3&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;日下午，第五园社区党委、社区党群服务中心在新时代文明实践站开展&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;喜气洋洋闹元宵&quot;元宵节&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;手工汤圆&lt;/font&gt;&lt;font face=&quot;Calibri&quot;&gt;DIY&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;活动&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;，通过亲手制作汤圆，一起感受浓厚的节日氛围和节日的热闹与欢喜。&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:14.0000pt;&amp;#10;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;活动现场，大家一起动手和面、和馅、搓汤圆，交流着关于元宵的习俗，聊着过年期间的趣事，现场气氛浓烈，不一会儿，一个个圆滚滚的汤圆就摆满了桌子，已经出锅的汤圆分装到小碗中&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;，&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;大家&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:13.5000pt;mso-font-kerning:0.0000pt;&amp;#10;background:rgb(250,250,250);mso-shading:rgb(250,250,250);&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;吃&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:13.5000pt;&amp;#10;mso-font-kerning:0.0000pt;background:rgb(250,250,250);mso-shading:rgb(250,250,250);&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;上自己的劳动成果&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:Calibri;mso-fareast-font-family:宋体;&amp;#10;mso-bidi-font-family:\'Times New Roman\';font-size:13.5000pt;mso-font-kerning:0.0000pt;&amp;#10;background:rgb(250,250,250);mso-shading:rgb(250,250,250);&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;，脸上洋溢着幸福的笑容&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:13.5000pt;&amp;#10;mso-font-kerning:0.0000pt;background:rgb(250,250,250);mso-shading:rgb(250,250,250);&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;，&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;香甜&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;软糯&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;的&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;汤圆&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Arial&quot;&gt;&quot;&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;甜在嘴里，也甜在心里。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; align=&quot;center&quot; &gt;&lt;span &gt;&lt;o:p&gt; &lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;一碗温热的汤圆&lt;/font&gt;,&lt;font face=&quot;宋体&quot;&gt;一个温暖的笑容&lt;/font&gt;&lt;font face=&quot;Arial&quot;&gt;,&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;一句温馨的问候，&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;在&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;你来我往的欢声笑语中，社区&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;与&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;群众心更近、情更亲，温情满满。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt; &lt;/span&gt;&lt;/p&gt;', '', '1675844217', '1675844217', '');
INSERT INTO `ey_article_content` VALUES ('29', '34', '&lt;p &gt;        &lt;span &gt;元宵节是中国的传统节日之一，又称上元节、元夕或灯节。为大力弘扬传统民族文化，积极营造欢乐祥和的节日气氛，2月5日元宵节当天下午坪地街道团工委联合怡心社区党委、怡心社区新时代文明实践站、怡心社区党群服务中心在怡心广场开展了&quot;庆元宵，承文化&quot;——怡心社区欢乐元宵汇活动，活动共有176名新就业群体及社区居民参与。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;span &gt;为了让社区居民更好的学习二十大精神，活动还将党的二十大会议精神融入谜题。红红的灯笼和五彩的灯谜整齐悬挂，处处彰显节日气氛。参与活动的新就业群体及社区居民有的紧盯谜面、独自斟酌，有的低头凝思、忽而露出恍然大悟的神色，有的全家齐上阵进行激烈的&quot;辩论&quot;，有的直接撕下灯谜，向兑换区走去。兑换区秩序井然，前来参与活动的人群络绎不绝，领到奖品的参与者笑容满面。&quot;知道这里有猜灯谜的活动，早早的就领着孩子来参加了，猜灯谜活动既能益智健脑，又能让大家感受到中国传统文化的魅力，也为社区文化建设增添了新的色彩。&quot;一位参与活动的居民家长表示。&lt;/span&gt;\r\n \r\n \r\n&lt;span &gt;&lt;br /&gt;\r\n     活动期间，怡心社区党委副书记萧艳灵到活动现场为新就业群体及社区居民分发元宵，祝愿大家的生活像元宵一样圆圆满满。活动丰富了社区节日文化生活，营造了欢乐、喜庆、祥和的节日氛围。&lt;/span&gt;\r\n \r\n  \r\n&lt;span &gt;本次活动是怡心社区党委贯彻党的二十大精神，坚持中国特色社会主义道路，坚持以人民为中心的发展思想，为民办实事的重要举措之一，接下来社区党委将在街道党工委的坚强领导下，将节日活动打造成常态化年度节庆活动，让社区居民收获到满满的幸福感。&lt;/span&gt;', '', '1675844217', '1675844217', '');
INSERT INTO `ey_article_content` VALUES ('30', '35', '&lt;p&gt;         &lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&quot;花灯映金，圆月如壁，繁光远缀天，把元宵言欢，玉壶光转，吉祥绕指尖&quot;。为庆祝一年一度元宵节，营造浓浓的节日氛围，让居民度过一个温馨、愉快的元宵佳节，长龙社区新文明实践站在长龙社区党委的指导下，&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;举办了&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;巧手做灯笼，欢喜过元宵活动&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;为主题的元宵节活动，邀请社区居民共同参与，一起感受党和政府温暖的同时大力弘扬中华优秀传统文化，激发民族情感。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;此次元宵&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;活动&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;，社区工作者&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;为大家准备了兔子灯笼&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;diy&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;，参与活动的居民&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;聚精会神的自制精美的灯笼，&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;掏洞&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;、&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;组装&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;......大家三两互助，忙的不亦乐乎。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;并且社区工作人员&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;精心收集了&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;100多条的灯谜，灯谜内容丰富，趣味盎然，既具娱乐性，又具知识性。大家穿梭于灯笼和彩纸谜语间，或驻足沉思，或激情讨论；整个活动现场充满了欢笑、快乐和喜庆。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;元宵是美好的寄托，是幸福的挂念，也是一种真诚的祈福。本次元宵节活动，营造了浓重的节日氛围，不仅让居民亲身体验传统文化的魅力，感受到中华民族传统节日中折射出的浓郁文化气息，更在增进社区工作人员与社区居民之间的交流、拉近距离的同时，弘扬了元宵节的民俗传统。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844218', '1675844218', '');
INSERT INTO `ey_article_content` VALUES ('31', '36', '&lt;p&gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;      &quot;春来人间暖，节来万家圆&quot;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;      正月十五，是一年中的第一轮圆月，是一年之中最美好的开始。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;      年年岁岁元宵节，岁岁年年庆团圆。在这个举国共欢庆的美好佳节日，愿国泰民安、山河无恙、人间皆安，愿祖国越来越强大，愿世界和平、无灾无难，愿我们安享这盛世的美好！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;     春节刚过，元宵已至，为了丰富群众的文化生活，活跃元宵节节日氛围，传承我们的节日传统文化，2月5日晚元宵佳节之日，梧桐艺术团（民乐队、舞蹈队）参加盐田区文化馆&quot;春暖上元&quot;海山街道专场文艺汇演活动，让我们感受到了党和政府的温暖，感受到春天的信息……。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;      花好月圆，灯火璀璨，在这欢乐祥和的美好之夜，梧桐老协民乐队，一曲《花好月圆》用熟悉的旋律欢歌载舞拉开序幕！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt;             &lt;/p&gt;\r\n&lt;p&gt;                 &lt;span &gt;&lt;span &gt;浮云散，明月照人来，团圆美满今朝醉，柔情蜜意满人间，花好月圆唱今朝…在这阖家团圆的日子，愿大家花好月圆人长久！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;       欢乐的草原无限希望，蓬勃的热土百业兴旺，人民在这里走向富强，勤劳的人们放声歌唱…梧桐舞蹈队带来热舞《欢乐草原》。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;      啊，中国梦，世代的梦，风风雨雨岁月匆匆；中国梦，人民的梦，红红火火美在心中；中国梦，伟大的梦，繁荣富强幸福大同；梧桐舞蹈《中国梦》表达了对祖国的美好祝愿！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;       灯火映万家，团圆共此时。元宵佳节，海山梧桐欢欢喜喜闹元宵，热腾腾的元宵弥漫着团圆的味道，红灯笼的迷底滿含着吉祥的寓意，璀璨的花灯装点着海山梧桐的各条街道，此外，还有许多丰富多彩的节目活动，营造着热烈隆重、欢快喜庆的节日氛围。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;      欢歌热舞庆元宵，歌舞升平迎新春。月宵之日，团圆之时，春天在这个元宵节向我们走来，海山梧桐各处传来欢乐歌声，唱出了新春的祝福；海山梧桐各处跳起欢快的舞蹈，跳出了新春的喜悦。每一个海山梧桐人踏着自信的节拍，激扬青春的风采，放飞希望和梦想。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;', '', '1675844219', '1675844219', '');
INSERT INTO `ey_article_content` VALUES ('32', '37', '&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;　　&lt;/span&gt;&lt;span &gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      大展宏兔闹元宵，左邻邻里庆佳节。2月3日下午，沙头角社区党委民生微实事，正在沙头角社区文体广场举办一场久违了3年的元宵节游园活动，深深吸引了社区邻里男女老少。广场里人潮人海溢满至围栏边外、罗鼓宣天，载歌载舞热闹非凡，沉浸在一片欢乐的海洋……。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      沙头角社区党委专职副书记钟芳亲自主持节目，沙头角社区党委书记书记陈碧惠致辞、居民委员会主任钟达平和各级相关领导一起参加了活动。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;        游园活动内容精彩，有魔幻般的魔术表演；精彩的歌舞表演：《开门红》、《欢乐中国年》、《亲吻祖国》；优美动听的小组唱《妈妈教我一支歌》；节目中间穿插有奖问答；猜谜语；吃汤圆；游戏……。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      沙头角社区老协志愿者，为元宵活动增添精彩，在社区党委的支持激励下，和老协杨流文会长的支持下，秘书长王祥珍亲自带领，临时组织了13名志愿者，近活动前两天突击苦练，时间紧任务急，硬生生的排练出一个新舞蹈《开门红》，活动当天第一个节目出场拉开元宵节活动序幕，跳的红红火火、整齐有序，跳出了欢快、跳出了力量、跳出了久违的扬眉吐气！受到在场观众的一片片欢呼喝彩！虽然时间短促，但是仍然不负初心，交出了一份满意的答卷。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;        久违的节日氛围，久违的年味，久违的欢聚，久违的感觉，邻里们好像想一下补回，男女老少、子孙三代齐参与，个个笑逐颜开，在欢快乐声中欣赏表演，抢答题环节观众非常勇跃，特别是小朋友举手飞快，让我们主持节目的钟芳书记几乎难分先后；玩游戏，猜谜语、兑奖品、吃汤圆……游园活动在欢乐中依依不舍中结束。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;       祝愿祖国风调雨顺，国泰民安，年年有今日，岁岁有今朝。&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;主持节目钟芳书记&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;社区党委书记陈碧惠为活动致辞&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;参加活动的全体领导&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;参加活动的全体工作人员、志愿者&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;抢答环节&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', '1675844221', '1675844221', '');
INSERT INTO `ey_article_content` VALUES ('33', '38', '&lt;p&gt; &lt;span &gt;红红的灯笼照出新春的喜庆，甜甜的元宵拉近居民的距离。近日，在禾花社区党委的领导下，党群服务中心、新时代文明实践站联合举办了&quot;元宵佳节明月圆&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; &gt;  &lt;/span&gt;&lt;span &gt;团圆汤圆话团圆&quot;元宵节主题活动，让辖区居民感受元宵节的喜庆气氛，助推社区居民融合。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;此次元宵活动设置了猜灯谜、吃汤圆、送汤圆等环节。送汤圆、猜灯谜活动现场，一张张写着灯谜的纸条在跳跃在小灯笼中洋溢着浓浓的节日气息，妙趣横生又应时的谜面让参与活动的家长、孩子纷纷开动脑筋。辖区居民品尝了美味的汤圆，共庆元宵佳节，现场充满了欢声笑语。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;活动的开展，既活跃了社区居民的文化生活，又加强了社区与居民之间的沟通，弘扬了中华民族传统文化，让社区居民感受到了传统节日的文化魅力，同时促进了居民的社区融合。&lt;/span&gt;&lt;/p&gt;', '', '1675844221', '1675844221', '');
INSERT INTO `ey_article_content` VALUES ('34', '39', '&lt;p &gt;      &lt;span &gt;2月3日下午，由沿港社区党委主办，沿港社区服务服务站、沿港社区党群服务中心、沿港社区老年人协会主办的&quot;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;欢乐迎新春，邻里一家亲&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;2023年春节系列活动之&lt;/span&gt;&lt;span &gt;&quot;欢乐闹元宵，携手向未来&quot;元宵游园会于沿港新村篮球场火热开展。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;此次游园会内容丰富、形式多样，除了精彩、欢乐的舞麒麟、书简舞、客家山歌等节目表演外，还设置了猜灯谜、&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;新春投壶、快乐保龄球、瑞兔圈圈乐、&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;&quot;棋&quot;乐融融等摊位互动游戏；同时，活动现场美食区内，志愿者还不时将&lt;/font&gt;&lt;/span&gt;&lt;span &gt;烹煮好的香甜美味的汤圆派发给到场居民，让居民切实感受到了节日氛围和社区大家庭的温暖；此外&lt;/span&gt;&lt;span &gt;，活动现场还设置了&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;打卡区和心愿墙，参与居民纷纷与&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;&quot;新年瑞兔&quot;同框留念，记录美丽瞬间，不少居民还纷纷执笔在心愿墙写下自己的新年愿望和祝福……&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;据悉，此次活动服务辖区居民&lt;/span&gt;&lt;span &gt;350人次，通过活动的开展，&lt;/span&gt;&lt;span &gt;进一步增进了社区邻里关系，促进居民之间的互动和交流，增强居民的社区归属感和幸福感，进而营造了团结奋进、文明和谐、喜庆祥和的节日文化氛围。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844577', '1675844577', '');
INSERT INTO `ey_article_content` VALUES ('35', '40', '&lt;p&gt;           &lt;font face=&quot;仿宋&quot; &gt;为了送去党和政府对社区困难人群的节日慰问和关爱，增强困难人群的社区归属感和幸福感，拓宽其社会支持网络，&lt;/font&gt;&lt;font face=&quot;仿宋&quot; &gt;2月1日-3日，沿港社区党委，沿港社区老年人协会组织开展了一场&quot;新春送温暖，关爱社区行&quot;新春关爱行动，入户上门慰问残疾、低保、高龄老人等困难人群。&lt;span &gt;&lt;o:p&gt; &lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;活动中，社区工作人员先后来到辖区困难人群家中，与探访对象进行亲切交谈，询问和了解他们目前的生活、身体状况以及遇到的困难，一起和他们商讨解决困难的的方法，并鼓励他们要保持积极乐观的心态，树立生活的信心，一起克服暂时的困难；同时为他们送上了面粉、食用油、饼干等慰问物资，并表达了新春关爱和祝福，以及叮嘱其在春节期间注意居家安全，出门佩戴口罩，做好自身防疫保护。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;此次活动，共走访慰问&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;10户家庭。通过活动的开展，拉近了社区与居民之间的距离，让慰问对象感受到社区大家庭的温暖，也增强了他们的社区归属感和生活信心。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844577', '1675844577', '');
INSERT INTO `ey_article_content` VALUES ('36', '41', '&lt;p class=&quot;s3&quot; &gt;&lt;span &gt;金兔送福、福到我家——金地社区举办闹元宵DIY工作坊 &lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;     2月3日上午，在金地社区党委的带领下，金地社区新时代文明实践站驻东西方社工在金地名轩二楼举办金兔送福、福到我家——金地社区闹元宵DIY工作坊。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      活动现场，社工带领14名社区居民了解剪纸的起源和文化，参与者通过剪窗花等感受传统文化的魅力，一张张别样的花纹引得参与者连连惊叹传统文化的神奇，另外还有DIY兔型灯笼制作，现场共享年俗、共话生肖，在表达期盼环节，参与者希望身体健康，孩子学业进步。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      正月十五闹元宵，花灯十里正迢迢，参与者们带着祝福和花灯喜迎元宵佳节。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;', '', '1675844578', '1675844578', '');
INSERT INTO `ey_article_content` VALUES ('37', '42', '&lt;p class=&quot;s3&quot; &gt;&lt;span &gt;&quot;金兔纳福迎元宵&quot;笋西社区开展吃汤圆猜灯谜庆元宵活动&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;   又是一年元宵节！为弘扬传统民俗文化，丰富社区居民节日文化生活，2月3日下午，在笋西社区党委和妇联的支持下，笋西社区新时代文明实践站(党群服务中心)联合正阳社工机构在宝龙嘉园开展了一场&quot;金兔纳福迎元宵&quot;吃汤圆、猜灯谜庆元宵活动，70余名社区长者及家属参加了本次活动。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;   活动现场居民们有说有笑，现场一片欢乐。社工提前精心挑选了知识性、趣味性为一体的经典谜语挂起来供居民竞猜，大家看谜面，猜谜语，有的自己默默沉思，有的几人聚在一起互相探讨，猜对的都会获赠纪念品一份。猜完灯谜，大家开始品尝热腾腾的汤圆，黑芝麻馅、花生馅、紫薯馅都挺受欢迎的，大家一边吃着汤圆，一边聊着家常，脸上都洋溢着开心的笑容。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      此次庆元宵活动，不仅是社区对居民的佳节祝愿，也提升了大家对社区的认同感和归属感，营造了欢乐喜庆、祥和文明的新春节日氛围。今后笋西社区新时代文明实践站将继续开展类似活动，努力将社区打造成文明、友爱的幸福家园。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;', '', '1675844580', '1675844580', '');
INSERT INTO `ey_article_content` VALUES ('38', '43', '&lt;p class=&quot;s3&quot; &gt;&lt;span &gt;下早社区党企群齐聚庆元宵&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      元宵佳节将至，为营造喜庆、欢乐、祥和的节日氛围，2023年2月3日，在高峰社区党委的支持与指导下，下早社区开展以&quot;瑞兔纳福，欢乐闹元宵&quot;为主题的社区庆元宵节活动，进一步对中国传统文化进行传承。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;     本次活动社区特邀服务社区的30名社会自组织、企业、志愿者和社区骨干居民一起制作客家特色咸骨汤圆。活动开始后，在下早社区居委会副主任谢拥兰同志的带领下，大伙忙着和粉，准备排骨、虾米、萝卜、芹菜、葱花等熬汤食材。有人撸起袖子准备待粉和好后动手搓汤圆，有人劈好柴、洗净锅、生起火等着把做好的汤圆放入锅中烹煮，整个过程分工有序，不一会，一盆盆热腾腾的汤圆摆放在大家面前。现场，下早股份合作公司党支部书记黄孟山同志与大家围坐一起，大家品尝着自己亲手制作的汤圆，心里乐开了花。&quot;闹元宵，煮汤圆，骨肉团聚满心喜，男女老幼围桌边，一家同吃上元丸。&quot;一碗冒着热气的汤圆，不只满足了味蕾，更代表了中华传统文化的流传与沉淀。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      除此之外，社工也精心准备了元宵，与高峰社区党委委员、企业和志愿者一起，带上煮好的汤圆一齐慰问&quot;格&quot;内25名高龄老人、残障人士和退伍军人，表达元宵佳节的问候与祝福。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;      活动负责社工表示：&quot;通过本次活动的开展，希望服务社区的大众能够感受到社区的温暖和热情，更希望能够进一步提振社区的精气神，激活发展活力，更好地满足社区党员群众精神文化方面的需求。&quot;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;span &gt;现场大合照&lt;/span&gt;\r\n&lt;p &gt;&lt;span &gt; &lt;/span&gt;&lt;span &gt;企业代表一起和粉&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p &gt;&lt;span &gt;社区骨干居民&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;慰问社区高龄老人&lt;/span&gt;&lt;/p&gt;', '', '1675844583', '1675844583', '');
INSERT INTO `ey_article_content` VALUES ('39', '44', '&lt;p class=&quot;s3&quot; &gt;&lt;span &gt;颐年之友，共度元宵&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;——沙湖社区开展元宵活动&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;     元宵佳节来临之际，在碧岭街道和沙湖社区党委的带领下，沙湖社区党群服务中心在沙湖社区文明实践展开展了元宵活动。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;     首先，社区长者义工田阿姨向大家分享当地的元宵做法，在她的带领下大家一一分享自己家乡的元宵。紧接着，义工田阿姨一步一步演示调配比例、和面等步骤。大家陆续跟着田阿姨制作，一个个粉元宵、绿元宵映入眼帘。现场气氛一团和谐，洋溢着节日的祥和。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;     最后，大家围坐一团吃着精致美味的元宵。大家一边吃着美食，一边畅想着对新一年的期待，一起讨论新一年对服务的期望。钟姐回想到：过去三年像是一场梦，现在开始期待回归新一年的生活。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;     此次活动吸引了约30人参加，包括防疫义工、长者义工、巾帼义工和老年协会等。此次元宵活动，让这些义工朋友聚在一起，共度元宵，畅想社区美好生活。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;', '', '1675844585', '1675844585', '');
INSERT INTO `ey_article_content` VALUES ('40', '45', '&lt;p&gt;          &lt;font face=&quot;宋体&quot; &gt;为丰富社区长者文化生活，&lt;/font&gt;&lt;font face=&quot;宋体&quot; &gt;2023年2月3日上午，丽湖党群服务中心联合丽湖社区新时代文明实践站、海王星辰药店丽湖分店开展&quot;多彩活动庆元宵•敬老爱老送健康&quot;——丽湖社区长者助老服务活动，活动共吸引20位社区长者参与。&lt;/font&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;font face=&quot;宋体&quot; &gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       活动开始，社工向大家介绍此次活动内容和活动规则后带领大家玩&quot;元宵圆又圆&quot;手指操，长者们学习十分认真，一起跟着做动作，口中还念念有词，完成后都忍不住哈哈大笑！&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       手指操游戏过后，社工还带领大家玩起了猜灯谜游戏，看着一条条谜语，长者们跃跃欲试，纷纷上场挑战。大家积极思考，踊跃讨论，不时传出一阵开怀大笑，一起分享灯谜带来的乐趣。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       接着，社工用PPT，与大家一起了解中国传统文化节日之一的元宵节的相关介绍，并互相分享自己家乡有趣的元宵节习俗，大家你一言我一语地交流起来，现场好不融洽！随后，在插花老师的耐心指导下，长者们一起学习插花，经过裁剪、搭配，大家都对自己的插花作品很满意，喜滋滋地相互拍照。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       插花结束后，社工接着和大家聊起在后疫情时代，老年人如何做好养生保健的话题，从心理调节、饮食调养、起居调整、运动保健等多方面进行了讲解和分享，并邀请海王星辰药店丽湖分店药师为大家测量血压、健康咨询。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       最后，随着热气腾腾、香气四溢的汤圆出锅，大家聚在一起品尝香甜的汤圆，每个人脸上都洋溢着满意的笑容！活动分享时，长者们纷纷说出对参与此次活动的满满的收获。其中任阿姨说，这次活动让她感受到了社会浓浓的爱意和关怀，感受到了亲人般的温暖，又认识了新的朋友，非常开心。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       据悉，此次活动的开展，让长者们在欢乐的氛围中感受到传统元宵佳节的文化乐趣提升长者们的获得感和幸福感，促进了社区长者的身心健康，也拉近了社区居民之间的邻里情。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;', '', '1675844587', '1675844587', '');
INSERT INTO `ey_article_content` VALUES ('41', '46', '&lt;p&gt; &lt;span &gt;   为了丰富社区长者节日文化娱乐生活，营造社区和谐、祥和喜庆的节日气氛。2月4日下午，三联社区党委、长青老龄大学、党群服务中心在三联社区老年人活动中心开展&quot;欢乐闹元宵&quot;活动。本次活动吸引了社区的20位社区长者前来参与。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;     活动伊始，社工为长者们送上了节日的问候与祝福，引导长者们练习肩颈操热热身，锻炼身体协调能力，然后进行自我介绍认识新朋友，在欢声笑语中长者们相互寻找老乡。相互熟悉之后，进入搓汤圆互动环节，由社工引导长者们分组动手合作，很快便搓出了五颜六色的小汤圆，煮出来的小汤圆晶莹剔透的看着特别喜庆和诱人....在等待汤圆煮熟的期间，社工所长者们带到了灯谜区，讲解了猜谜语活动的规则后，长者们争先恐后的进入灯谜区看谜面、猜灯谜。谜语有成语类、字谜类、动物类、植物类、物品类等谜语，经过一番冥思苦想，很快所有灯谜被一抢而空，大家排队等待谜底的揭晓和兑换小奖品，现场呈现一片热闹祥和的气氛。&lt;/p&gt;\r\n&lt;p &gt;     最后社工引导长者们品尝热腾腾的汤圆并分享活动感受，长者们纷纷表示：&quot;元宵节有伙伴们的陪伴，有好玩的灯谜和好吃的汤圆，还有奖品拿，玩的非常开心！&quot;为了表达心中的喜悦之情，吃完汤圆后长者们开心地唱起了欢快的歌曲，欢乐闹元宵活动在长者们的歌声中圆满结束。&lt;/p&gt;\r\n&lt;p &gt;     三联社区党委、长青老龄大学、党群服务中心关爱社区长者，通过开展此次活动既增进了长者之间的沟通及拉近了邻里间的距离，还增强了社区的凝聚力。满足长者文化需求的同时还弘扬了社区文化精神，让社区长者们过上了一个温馨、愉悦、轻松的元宵佳节。&lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;', '', '1675844589', '1675844589', '');
