t;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Unresolved Mention&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Smart Link&quot; /&gt;\r\n&lt;/w:LatentStyles&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!---ecms [if gte mso 10]&gt;\r\n&lt;style&gt;\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:普通表格;\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-parent:&quot;&quot;;\r\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\nmso-para-margin:0cm;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.5pt;\r\nmso-bidi-font-size:11.0pt;\r\nfont-family:等线;\r\nmso-ascii-font-family:等线;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:等线;\r\nmso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:等线;\r\nmso-hansi-theme-font:minor-latin;\r\nmso-font-kerning:1.0pt;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n&lt;p class=&quot;MsoNormal&quot;  align=&quot;center&quot;&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 由中海物业管理有限公司观山苑管理处、罗湖区文化馆、金岭社区党委、金岭社区党群服务中心主办，东湖街道老协、乐群社区老协、翠鹏社区老协、金岭社区老协、金湖社区老协参与的&quot;福兔贺元宵·欢乐满中海&quot;元宵节活动，于&lt;span lang=&quot;EN-US&quot;&gt;2023&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;日下午在观山苑二楼文化小广场隆重举行。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 活动现场，传统有趣的节目活动通过猜灯谜、品元宵、现场制作并赠送小糖人和糖葫芦及手工编制等形式展开。来自各社区老协的文艺节目演出，将活动推向高潮。大家一边品尝着美味的汤圆，一边欣赏着由各社区老协带来的才艺表演，现场一片欢声笑语，洋溢着浓浓的节日气氛。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 穿插在活动中的有奖问答活动精彩有趣，引起孩子们的抢答激情，从现场抢答的准确率来看，孩子们对中国传统节日和文化知识知之颇深，&quot;中国传统文化后继有人&quot;的感觉油然而生。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; &quot;正月十五良宵到&lt;span lang=&quot;EN-US&quot;&gt;,&lt;/span&gt;花灯吐艳把春报&lt;span lang=&quot;EN-US&quot;&gt;&quot;&lt;/span&gt;。金岭社区通过本次元宵节活动，既为社区居民带来丰富多彩的精神文化盛宴，又增进彼此邻里关系，更让大家感受到元宵节的欢乐气氛和民族传统文化的魅力，营造了良好的节日文化气氛，丰富社区居民节日文化生活，进一步促进社区与社区之间的邻里和谐，让居民度过一个愉快的节日，提高居民的幸福感和归属感。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;/p&gt;', '', '1675844594', '1675844594', '');
INSERT INTO `ey_article_content` VALUES ('43', '48', '&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\n&lt;span &gt;&lt;br /&gt;\n&lt;/span&gt;\n \n&lt;span &gt;&lt;strong&gt;福兔闹元宵，欢乐满中海&lt;/strong&gt;&lt;/span&gt;\n \n&lt;span &gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;span &gt;       为了弘扬中华民族传统节日，展现社区居民奋发向上的精神风貌，同时丰富社区居民节日的文化生活，让社区广大居民过一个欢乐喜庆，祥和文明的元宵佳节。&lt;/span&gt;\n&lt;span &gt;        2月4日下午，中海物业携手罗湖区文化馆、金岭社区党群服务中心共同举办福兔闹元宵，欢乐满中海文艺演出活动，用创意化的文娱形式来迎接元宵佳节。&lt;/span&gt;\n&lt;span &gt;        随着喜庆热烈的鼓啰声响起，由东湖街道老协三句半《新春吉祥》拉开了演出活动的帷幕！&lt;/span&gt;\n&lt;span &gt;       此作品书写了东湖长者向往和憧憬美好的幸福生活的点滴，充分展示了老有所乐，老有所为，自编自演自导的无私奉献精神。&lt;/span&gt;\n&lt;span &gt;       特别是在罗湖区老协副会长陈玉的构思策划和导演，刘永和老师笔下生辉的优秀演艺作品和幽默的演出，胡老师的专业演绎，竹君老师的最美台风，精彩的表演吸引了社区居民纷纷聚集观看。&lt;/span&gt;\n&lt;span &gt;       表演节目有：古筝、诗歌朗诵、戏曲舞蹈、琵琶演奏、手语舞蹈、小提琴演奏等陆续登台献艺，丰富多彩的表演不停的展现在舞台前，不时博得现场观众热烈的掌声，让观众耳目一新。&lt;/span&gt;\n&lt;span &gt;      最后一个节目合唱把演出活动推向高潮，欢快动听的歌曲让观众对元宵节活动充满了激情，整台文艺演出洋溢着庆元宵浓厚祥和的氛围，演出中，演员们娜娜多姿的舞姿，动听的演奏旋律和歌曲，让现场观众们感受到文艺节目的精美与快乐！&lt;/span&gt;\n&lt;span &gt;       最后，中海物业管理处代表着即兴团圆的汤圆送到居民手中，小小的汤圆承载着最纯洁的节日祝福，居民们一边品尝着汤圆和猜灯谜，浓浓的节日气氛洋溢着整个社区。&lt;/span&gt;\n&lt;span &gt;       通过此次活动，拉近了和居民之间的距离，让心与心更近，情与情更浓，社区迎喜迎元宵节的同时，将文明向上的文化生活方式引入居民之中，让居民舞出更加广阔的舞台。&lt;/span&gt;\n&lt;span &gt;       感谢中海物业，祥苑、瑞苑业主为业主庆元宵佳节举办丰富多彩的灯迷，文艺演出等精彩节目，让广大业主平安祥和，开心快乐健康，欢度乔迁后第一个欢乐元宵节。&lt;/span&gt;', '', '1675844599', '1675844599', '');
INSERT INTO `ey_article_content` VALUES ('44', '49', '&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;span &gt;&lt;strong&gt;红岭老协参与庆元宵活动&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       春迈着轻盈的脚步悄悄敲醒了人们，开启新征程，扬起梦想的风帆，追逐美好的向往。&lt;/span&gt;&lt;/p&gt;\n&lt;span &gt;       2023年2月3日，由大塘龙社区党委组织在大塘龙小区22栋一楼活动室展开庆祝元宵节，猜灯谜活动。&lt;/span&gt;\n&lt;span &gt;       红岭社区老年人协会组织会员，志愿者参与活动，会员们准时来到现场，在志愿者精心策划装扮下，整个会场充满节日的喜庆！&lt;/span&gt;\n&lt;span &gt;       听从志愿者安排活动顺序，大家争先恐后的猜谜语，相互交流，畅所欲言，其乐融融，亨受沉浸式的乐趣，互动赢奖品，套圈圈，玩法多多，吃着甜甜的汤圆寓意着生活甜甜蜜蜜，祝福大家福运财运好运连连，幸福美满。&lt;/span&gt;\n&lt;span &gt;       经过三年疫情的洗礼，通过以传统节日的喜庆冲淡疲惫的心扉，看到新希望。&lt;/span&gt;', '', '1675844601', '1675844601', '');
INSERT INTO `ey_article_content` VALUES ('45', '50', '&lt;p &gt; &lt;/p&gt;\n&lt;p&gt;&lt;span &gt;&lt;br type=&quot;_moz&quot; /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;strong&gt;&lt;span &gt;华夏大地涌春潮，欢度十五闹元宵&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p &gt;&lt;strong&gt;&lt;span &gt;—花场社区趣味闹元宵游园活动&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       为弘扬中华民族的民俗文化，营造浓厚的节日氛围，2月3日花场社区党委、花场社区党群工作处和花场老年人协会联合开展了&quot;趣味闹元宵&quot;游园活动。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;        本次活动由党群工作处廖颜敏主任策划和实施，花场老年人协会刘会长和李队长带领志愿者密切配合。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       活动设置了猜灯谜、巧手套圈、趣味投壶等环节，吸引了辖区众多居民的热情参与。在同乐大厦旁的小广场上，一个个灯笼高高挂起，一条条灯谜迎风而立。&quot;猜灯谜&quot;是一项趣味性强的传统民俗，活动组委会精心遴选了几百条灯谜，灯谜内容广泛，涵盖了党史、文学、历史、自然科学等知识，既有娱乐性又具知识性。活动现场，大人小孩一起进行&quot;头脑风暴&quot;，你一言我一语地互相提示和讨论，条条谜语被纷纷猜中，大家兴奋的摘下谜语条，去兑换精美的小礼品，个个喜笑颜开。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;        随着一个个灯谜被揭晓，活动气氛也被推向高潮，让居民更进一步了解和喜欢传统民俗，在收获满满的同时也感受到了节日氛围。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       在趣味投壶和巧手套圈的活动现场也吸引了大批市民驻足参加。本次游园活动精彩纷呈，居民有说有笑，其乐融融，活动在一片欢声笑语中落下帷幕。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       此次元宵节活动，通过&quot;寓教于乐&quot;的形式将&quot;元宵佳节&quot;融入居民群众的生活中，让居民群众感到了传统文化的独特魅力。本次活动不仅弘扬了中华民族的传统文化，更加促进了社区和谐和睦的发展，同时也宣传了志愿服务的精神。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;', '', '1675844603', '1675844603', '');
INSERT INTO `ey_article_content` VALUES ('46', '51', '&lt;p&gt;    &lt;span &gt;&lt;span &gt;     &lt;span &gt;202&lt;/span&gt;&lt;span &gt;2&lt;/span&gt;&lt;span &gt;年2月&lt;/span&gt;&lt;span &gt;3&lt;/span&gt;&lt;span &gt;日，在元宵佳节之际，&lt;/span&gt;&lt;span &gt;银湖&lt;/span&gt;&lt;span &gt;社区&lt;/span&gt;&lt;span &gt;组织&lt;/span&gt;&lt;span &gt;开展了&quot;&lt;/span&gt;&lt;span &gt;大展宏兔 喜闹元宵&quot;社区喜乐会活动，银湖社区老年人协会组织会员前来参与。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;   活动吸引了二十多位老年人协会成员的参与，活动中，大家一起猜灯谜、做游戏，还吃上了社区提供的爱心汤圆。一颗颗热乎乎、圆滚滚的汤圆象征着元宵节的团圆快乐和甜甜蜜蜜，让老协会员们感受到了社区的温暖。&lt;/span&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;   本次元宵活动，不仅增添了居民过节的喜庆氛围，而且加深了大家对中国传统节日的体会，切实推动社区民俗节日活动的健康发展，同时让大家感受到社会大家庭的温暖。下一步，银湖社区老年人协会将继续以关爱老年人为中心，组织举办、参与更多适合老年人的活动，进一步为老年人群构建和谐宜居社区。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:Calibri;&amp;#10;mso-hansi-font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';font-size:10.5000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844604', '1675844604', '');
INSERT INTO `ey_article_content` VALUES ('47', '52', '&lt;p &gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;strong&gt;&lt;span &gt;应天长慢·元宵节吟&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;span &gt;喜迎佳节至，遇新展阳和，景回轻煦。悬挂华灯，光耀万家千户。望城中道上，拂罗绮、香风微度。海滨处、绿柳烟花，舰轮停埠。    转眼东君舞。便细雨斜风，润滋花露。青少年人，往往乐临奇遇。呢喃双紫燕，将从事、旧巢新筑。今夜晚、华夏城乡，元宵欢聚。&lt;/span&gt;\n&lt;span &gt;2023年2月5日&lt;/span&gt;', '', '1675844605', '1675844605', '');
INSERT INTO `ey_article_content` VALUES ('48', '53', '&lt;p&gt; &lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;为营造良好的节日文化气氛，丰富社区居民业余文化生活，进一步促进社区和谐，迎接元宵佳节的到来。&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;2月4日下午，沙尾社区党群服务中心在社区党委的支持下，开展了&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&quot;元气满满闹元宵&quot;沙尾社区元宵节活动&lt;/span&gt;&lt;span &gt;，带领辖区居民一起动手制作灯笼，猜灯谜，品味元宵节美食，让居民感受传统节日氛围和传统文化魅力，在社区形成团结向上、健康文明的新风尚。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;本次&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;活动主要有&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;3&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;个摊位任务组成，分别是：&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;‘猜灯谜’‘&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;做花灯&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;’&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;‘&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;吃元宵&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;’，&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;活动&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;吸引了&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;200&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;名居民参与其中&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;宵节赏花灯，寓意吉祥如意，幸福美满。在社&lt;/span&gt;&lt;span &gt;工&lt;/span&gt;&lt;span &gt;的组织下，参加活动的&lt;/span&gt;&lt;span &gt;居民们聚在一起&lt;/span&gt;&lt;span &gt;，亲手做一盏元宵花灯，为元宵佳节增添乐趣。随后，志愿者分发花灯材料，&lt;/span&gt;&lt;span &gt;居民&lt;/span&gt;&lt;span &gt;们的热情一下子被点燃了，在&lt;/span&gt;&lt;span &gt;居民们认真&lt;/span&gt;&lt;span &gt;的&lt;/span&gt;&lt;span &gt;制作&lt;/span&gt;&lt;span &gt;下，变成了一盏盏漂亮的元宵花灯。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;社区广场上挂着一盏盏火红的灯笼，每个灯笼下面系着一张彩纸，现场洋溢着喜庆的氛围。社&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;工&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;精心挑选六十条谜语，彩纸上有的写着&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;松江百合叶如剑，苗如青蒜花如蝶&quot;，有的写着&quot;一亩田，四四方，冰糖葫芦里面藏&quot;，谜面包罗万象，生动有趣。社区居民积极参与，三五成群，结伴猜谜，或仰头读题，或低头沉思，大家兴致勃勃，各显其才。猜对的，立马乐呵呵的领取精美礼品，猜不出来的，继续冥思苦想。一位带着孩子来参加活动的家长说，&quot;拿奖不是最重要的，主要是让孩子感受中国传统文化，并且能从谜语中学到知识&quot;。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;一碗&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;热腾腾的汤圆，是元宵节中必不可少的节日元素。参加完&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;猜灯谜&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;、&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;做花灯&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&quot;活动的居民&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;们&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;，&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;受邀来到&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&quot;&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;吃&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;元宵&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;摊位吃汤圆&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;。社区志愿者将煮好的汤圆端上桌&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;给大家&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;品尝，白面团裹着黑芝麻馅儿，浓香馥郁，诱人可口。小小汤圆，暖胃更暖心，现场充满了欢声笑语。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;  做一盏花灯，猜一则灯谜，吃一碗汤圆，其乐融融。开展此次元宵节活动，营造了一个温馨、欢乐、祥和的节日氛围，活跃了社区文化生活，也增进了邻里情，提升了社区凝聚力。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844607', '1675844607', '');
INSERT INTO `ey_article_content` VALUES ('49', '54', '&lt;p&gt;&lt;span &gt;&lt;br type=&quot;_moz&quot; /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;strong&gt;&lt;span &gt;新田社区老协2月3日讯&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       今天上午，新田社区老年人协会召开了理事会，昝仕清会长主持了会议。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       会议内容：一是研究了2023年精学二十大精神、退役军人红心队、社区志愿者、创文、全国典范城市活动及配合社区党委各项中心工作等事项；&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       二是各片区理事（片长）交流了春节间各片区老协老年朋友们安全防护过节，健康帮护状况，整体来看新田社区正常平稳，没发生大的麻烦事；&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       三是讨论了2023年新田社区长青老年大学的相关事宜（待批后执行）；&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       四是研究与老年朋友们健康有直接关联的事。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       非常惊喜的是社区社工为今天参会的同志每人送上一份元宵，大家非常高兴，感谢社区党委、社工机构，社工朋友们长期以来对新田社区老协工作的关心、支持与帮助。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;', '', '1675844833', '1675844833', '');
INSERT INTO `ey_article_content` VALUES ('50', '55', '&lt;p&gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;&lt;strong&gt; &quot;绿色青春，平安开学&quot;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;&lt;strong&gt;---怡心社区毒品预防宣讲活动&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       2023年2月1日，青少年开学之际，为防止不法分子利用青少年的懵懂无知，怂恿青少年接触毒品从而踏上违法之路，因此怡心社区党委、怡心社区新时代文明实践站、深圳市龙岗区正阳社会工作服务中心联合开展&quot;绿色青春，平安开学&quot;为主题的禁毒宣讲活动。&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;       活动开始前，社工先抛出&quot;什么是毒品？&quot;&quot;如何分辨毒品&quot;两个问题，让青少年带着问题进入到课堂，课堂上青少年活跃发言，积极讨论，抱着有问题绝不留到课堂后的态度，&quot;原来毒品这么危险！&quot;&quot;这个好像学校外小店卖的跳跳糖啊！&quot;在课堂结束后，社工拿出仿真毒品，让青少年更直接的看到毒品的模样，从而加深禁绝毒品的思想。&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;活动顺利结束，此次活动共有13名青少年参与，青少年离场前还在畅谈毒品可能伪装的模样，放学后要尽快回家，不能让不法分子有机可趁，后续社工会开展一系列课程，让青少年学习到课堂上学习不到的知识。&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844834', '1675844834', '');
INSERT INTO `ey_article_content` VALUES ('51', '56', '&lt;p&gt;&lt;span &gt;       贴对联是中国传统新春习俗，象征着新的一年红红火火、吉祥如意，充满着对新年新岁的美好向往和祝福。为传承中华民族优秀传统文化，营造浓厚的辞旧迎新节日氛围，1月12日-13日怡心社区党委，怡心社区新时代文明实践站、怡心社区党群服务中心联合开展&quot;挥毫泼墨送春联，福兔生旺迎新春&quot;--怡心社区义写春联活动。       &lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;span &gt;本次活动邀请到了黄仲雄、陈跃波、雷玉谷、张武、邓迅通和杨博良六位义写老师。活动现场，工作人员先分发给居民对联纸，居民们找到义写老师提出了自己想要的春联内容，老师们娴熟地开始在对联纸上挥洒笔墨。&quot;一撇一捺、一横一竖，蕴含了中华民族优秀传统文化，手写春联更是一种文化传承，饱含着社区居民们对美好生活的向往&quot;，义写老师们说道。一副副反映新时代、新生活的书法春联吸引着社区居民纷至沓来，他们选其所好、奔走言欢、喜不胜收，拿着写满祝福和美好憧憬的春联，喜悦之情溢于言表，连连道谢点赞。&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;o:p&gt;&lt;span &gt;       &lt;/span&gt;&lt;/o:p&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;span &gt;活动期间，怡心社区党委副书记、志愿者学院院长萧艳灵，党委委员、团委书记林家安，团委副书记陈笑笑，社区民政员徐锐，一同到社区义写春联活动现场给义写老师送上小礼物和感谢状，感谢义写老师们践行公益精神，发扬志愿风采，丰富社区居民生活，为社区为居民呈现出一幅幅美好的新年祝福春联。正是有像书法老师们这样的志愿者们的无私奉献，怡心社区才能更美丽，居民们才能更加团结融洽。       &lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;span &gt;经过2天的义写，义写老师们共义写春联230余副。大红春联，既有挥别虎年，喜迎兔年辞旧迎新的美好愿景，也有歌颂党恩、宏图大展的励志高歌。千笔万笔书写出对新年的美好祈愿，传递出居民对幸福生活的殷殷期盼，为社区居民们带来了新春的问候和祝福，丰富了节日文化生活，营造了欢乐、喜庆、祥和的社区氛围。笔墨飘香，情暖怡心。本次活动贯彻党的二十大精神，坚持中国特色社会主义道路，坚持学习以人民为中心的发展思想，希望这样的思想与精神能够随着每年书写春联的优良传统文化一直延续下去。&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844836', '1675844836', '');
INSERT INTO `ey_article_content` VALUES ('52', '57', '&lt;p&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt; &lt;strong&gt;&lt;span &gt;闹元宵啦&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;span &gt;       咚咚锵，咚咚锵！正月十五元宵节，锣鼓喧天闹元宵，太白老人齐上阵，一起动手包饺子。哈哈今天好开心啊！&lt;/span&gt;\r\n&lt;span &gt;       在传统元宵节佳节即将到来之际，2月3日，太白老协会员欢聚在太白居会所，用包饺子的方式欢天喜地闹元宵。&lt;/span&gt;\r\n&lt;span &gt;       姐妹们今天一早就将面粉食材采购回来，马上开始进行和面、绞肉、分工合作干起来，北方的姐妹是包饺子高手，能调出多种口味包出各种花样款式的饺子，好一派热闹景象！&lt;/span&gt;\r\n&lt;span &gt;       姐妹们都说今天心情很爽，久违的笑声又回来了，真正体现了老有所乐！老姐姐谢易好说：在党的阳光照耀下，才有今天美满幸福的生活，我们应该感恩党！感恩政府！为社区精神文明建设发挥夕阳余热！&lt;/span&gt;\r\n&lt;span &gt; &lt;/span&gt;\r\n&lt;span &gt;&lt;/span&gt;\r\n&lt;span &gt; &lt;/span&gt;\r\n&lt;span &gt;&lt;/span&gt;\r\n&lt;span &gt; &lt;/span&gt;\r\n&lt;span &gt;&lt;/span&gt;\r\n&lt;span &gt; &lt;/span&gt;\r\n&lt;span &gt;&lt;/span&gt;\r\n&lt;span &gt; &lt;/span&gt;\r\n&lt;span &gt;&lt;/span&gt;', '', '1675844837', '1675844837', '');
INSERT INTO `ey_article_content` VALUES ('53', '58', '&lt;p&gt; &lt;font face=&quot;宋体&quot; &gt;家里旧红包一堆，怎么处理？变废为宝的机会来了！&lt;/font&gt;&lt;font face=&quot;宋体&quot; &gt;2月3日上午十点，沙尾社区党群服务中心联合福田区禁毒社工服务中心开展了&quot;青春不毒行 欢乐庆元宵--手工灯笼DIY&quot;活动，让青少年们在轻松欢快的氛围中学习中华优秀传统文化、学习低碳环保的节日新风尚、学习禁毒知识、同时提高青少年们的动手实践能力！&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;活动伊始，首先禁毒社工简单的给青少年们介绍了身边最常见的毒品，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;活动中，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;官社工与禁毒社工给青少年们&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;讲述了元宵节历史文化以及红包灯笼的制作技巧、注意事项&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;一起体验了红包灯笼的制作过程。小小的红包，精巧的制作，一封接一封的旧红包经过&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;青少年&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;们认真地拼接后，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;摇&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;身&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;一变&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;成了一盏盏漂亮的红包灯笼&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;。&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;最后合影留念，活动结束！&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;此次活动，不仅让&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;青少年&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;们感受到浓厚节日氛围，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;加强了他们的禁毒知识，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;提高了他们的动手实践能力&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;，&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;还&lt;/span&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;增强了他们的低碳环保意识。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844839', '1675844839', '');
