ed=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Unresolved Mention&quot; /&gt;\r\n&lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\nName=&quot;Smart Link&quot; /&gt;\r\n&lt;/w:LatentStyles&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!---ecms -ecms -ecms [if gte mso 10]&gt;\r\n&lt;style&gt;\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:普通表格;\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-parent:&quot;&quot;;\r\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\nmso-para-margin:0cm;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.5pt;\r\nmso-bidi-font-size:11.0pt;\r\nfont-family:等线;\r\nmso-ascii-font-family:等线;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:等线;\r\nmso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:等线;\r\nmso-hansi-theme-font:minor-latin;\r\nmso-font-kerning:1.0pt;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;  align=&quot;center&quot;&gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; &quot;正月十五灯正新，满城灯火白如银。&quot;元宵节是中国四大重要节日之一。正月十五闹元宵，既是中国的传统节目，也是新年里的重头戏。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 在元宵佳节来临之际，为丰富社区居民文化活动形式，弘扬传统文化、传承中华美德，营造和谐温馨的节日氛围，东乐社区于&lt;span lang=&quot;EN-US&quot;&gt;2023&lt;/span&gt;年&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;月&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;日下午在东乐社区长者食堂，以&lt;span lang=&quot;EN-US&quot;&gt;&quot;&lt;/span&gt;品汤圆赏花灯&lt;span lang=&quot;EN-US&quot;&gt;&quot;&lt;/span&gt;为主题开展的金兔闹元宵活动，让东乐社区居民一起猜灯谜、品汤圆、灯笼制作、趣味游戏等，共同感受喜庆祥和的节日气氛。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 东乐社区党委及党群服务中心对此次活动非常重视，事前做了周密的布置，活动现场为居民们准备的手工制作物品排列整齐，琳琅满目，活动室里空中五颜六色的灯笼高高挂起，灯笼和谜语在风中飘扬，整个活动的现场节日气氛浓郁、喜气洋洋。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 孩子们的趣味游戏吸引着大家的目光，孩子们的笑声在空中回荡，进一步渲染节日的氛围。大家围坐在一起制作古风灯笼、猜灯谜、品汤圆，边吃边聊，其乐融融。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt; 本次活动不仅给节日增添了浓厚的色彩，寓意着红红火火的后疫情时代生活，也让辖区中老年、青少年在潜移默化中感受和领会传统美德和传统文化，增进邻里情，丰富社区精神文化生活，营造良好的节日氛围。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;span &gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;', '', '1675844841', '1675844841', '');
INSERT INTO `ey_article_content` VALUES ('55', '60', '&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;font face=&quot;宋体&quot; &gt;    为丰富社区长者文化生活，&lt;/font&gt;&lt;font face=&quot;宋体&quot; &gt;2023年2月3日上午，丽湖党群服务中心联合丽湖社区新时代文明实践站、海王星辰药店丽湖分店开展&quot;多彩活动庆元宵•敬老爱老送健康&quot;——丽湖社区长者助老服务活动，活动共吸引20位社区长者参与。&lt;/font&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;活动开始，社工向大家介绍此次活动内容和活动规则后带领大家玩&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;元宵圆又圆&quot;手指操，长者们学习十分认真，一起跟着做动作，口中还念念有词，完成后都忍不住哈哈大笑！手指操游戏过后，社工还带领大家玩起了猜灯谜游戏，看着一条条谜语，长者们跃跃欲试，纷纷上场挑战。大家积极思考，踊跃讨论，不时传出一阵开怀大笑，一起分享灯谜带来的乐趣。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;接着，社工运用&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;PPT，与大家一起了解中国传统文化节日之一的元宵节的相关介绍，并互相分享自己家乡有趣的元宵节习俗，大家你一言我一语地交流起来，现场好不融洽！随后，在插花老师的耐心指导下，长者们一起学习插花，经过裁剪、搭配，大家都对自己的插花作品很满意，喜滋滋地相互拍照。插花结束后，社工接着和大家聊起在后疫情时代，老年人如何做好养生保健的话题，从心理调节、饮食调养、起居调整、运动保健等多方面进行了讲解和分享，并邀请海王星辰药店丽湖分店药师为大家测量血压、健康咨询。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt; &lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;最后，随着热气腾腾、香气四溢的汤圆出锅，大家聚在一起品尝香甜的汤圆，每个人脸上都洋溢着满意的笑容！活动分享时，长者们纷纷说出对参与此次活动的满满的收获。其中任阿姨说，这次活动让她感受到了社会浓浓的爱意和关怀，感受到了亲人般的温暖，又认识了新的朋友，非常开心。&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span &gt;    据悉，此次活动的开展，让长者们在欢乐的氛围中感受到传统元宵佳节的文化乐趣提升长者们的获得感和幸福感，促进了社区长者的身心健康，也拉近了社区居民之间的邻里情。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt; &lt;/p&gt;', '', '1675844843', '1675844843', '');
INSERT INTO `ey_article_content` VALUES ('56', '61', '&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;strong&gt;&lt;span &gt;大鹏新区老协2022年终总结及表彰大会&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;&lt;br type=&quot;_moz&quot; /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;        时间一晃而过，转眼一年过完了，我们迎来了2023年。回顾这一年的工作，大鹏新区老年协会，收获良多，内心充满的了感恩，也更加富有激情。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       正如雷锋日记说的：&quot;如果你是一颗螺丝钉，你是否永远坚守你工作的岗位？大鹏新区老年协会会长卢水根同志，就是这样的一位值得大家学习的榜样。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       上任八年来，为新区老年事业做出了重大的贡献。八年来、为了和谐新区建设，丰富中老年朋友的文娱体育生活，让老年人，老有所乐，老有所学，老有所为，老有所用等，让老年人发挥余热，为新区添砖加瓦，为服务老年人做好了带头的义务工。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       2023年2月3日，在鹏城印象三楼召开了年终总结会，大鹏新区老年协会全体理事，葵涌办事处，大鹏办事处，南澳办事处，各街道，各社区，共28个老年人协会会长出席了会议。还邀请了退休老干部，老党员，为新区老年事业做了贡献的先进工作者。还有中国音乐文学会会员潘英湘老师。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       同时为退休老干部进行慰问。三年疫情来，大家第一次相聚，互相见面，已是三年。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       卢会长为大会作了2022年的工作报告，和2023年的工作计划。大会每位会员代表，满面春风，会场喜喜洋洋，对未来的活动充满期待。 卢会长不负众望，把开展2023年的活动项目进行了布置，到会代表满怀喜悦，有这样的会长带头人，一心一意做好老年工作的好会长点赞！ &lt;/span&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;', '', '1675844846', '1675844846', '');
INSERT INTO `ey_article_content` VALUES ('57', '62', '&lt;p&gt; &lt;span &gt;&quot;袨服华妆着处逢，六街灯火闹儿童。&quot;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;为深入学习宣传贯彻党的二十大精神&lt;/font&gt;,进一步丰富新就业群体文化生活，弘扬中华优秀传统文化，营造欢乐喜庆的节日氛围。2023年2月3日下午，在龙岭社区党委的领导下，龙岭社区党群服务中心社工开展。&quot;元宵喜乐，玉兔送福——龙岭社区喜迎元宵活动&lt;/span&gt;&lt;span &gt;&quot;，本次活动共计服务超过50人次。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;本次元宵节活动中，居民朋友们在许愿树上挂上自己的心愿，在&lt;/font&gt;&quot;猜灯谜&quot;和&quot;投壶&quot;体验中国传统习俗和游戏，&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;在青春骄&lt;/font&gt;&quot;奥&quot;中感受冬奥运动的魅力，在&quot;快运汤圆&quot;中锻炼肺活量。活动现场还准备了汤圆和饺子，让大家在舌尖上也感受元宵喜乐的氛围。另外本次活动还慰问了快递、外卖小哥，提升新就业群体归属感、获得感、幸福感。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;据悉，此次元宵节活动，不仅促进了和谐的社区邻里关系，让居民感受到元宵佳节的喜庆氛围，也进一步增加了社区的凝聚力，增强了居民朋友们对社区的融入感和归属感，表达了对我们&lt;/font&gt;&quot;美好生活，龙岭花开&quot;的温暖祝福与美好期望。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;    最后，祝愿居民朋友们元宵喜乐，阖家幸福！&lt;/span&gt;&lt;/p&gt;', '', '1675844848', '1675844848', '');
INSERT INTO `ey_article_content` VALUES ('58', '63', '&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:仿宋;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;仿宋&quot;&gt;浓浓的春节年味还未散去，象征着美满团圆的元宵节又悄然而至。为营造文明和谐、喜气洋洋的节日氛围，丰富社区留深过节老人的业余生活，增添社区老人的过节乐趣。&lt;/font&gt;2月3日，坂田社区社工组织社区老人们，在中心提升园开展了&quot;情暖桑榆心，欢乐闹元宵&quot;活动 ，老人们齐聚一堂猜灯谜，巧用双手串起一朵朵寓意珠花，共同庆祝元宵佳节的到来。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:仿宋;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:仿宋;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;活动伊始，社工运用欢乐轻快的雨点变奏曲游戏带领大家正式拉开了此次活动的序幕；接着，社工组织大家以分组的形式进行现场元宵灯谜的竞猜，老人们纷纷寻找各种途径，使出浑身解数积极参与抢答，现场音乐声、抢答声此起彼伏，全场气氛欢乐而祥和。&lt;/span&gt;&lt;span yes\';font-family:仿宋;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:仿宋;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;在制作串珠环节，通过珠花视频教程的展现和社工现场示范，老人们很快领悟到制作珠花的技巧，经过不断地尝试以及社工们的协助，老人们最终可以熟练地串出一朵朵精致、美丽的珠花，喜悦感与成就感满满。约两小时后，一束束晶莹剔透，像钻石般轻巧，仿佛美少女般清澈的心灵串珠平安花束就展现在面前了，老人们纷纷将亲手制作的平安珠花相互展示，并分享朋友圈倾述此刻心声。&lt;/span&gt;&lt;span yes\';font-family:仿宋;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:仿宋;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;此次活动的开展，不仅提高了社区老人们的幸福感与成就感，同时丰富了社区留深过节老人的精神文化生活，使老人们的节日生活过得充实愉快。更使得老人们与社区之间的联系更近一步，老人之间的关系也更加和谐融洽。未来，坂田社区将继续多元化开展老人服务，搭建老人们和社区的桥梁，增强老人们社区参与意识；同时助力营造社区老年人们老有所学、老有所乐的晚年生活。&lt;/span&gt;&lt;/p&gt;', '', '1675844848', '1675844848', '');
INSERT INTO `ey_article_content` VALUES ('59', '64', '&lt;p&gt;          &lt;span &gt;元宵将至，在这个象征着团圆、寄托着美好祈愿的日子，为丰富社区居民节日文化生活，进一步传承弘扬中华优秀传统文化。2023年2月3日下午，在山厦社区党委的领导下，山厦社区党群服务中心、山厦社区新时代文明实践站开展了欢乐庆元宵活动。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;h5 &gt;&lt;span &gt;（热闹的活动现场）&lt;/span&gt;&lt;/h5&gt;\r\n&lt;p &gt;&quot;画时圆 写时方 冬时短 夏时长( 打一字)&quot;.......在猜灯迷区，一串串火红的灯笼高高挂起，一张张五颜六色的谜语纸条迎风飘扬，各式各样的谜语展现在面前。参与者们积极交流或低头深思，在一条条谜语前前驻足思索、各显神通。有的团队协作，一家人齐上阵，有的三五成群一起讨论，破解谜底，还有的微信视频，找家人帮忙。不一会儿功夫，一条条谜语都被解答出来，大家手举着猜出的灯谜开心地来兑奖。在花灯DIY区，参与者有序领取灯笼DIY材料包，听社工讲解元宵节的传统文化、民俗习惯，以及灯笼的制作方法。马上迫不及待地制作起了自己专属的灯笼，整个制作过程新奇有趣，制作完成还不忘拍照留念，活动场面热闹非凡，感受到了浓浓的节日氛围。&lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;h5 &gt;&lt;span &gt;（趣味猜灯谜）&lt;/span&gt;&lt;/h5&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;h5 &gt;&lt;span &gt;（花灯DIY）&lt;/span&gt;&lt;/h5&gt;\r\n&lt;p &gt;居民李叔叔告诉社工:&quot;猜灯谜活动非常有意义，既增添了节日氛围，又丰富我们的文化生活，还增长了孩子们的课外知识，一举多得。&quot;&lt;br  /&gt;\r\n此次活动为社区居民构建了一个和谐温馨的节日氛围，同时增加了居民们邻里情，弘扬了中华民族的传统文化。&lt;/p&gt;\r\n&lt;p &gt;&lt;/p&gt;\r\n&lt;h5 &gt;&lt;span &gt;（欢乐大合影）&lt;/span&gt;&lt;/h5&gt;', '', '1675844851', '1675844851', '');
INSERT INTO `ey_article_content` VALUES ('60', '65', '&lt;h2 class=&quot;mp-article-caption-title title&quot; &gt;\r\n\r\n&lt;span &gt;&lt;span &gt;&quot;疫&quot;火重生庆卯年，银荷老人笑开颜一一记银荷社区老年大学开班活动&lt;/span&gt;&lt;/span&gt;\r\n\r\n&lt;/h2&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;　　炮竹声中一岁除！癸卯年的新春佳节，带给了我们久违的祥和和欢笑，又重新然起了人们对疫后的美好生活新的希望。人们在&quot;过阳关&quot;后，迎来了新年开新局！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;      癸卯年春节初十一，龙岗区政协党组成员驻点领导罗平，园山街道驻银荷第一书记张琳，金源工业园区党委书记欧阳欣，到社区巡视座谈，看望居民，正好遇见了银荷社区长青老龄大学的银荷诗社诗词班、乐龄书法绘画班、银韵舞蹈班开班活动。只见参加活动的朋友个个精神饱满，人人神彩飞扬！随着这十几个社会组织的陆续开班，将开启新一年社区丰富多彩的文化生活，带给居民新的快乐！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;    银荷社区老年人协会在社区党委的领导下，在过去的三年疫情防控工作中，交上了满意的答卷！协会在党委领导下，成立了防疫党员先锋队，义工骨干防疫队，义工卡口巡查队，为社区祥和与安宁作出了较大的贡献！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;    今天，这些老人带着阖家团圆的满心欢喜，带着孙儿孙女走进社区党群中心，迎接无疫春天的阳光，参加正常的社团活动。以下是银荷社区社团新年过后的活动动态。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;     龙岗区政协党组成员驻点领导罗平，园山街道驻银荷第一书记张琳，金源工业园区党委书记欧阳欣，到社区巡视座谈，社区党委书记李锦雄陪同。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n&lt;br /&gt;\r\n \r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;      银荷诗社的诗友们坚持每月诗词会友，2022年写出400余首诗词，《园山》杂志出专栏四期，约稿70余首诗；《诗意龙岗》约稿100首。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;      今年是龙岗区成立30周年，诗友们写诗50余首，今天开课，他们正在切磋并朗诵。&lt;/span&gt;&lt;/span&gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;      银荷社区乐龄书画协会坚持每年进行书画比赛和展出，曾多次在区、街书法、绘画大赛中个人获奖。为居民书写对联，亦为周边社区书写对联，好评的口碑不绝于耳。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;     银荷社区银韵舞蹈队在丰富社区文化娱乐，对外交流活动中，起了重要的模范带头作用。文艺节目在市、区、街都有拿大奖。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;银韵舞蹈队今天开课，正在排练节目。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;     银荷社区走秀队自成立以来，对社区社会文艺繁荣作出了较多成绩，多次获得大奖。经过人才重组，不断为社区文化生活争光添彩&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;银荷社区走秀队今天开课，正在排练节目。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;     银荷社区的太极，佳木斯体操是深圳市龙岗区健身服务点。他们坚持日常锻炼，在市、区、街的竞赛表演中，屡获大奖。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;    银荷社区太极协会的会员今年开课，正在晨练八段绵，四十二式竞赛套路太极拳。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt;&lt;span &gt;&lt;span &gt;      银荷社区佳木斯体操队，今年开学第一课，学习佳木斯快乐舞步健身操&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;p &gt; &lt;/p&gt;\r\n&lt;p&gt;&lt;span &gt;&lt;span &gt;    银荷社区广场舞队，以广场舞聚集老年朋友在一起，享受丰富多彩的文化生活。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n&lt;p &gt; &lt;/p&gt;\r\n\r\n\r\n\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', '1675844870', '1675844870', '');
INSERT INTO `ey_article_content` VALUES ('61', '66', '&lt;p&gt;     &lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;元宵节，又称上元节、灯节，是中国传统节日之一。元宵节的习俗有很多，如：闹花灯、猜灯谜、吃汤圆等等。在元宵佳节来临之际，为了弘扬传统文化和尊老敬老精神，丰富青少年的寒假生活，提高他们的创新和动手能力，让他们感受中华传统文化的独特魅力。&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;2月&lt;/font&gt;&lt;/span&gt;&lt;span &gt;4&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;日上午，在禾花社区党委的领导下，党群服务中心、新时代文明实践站以&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;瑞兔送福，喜迎元宵&lt;/span&gt;&lt;span &gt;&quot;为主题开展迎元宵节活动。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-bidi-font-family:\'Times New Roman\';&amp;#10;line-height:200%;font-size:10.5000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;活动开始，社工首先给大家送去了新年的祝福，祝愿小朋友们在新的一年有新的收获，在学习上能&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;兔&quot;飞猛进，发奋&quot;兔&quot;强；并且告诉孩子们今天完成的灯笼会送给社区的高龄老人和社区困境家庭儿童。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-bidi-font-family:\'Times New Roman\';&amp;#10;line-height:200%;font-size:10.5000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-bidi-font-family:\'Times New Roman\';&amp;#10;line-height:200%;font-size:10.5000pt;mso-font-kerning:1.0000pt;&quot;&gt;接下来，是灯笼制作和送灯笼环节，社工把制作灯笼的材料发到家长和小朋友手中，社工们边示范边向孩子们详细讲解了灯笼制作的步骤。在社工们的指导下，家长和孩子们一起积极动起手来，在制作的过程中，他们相互帮助、相互学习。整个场面热闹、温馨、其乐融融，家长和孩子们收获了快乐，同时也增进了亲子感情。在欢乐的灯笼制作完成后，社工组织青少年给社区的高龄老人、困境家庭儿童送去灯笼和元宵节祝福，老人们都很开心。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-bidi-font-family:\'Times New Roman\';&amp;#10;line-height:200%;font-size:10.5000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;通过此次活动，不仅激发了青少年儿童对中华传统节日的兴趣，还锻炼了他们的动手能力、思维能力，也增强了亲子感情，将传统节日与手工制作相结合，让小朋友们在制作兔子灯的同时，近距离感受到了中华传统文化的魅力。小小的兔子灯传递的不仅仅是节日的祝福，更多的是社区青少年对传统文化和敬老、尊老精神的一种弘扬和传承。也寓意着红红火火的生活，让社区洋溢着浓浓的&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;中国年味&quot;，大大提升了居民的获得感和幸福感！&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-bidi-font-family:\'Times New Roman\';&amp;#10;line-height:200%;font-size:10.5000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-bidi-font-family:\'Times New Roman\';&amp;#10;line-height:200%;font-size:10.5000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-bidi-font-family:\'Times New Roman\';&amp;#10;line-height:200%;font-size:10.5000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675844871', '1675844871', '');
INSERT INTO `ey_article_content` VALUES ('62', '67', '春节过后，我们迎来了第一个重要节日&quot;元宵节&quot;。为弘扬中国传统文化，丰富老年人的精神文化生活，增強老人们的幸福感，碧波社区党委、老年人协会于2023年  2月3日，在碧波社区党群活动中心举办了&quot;汤圆暖人心，欢乐闹元宵&quot;活动。\r\n   活动在30位老人高唱《没有共产党就没有新中国》歌声中拉开了帷幕。紧接着好戏连台。大家在廖燕贞老师的指导下，亲手做五彩汤圆。品汤圆。意喻团团圆圆，平平安安。同时喜猜灯谜、击鼓传花玩游戏、表演小节目等，气氛喜庆祥和轻松，欢声笑语不断。\r\n     兔年伊始，万象更新，三年战疫取得阶段性胜利，相信随着生活逐渐步入正轨，我们的明天会越来越好。\r\n  祝大家元宵佳节幸福安康！元宵节快乐！', '', '1675844872', '1675844872', '');
INSERT INTO `ey_article_content` VALUES ('63', '68', '&lt;p&gt; &lt;span &gt;    &lt;/span&gt;&lt;span &gt;春节，是中华民族的传统节日，也是&lt;/span&gt;&lt;span &gt;万&lt;/span&gt;&lt;span &gt;家团圆的日子&lt;/span&gt;&lt;span &gt;。为进一步营造社区居民家庭和睦，营造社区&lt;/span&gt;&lt;span &gt;团结友爱、和谐亲密的&lt;/span&gt;&lt;span &gt;家文化氛围，提升社区&lt;/span&gt;&lt;span &gt;居民的获得感和&lt;/span&gt;&lt;span &gt;幸福感。&lt;/span&gt;&lt;span &gt;在禾花社区党委的领导下，党群服务中心、新时代文明实践站&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;围绕团圆的幸福瞬间开展&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;幸福禾花，乐享团圆&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;--&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;禾花社区最美全家福线上投票活动&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;span &gt;让&lt;/span&gt;&lt;span &gt;社区&lt;/span&gt;&lt;span &gt;家庭成员&lt;/span&gt;&lt;span &gt;亲密&lt;/span&gt;&lt;span &gt;互动，感受浓浓的亲情&lt;/span&gt;&lt;span &gt;团圆&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;记录家人团聚的美好场景。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;    &lt;font face=&quot;宋体&quot;&gt;据悉，活动以展示全家福&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;团圆为切入点，深入挖掘每个家庭的幸福时刻，记录美好瞬间。本次活动共有&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;30&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;个家庭参与，经过朋友圈转发获得&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;3819&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;的访问量、累计投票&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;1341&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;票。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Arial&quot;&gt;张张&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;全家福&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Arial&quot;&gt;，人人笑开颜，如果幸福有形状，那一定是&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;团圆&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Arial&quot;&gt;的模样&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:\'Times New Roman\';font-size:12.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;    &lt;font face=&quot;宋体&quot;&gt;生活需要仪式感，一张喜气洋洋的团圆全家福，既能记录了美好团圆时光，又能增添满满的年味和仪式感。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675845325', '1675845325', '');
INSERT INTO `ey_article_content` VALUES ('64', '69', '&lt;p class=&quot;p&quot; align=&quot;center&quot; &gt;&lt;span &gt;&lt;o:p&gt;          &lt;/o:p&gt;&lt;/span&gt;&lt;span &gt;为了喜迎兔年的来临，营造喜庆祥和的节日气氛，&lt;/span&gt;&lt;span &gt;近日&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;，在高峰社区党委，居委会支持下，赤岭头社区组织开展了&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;&quot;情暖新春，送福万家&quot;关爱活动。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;　&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;活动现场，书法老师们挥毫泼墨，大显身手，写出一幅幅笔精墨妙的书法作品&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;&quot;春联&quot;，力求把最好的字送给社区居民。居民们纷纷围在自己心仪的&quot;书法家&quot;那里排队等候，互相讨论着各幅春联的蕴意，领取春联的同时，也领略到了书法的魅力&lt;/font&gt;&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;下午，社区的社工们和志愿者带着写好的福字和春联以及慰问物资，走访入户慰问辖区&lt;/span&gt;&lt;span &gt;空巢、&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;高龄老人、残疾人、独居长者，倾听他们的心声，帮助解决他们的问题。马婆婆儿子说：&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;&quot;感谢社区送来关爱，这春联贴上去，过年气氛就有了。&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt;此次&lt;/span&gt;&lt;span &gt;活动以写春联、送&lt;/span&gt;&lt;span &gt;温暖&lt;/span&gt;&lt;span &gt;的形式，共书写&lt;/span&gt;&lt;span &gt;150&lt;/span&gt;&lt;span &gt;副春联送给了辖区居民，&lt;/span&gt;&lt;span &gt;不仅为&lt;/span&gt;&lt;span &gt;广大&lt;/span&gt;&lt;span &gt;社区居民&lt;/span&gt;&lt;span &gt;送上新年的美好祝福，&lt;/span&gt;&lt;span &gt;也&lt;/span&gt;&lt;span &gt;进一步发挥了党建引领作用，&lt;/span&gt;&lt;span &gt;将传统年味和新春祝福送到社区居民身边，增强社区居民情感联结。&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;p&quot; &gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;', '', '1675845355', '1675845355', '');
INSERT INTO `ey_article_content` VALUES ('65', '70', '&lt;p&gt; &lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;为进一步增强居民对社区的幸福感、归属感，聆听居民心声与需求，在高峰社区党委的指导下，&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;2023年1月13号下午，赤岭头社区开展了&quot;和谐共融·情暖社区&quot;活动，邀请了长者、青少年、妇女、志愿者、党员代表共计20余人参加，&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;大家欢聚一堂，共迎新春&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; &gt;&lt;span &gt;首先&lt;/span&gt;&lt;span &gt;，&lt;/span&gt;&lt;span &gt;由社工简单介绍了本次活动的主题，&lt;/span&gt;&lt;span &gt;接下来，&lt;/span&gt;&lt;span yes\';font-family:仿宋;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;仿宋&quot;&gt;社工主任提前给大家贺新年，并以&lt;/font&gt;&lt;font face=&quot;仿宋&quot;&gt;PPT形式介绍了&lt;/font&gt;&lt;/span&gt;&lt;span &gt;社区一年来的重点工作及取得的成绩，代表社区衷心感谢大家对社区各项工作的大力支持。&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; &gt;&lt;span &gt;活动现场，&lt;/span&gt;&lt;span &gt;大家敞开心扉、畅所欲言，就&lt;/span&gt;&lt;span &gt;社区在&lt;/span&gt;&lt;span &gt;2022年&lt;/span&gt;&lt;span &gt;取得的成就以及存在的缺点和不足进行了交流和讨论，&lt;/span&gt;&lt;span &gt;现场气氛温馨而热烈&lt;/span&gt;&lt;span &gt;。同时，居民们还对&lt;/span&gt;&lt;span &gt;中心&lt;/span&gt;&lt;span &gt;日常服务工作提出了许多好的点子和建设性意见&lt;/span&gt;&lt;span &gt;。最后，社工还设置了游戏互动环节，&lt;/span&gt;&lt;span &gt;亲近的话语，暖心的问候，引得满堂笑声，也拉近了彼此间&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;的感情。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:仿宋;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot; &gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;通过此次新春茶话会的开展，不仅有效的融洽了邻里关系，营造了欢乐的节日气氛，更能集思广益，增强了社区的凝聚力、向心力，激发了共同建设和谐社区的热情，为社区&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;2023&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;年&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;服务&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;仿宋&quot;&gt;开展打下了良好的群众基础。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:仿宋;font-size:14.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675845356', '1675845356', '');
INSERT INTO `ey_article_content` VALUES ('66', '71', '&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;span &gt;&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;span &gt; &lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;strong&gt;&lt;span &gt;华富街道新田社区&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p &gt;&lt;strong&gt;&lt;span &gt;2022年度志愿者工作总结大会&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;span &gt;      华富街道新田社区元月13日简讯。新田社区党委在今天下午召开2022年度志愿者总结工作表彰大会。新田社区注册志愿者230多人，其中老年朋友志愿者就120多人。&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;span &gt;       在总结表彰大会上，新田社区党委书记刘忠奎作了指示，特别对新田老年协会的工作。老年朋友志愿者的贡献给予高度的评价和肯定。并为40名优秀获奖志愿者发了荣誉证书。&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;span &gt;       这40名优秀志愿者是在230名志愿者中按照执岗场时多少为序选择出来的，这40名优秀志愿全是老年朋友们，他们的多数是中国共产党的党员、退役军人红心志愿者，还有的是党支部书记、支部委员、老年朋友中的骨干们。为新田社区做出了特殊贡献的人。&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;span &gt;       会上，看了过去志愿者活动的照片录像，获奖优秀志愿者陈宝，李铁岩、陈凤福结合自己做志愿者的体会发了言。会长昝仕清对老年朋友中的志愿者们的贡献作了小结发言，并号召全体志愿者朋友们继续努力，让新田老年朋友共产党党员党旗更鲜艳。&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt;&lt;span &gt;        志愿者红马甲更红，穿上防护最光荣，所有的工作成绩，胜利属于我们的新田人，志愿者红马甲永远红片新田社区。活动在谢谢你的手语歌声中结束，活动很成功。&lt;/span&gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p &gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;', '', '1675845361', '1675845361', '');
INSERT INTO `ey_article_content` VALUES ('67', '72', '&lt;p&gt;         &lt;font face=&quot;宋体&quot; &gt;新年伊始新洲社区党群服务中心党委、彩虹社工、南粤家政于&lt;/font&gt;&lt;font face=&quot;宋体&quot; &gt;1月11日-1月19日期间在社区内联合组织开展&quot;新春送暖&quot;入户探访新春系列活动，组织社区义工入户探访社区高龄老人、独居长者、特殊人群话家常、贴春联、送祝福、做卫生等，了解其生活近况与服务需求，进一步增进特殊居民与社区之间的互动联系。&lt;/font&gt;&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;通过探访活动进一步拉近了社工、义工与被探访者的距离，被探访者在收到春联时，脸上洋溢着灿烂笑容，被探访者分享道：&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;感谢大家的探望，感谢党和国家、社区的关怀，家里贴春联贴了几十年了，已经习惯了家里有春联。虽然独居，但是每年也会贴春联，贴了春联，就有年味，家的味道也更浓厚！&quot;，与此同时，南粤家政的工作人员为老人们家里做深度卫生清洁，从厨房、洗手间到卧室每个角落都打扫的干干净净，老人露出满意的笑容&quot;谢谢你们来探望我，帮我做卫生，年纪大了做不来了，还好有你们帮忙我这些，这样我就可以安心过年啦！&quot;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt; &lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;本次新春系列活动将探访了&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;10余户社区高龄老人、独居老人以及特殊人群，为社区特殊居民送上新春祝福之外，社工在了解到被探访者提出的服务需求时也及时给予回应、协助其解决。此次探访活动进一步加强了社区工作人员与特殊居民的互动联系，被探访者纷纷表示：&quot;你们真真切实地服务到家！&quot;&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:12.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675846309', '1675846309', '');
INSERT INTO `ey_article_content` VALUES ('68', '73', '&lt;p&gt;   &lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;为进一步弘扬&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;奉献、友爱、互助、进步&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&quot;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;志愿精神&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;、&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;激发志愿者热情、提高志愿者归属感、荣誉感，新谊社区党委、新谊社区新时代文明实践站联合正阳社会工作服务中心于&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;1月1&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;1&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;日&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;举办&lt;/font&gt;&quot;爱在新谊，‘义’起前行&quot;&lt;font face=&quot;宋体&quot;&gt;志愿者服务总结暨积分兑换活动&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;，以表彰的方式为先进加冕、向榜样致敬。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;活动分为回顾总结、分享、表彰和积分兑换四个环节，首先社工通过&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;PPT对2022年的服务进行总结，对志愿者们的付出予以肯定，感谢他们的默默贡献，同时希望有更多爱心人士参与到志愿活动中来。接着邀请志愿者分享感受和收获，志愿者王先生说：&quot;感谢新谊社区搭建了志愿者平台，在这里我认识了很多志同道合的志愿者朋友，参加志愿服务既充实了自己，又帮助了别人，奉献爱心，做好事，为美好社区添砖加瓦。&quot;接着对社区的50名优秀志愿者进行表彰，最后进行积分兑换。&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;此次活动，激励了社区志愿者的参与热情，增强了志愿者队伍的凝聚力，同时鼓励更多的居民参与到志愿服务中来，让志愿精神闪耀在社区每个角落，努力营造&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;爱在新谊，人人参与志愿服务&quot;的浓厚氛围。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675846349', '1675846349', '');
INSERT INTO `ey_article_content` VALUES ('69', '74', '&lt;p&gt; &lt;span &gt;为了营造红火喜庆的节日氛围&lt;/span&gt;&lt;span &gt;和友爱互助&lt;/span&gt;&lt;span &gt;和谐氛围，&lt;/span&gt;&lt;span &gt;促进&lt;/span&gt;&lt;span &gt;居民对社区的认同感与归属感，&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;国展社区于&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;1&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;月&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;11&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;日开展了&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&quot;&lt;/span&gt;&lt;span &gt;巧手剪窗花，寻味中国年&lt;/span&gt;&lt;span &gt;&quot;国展社区&lt;/span&gt;&lt;span &gt;迎新春&lt;/span&gt;&lt;span &gt;活动&lt;/span&gt;&lt;span &gt;。&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;此活动不仅吸引了&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;20&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;名中老年朋友参加，也吸引&lt;/font&gt;&lt;font face=&quot;Times New Roman&quot;&gt;16&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;名小朋友的加入。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;在国展社区几位剪纸骨干带领下，大人们剪兔年福字窗花，交流各地方不同的过年风俗；小孩们用红纸折兔子，自由创作剪团花，欢声笑语一片。一张红纸经过一双巧手的抚摸和剪刀的交叠，不仅成为一副美丽的图画，也让它具有温度，赋予创作者对新年祝福与愿望。&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;国展社区在党委的领导下，携手社区力量多方联动，窗花送给社区空巢老人和独居老人，向他们传递了新春的慰问和祝福，让这些老龄人感到来自社区的关怀。&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; &gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;通过此次活动，让居民不仅体验到了剪纸文化的魅力，还营造年味儿，传递年味儿，正是人们乐在其中的生活体验。&lt;/span&gt;&lt;span yes\';font-family:宋体;mso-ascii-font-family:\'Times New Roman\';&amp;#10;mso-hansi-font-family:\'Times New Roman\';mso-bidi-font-family:Calibri;line-height:150%;&amp;#10;font-size:14.0000pt;mso-font-kerning:0.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675846352', '1675846352', '');
INSERT INTO `ey_article_content` VALUES ('70', '75', '&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p &gt;&lt;span &gt; &lt;/span&gt;&lt;strong&gt;&lt;span &gt;&lt;span &gt;新田社区老协简讯&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       今天上午，新田社区党群服务中心与新田老协组织开展了莲花山游园活动。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       这次活动参加的人员有40余人，其中有老年协会的朋友、有住地居民、有退役军人红心志愿者的代表等。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span &gt;       社区还安排了专车接送往返莲花山，活动中，大家自由轻松，欢歌笑语，有各类游戏，还为大家分别拍照，集体合影等，大家玩得不亦乐乎！活动取得圆满成功！&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;\n&lt;p &gt;&lt;/p&gt;\n&lt;p&gt;  &lt;/p&gt;\n&lt;p&gt;&lt;/p&gt;\n&lt;p&gt; &lt;/p&gt;', '', '1675846372', '1675846372', '');
INSERT INTO `ey_article_content` VALUES ('71', '76', '&lt;p&gt;        &lt;span &gt;&quot;迎新春春光明媚，辞旧岁岁岁有余。这词太好了！&quot;社区的王伯伯开心的说道！为了迎接新春佳节，丰富村民精神文化生活，1月10日金湖社区举办了&quot;&lt;/span&gt;&lt;span &gt;笔墨迎新送春联，福到金湖千万家&lt;/span&gt;&lt;span &gt;&quot;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;Helvetica Neue&quot;&gt;——金湖社区&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;2023&lt;/font&gt;&lt;font face=&quot;Helvetica Neue&quot;&gt;年送春联活动，&lt;/font&gt;&lt;/span&gt;&lt;span &gt;&lt;font face=&quot;宋体&quot;&gt;居民在寒冷的冬天纷纷从社区领到了一对对热腾腾的春联及福字，活动共吸引了近&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;100名社区居民参与。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;justify&quot; &gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;据悉，此次义写春联是金湖社区联合淘金山小学老师以及其他社区社会组织为社区居民送去冬日里的温暖。在发放春联之前，社区义工老师们挥墨展艺，一笔一划笔力雄健，&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;&quot;真、草、隶、行&quot;各种书体兼具，一幅幅书法作品跃然纸上，或端庄秀丽、或大气磅礴，彰显了高超的艺术水平，最后&quot;新鲜出炉&quot;的春联开始发放了，一副副平安和谐、吉祥如意的春联，带着辞旧迎新的美好祝愿，为即将来临的春节增添了浓浓的喜庆氛围，居民们纷纷前来领取，这一张张红纸上传递出浓浓的节日气氛，受到社区居民的热烈欢迎和一致好评。&lt;/font&gt;&lt;/span&gt;&lt;span yes\';font-family:宋体;line-height:150%;&amp;#10;font-size:11.0000pt;mso-font-kerning:1.0000pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;春联凝聚社区爱心，传递出社区之间的和谐共融。活动最后共送出了&lt;/font&gt;&lt;font face=&quot;宋体&quot;&gt;120副新春对联，&quot;虽然我们累一点，但是能为社区居民写春联，看到居民们开心，我们的心里也很开心，能够发挥我自己的价值。&quot;我们义工老师徐老师这样告诉大家；富有文化特色的春联，营造了吉祥温暖的春节氛围，让社区居民切实感受到中华民族传统优秀文化的魅力和博大精深，延续了历史文脉，传播了中国文化。&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span yes\';font-family:宋体;font-size:11.0000pt;&amp;#10;mso-font-kerning:1.0000pt;&quot;&gt;&lt;font face=&quot;宋体&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;', '', '1675846406', '1675846406', '');
