INSERT INTO `ey_joinus_content` VALUES ('2', '182', '1711005642', '1711005642', '&lt;h1 style=&quot;outline: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: &amp;quot;microsoft yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Verdana,arial&amp;quot;, &amp;quot;sans-serif&amp;quot;; color: rgb(96, 98, 102); text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 20px;&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/h1&gt;&lt;h3 style=&quot;padding: 0px; margin: 0px; -webkit-tap-highlight-color: transparent; text-size-adjust: none; font-size: 18px; color: rgb(34, 34, 34); line-height: 25px; font-family: arial, verdana, helvetica, &amp;quot;PingFang SC&amp;quot;, &amp;quot;HanHei SC&amp;quot;, STHeitiSC-Light, &amp;quot;Microsoft Yahei&amp;quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;职位描述&lt;/h3&gt;&lt;h1 style=&quot;outline: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: &amp;quot;microsoft yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Verdana,arial&amp;quot;, &amp;quot;sans-serif&amp;quot;; color: rgb(96, 98, 102); text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;color: rgb(255, 255, 255); font-family: &amp;quot;microsoft yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Verdana,arial&amp;quot;, &amp;quot;sans-serif&amp;quot;; font-size: 14px; text-wrap: wrap; background-color: rgb(64, 158, 255);&quot;&gt;&lt;span style=&quot;color: rgb(96, 98, 102); font-family: &amp;quot;microsoft yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Verdana,arial&amp;quot;, &amp;quot;sans-serif&amp;quot;; font-size: 14px; text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;br/&gt;&lt;/h1&gt;&lt;pre id=&quot;examineSensitiveWordsContent&quot; style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); margin-top: 0px; margin-bottom: 0px; padding: 0px; text-wrap: wrap; overflow-wrap: break-word; background-color: rgb(255, 255, 255);&quot;&gt;岗位职责：\r\n1、负责监督并指导公司项目的全过程风险管理工作；\r\n2、负责组织公司经营事项的风险评估、协调相关职能部门针对具体事项制定重大风险应对方案，并监督风险应对方案的实施\r\n3、建立与完善风险评估模型与分析工具，提高风险管理水平；\r\n\r\n岗位要求：\r\n1、本科以上学历，内控/内审/销售类风险管理相关工作经验，有互联网背景优先考虑；\r\n2、掌握风险识别、分析、评估等内控方法论及操作技能，能够独立领导团队的风险管理工作，并有良好的业务感知和理解能力；\r\n3、了解投资、财务、金融、企业管理相关法律法规政策；\r\n4、具备良好的职业操守，较强的业务分析能力和沟通协调能力，工作严谨，作风细致，逻辑思维清晰，善于跨部门沟通，团队合作和抗压能力强。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; color: rgb(0, 0, 0);&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;员工旅游 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;员工培训&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '平台支撑部', '¥ 8-15K', '南宁', '广西壮族自治区/南宁市/青秀区 | 学历本科 | 经验不限 | 招聘1人');
INSERT INTO `ey_joinus_content` VALUES ('3', '216', '1711008528', '1711008528', '&lt;h3 style=&quot;padding: 0px; margin: 0px; -webkit-tap-highlight-color: transparent; text-size-adjust: none; font-size: 18px; color: rgb(34, 34, 34); line-height: 25px; font-family: arial, verdana, helvetica, &amp;quot;PingFang SC&amp;quot;, &amp;quot;HanHei SC&amp;quot;, STHeitiSC-Light, &amp;quot;Microsoft Yahei&amp;quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;职位描述&lt;/h3&gt;&lt;h1 style=&quot;outline: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: &amp;quot;microsoft yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Verdana,arial&amp;quot;, &amp;quot;sans-serif&amp;quot;; color: rgb(96, 98, 102); text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(64, 158, 255);&quot;&gt;&lt;span style=&quot;color: rgb(96, 98, 102); background-color: rgb(255, 255, 255);&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;br/&gt;&lt;/h1&gt;&lt;pre id=&quot;examineSensitiveWordsContent&quot; style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; background-color: rgb(255, 255, 255); font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); text-wrap: wrap; overflow-wrap: break-word;&quot;&gt;岗位职责：\r\n1、根据公司经营计划，完成下达的各项业务拓展指标\r\n2、负责客户关系的建立、管理、维护；基于对公司平台、业务的理解，进行市场研究分析，深度挖掘客户需求\r\n3、完成商务合作的沟通、谈判，制定合作方案，跟进整个合作过程，对结果负责；\r\n4、及时了解市场走势及竞争对手最新动态，对市场行为进行综合分析，为市场策略调整提供决策依据\r\n5、建立与行业内合作伙伴的广泛联系，形成长期、互信的良好合作关系；\r\n\r\n岗位要求：\r\n1、全日制本科及以上学历；&amp;nbsp;\r\n2、有从事农业、原材料大宗商品贸易的工作经验优先；\r\n3、有较强的责任心和敬业精神，勤奋好学，创新灵活，团队合作能力强；\r\n4、具备良好的销售意识及客户服务意识；\r\n5、学习能力强，适应能力强，能在一定压力下工作，积极主动，善于沟通。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;员工旅游 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;员工培训&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;text-wrap: wrap;&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '业务部', '¥ 6-12K', '南宁', '广西壮族自治区 | 南宁市 | 青秀区 | 学历大专 | 经验不限 | 招聘3人');
INSERT INTO `ey_joinus_content` VALUES ('4', '217', '1711008194', '1711008194', '&lt;pre id=&quot;examineSensitiveWordsContent&quot; style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); margin-top: 0px; margin-bottom: 0px; padding: 0px; text-wrap: wrap; overflow-wrap: break-word; background-color: rgb(255, 255, 255);&quot;&gt;岗位职责：\r\n1、负责平台金融业务的拓展、风险控制；\r\n2、负责与各金融机构进行业务洽谈，引入有竞争力的金融产品；\r\n3、负责创新供应链金融解决方案及支付方案，负责与平台客户接洽，开展金融业务合作；\r\n4、负责与监管、金融机构、第三方支付等建立和维持良好合作关系；\r\n5、定期提交产品经营分析报告、统计报表。\r\n\r\n任职要求：\r\n1、全日制本科及以上学历；有金融机构、三方支付、供应链金融等相关工作经历优先；\r\n2、熟悉金融监管政策、金融行业发展趋势，熟悉金融产品和供应链金融解决方案设计；\r\n3、有较强的商务拓展能力，能够与金融机构、产业客户建立良好的合作关系。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;员工旅游 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;员工培训&lt;/span&gt;&lt;/p&gt;', '平台支撑部', '¥ 8-10K', '南宁', '广西壮族自治区 | 南宁市 | 青秀区 | 学历本科 | 经验不限 | 招聘1人');
INSERT INTO `ey_joinus_content` VALUES ('5', '218', '1711008483', '1711008483', '&lt;pre id=&quot;examineSensitiveWordsContent&quot; style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); margin-top: 0px; margin-bottom: 0px; padding: 0px; text-wrap: wrap; overflow-wrap: break-word; background-color: rgb(255, 255, 255);&quot;&gt;岗位职责：\r\n1、深入客户一线，了解并挖掘大宗贸易行业对数字化产品的需求和痛点，并提出解决方案。全面参与数字化产品需求分析，规划，方案设计；\r\n2、负责跟踪、收集、挖掘上线产品的市场效果、用户反馈数据；\r\n3、负责客户行为分析和数据分析，为平台功能优化提供依据；\r\n4、关注行业动态，从行业生态角度出发，构建符合市场规律的产品生态；&amp;nbsp;&amp;nbsp;\r\n6、负责与行业内外合作伙伴建立良好合作关系。\r\n任职要求：\r\n1、有系统、软件、数字化产品等产品工作经验者优先；\r\n2、熟练掌握业务和产品需求分析、业务逻辑；\r\n3、具有较强团队沟通协调能力；\r\n4、自我驱动力强、沟通能力好，自控力强，办事效率高。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;员工旅游 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;员工培训&lt;/span&gt;&lt;/p&gt;', '技术研发部', '¥ 6-12K', '南宁', '广西壮族自治区 | 南宁市 | 青秀区 | 学历本科 | 经验不限 | 招聘3人');
INSERT INTO `ey_joinus_content` VALUES ('6', '219', '1711008458', '1711008458', '&lt;pre id=&quot;examineSensitiveWordsContent&quot; style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); margin-top: 0px; margin-bottom: 0px; padding: 0px; text-wrap: wrap; overflow-wrap: break-word; background-color: rgb(255, 255, 255);&quot;&gt;岗位职责：\r\n1、日常业务衔接：负责公司平台运营报价工作及线上凑合成交，及记录客户需求，协调解决问题；\r\n2、客户管理：将现有线下客户群体引流到公司平台，及开发新客户，服务客户；\r\n3、合同管理：根据线上合同成交数据，负责合同执行管理，合同结束前的全流程跟踪；\r\n5、数据与货款：管理平台数据，赊销客户的货款回笼跟踪；\r\n6、协助合同执行中的商务异议处理。\r\n任职要求：\r\n\r\n1、应具备的知识：计算机基础知识；办公设备常规使用；人际沟通基本知识。\r\n2、工作经验：有从事过大宗贸易、农牧行业者优先。\r\n3、个人素质：踏实、细心、责任心强，善于沟通，热情大方、创新能力。&lt;/pre&gt;&lt;p&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;员工旅游 |&amp;nbsp;&lt;/