INSERT INTO `ey_joinus_content` VALUES ('8', '327', '1711008194', '1711008194', '&lt;pre id=&quot;examineSensitiveWordsContent&quot; style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); margin-top: 0px; margin-bottom: 0px; padding: 0px; text-wrap: wrap; overflow-wrap: break-word; background-color: rgb(255, 255, 255);&quot;&gt;岗位职责：\r\n1、负责平台金融业务的拓展、风险控制；\r\n2、负责与各金融机构进行业务洽谈，引入有竞争力的金融产品；\r\n3、负责创新供应链金融解决方案及支付方案，负责与平台客户接洽，开展金融业务合作；\r\n4、负责与监管、金融机构、第三方支付等建立和维持良好合作关系；\r\n5、定期提交产品经营分析报告、统计报表。\r\n\r\n任职要求：\r\n1、全日制本科及以上学历；有金融机构、三方支付、供应链金融等相关工作经历优先；\r\n2、熟悉金融监管政策、金融行业发展趋势，熟悉金融产品和供应链金融解决方案设计；\r\n3、有较强的商务拓展能力，能够与金融机构、产业客户建立良好的合作关系。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;员工旅游 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;员工培训&lt;/span&gt;&lt;/p&gt;', '平台支撑部', '¥ 8-10K', '南宁', '广西壮族自治区 | 南宁市 | 青秀区 | 学历本科 | 经验不限 | 招聘1人');
INSERT INTO `ey_joinus_content` VALUES ('9', '328', '1711008483', '1711008483', '&lt;pre id=&quot;examineSensitiveWordsContent&quot; style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); margin-top: 0px; margin-bottom: 0px; padding: 0px; text-wrap: wrap; overflow-wrap: break-word; background-color: rgb(255, 255, 255);&quot;&gt;岗位职责：\r\n1、深入客户一线，了解并挖掘大宗贸易行业对数字化产品的需求和痛点，并提出解决方案。全面参与数字化产品需求分析，规划，方案设计；\r\n2、负责跟踪、收集、挖掘上线产品的市场效果、用户反馈数据；\r\n3、负责客户行为分析和数据分析，为平台功能优化提供依据；\r\n4、关注行业动态，从行业生态角度出发，构建符合市场规律的产品生态；&amp;nbsp;&amp;nbsp;\r\n6、负责与行业内外合作伙伴建立良好合作关系。\r\n任职要求：\r\n1、有系统、软件、数字化产品等产品工作经验者优先；\r\n2、熟练掌握业务和产品需求分析、业务逻辑；\r\n3、具有较强团队沟通协调能力；\r\n4、自我驱动力强、沟通能力好，自控力强，办事效率高。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wrap: wrap; font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-wr