INSERT INTO `ey_joinus_content` VALUES ('10', '329', '1711008528', '1711008528', '&lt;h3 style=&quot;padding: 0px; margin: 0px; -webkit-tap-highlight-color: transparent; text-size-adjust: none; font-size: 18px; color: rgb(34, 34, 34); line-height: 25px; font-family: arial, verdana, helvetica, &amp;quot;PingFang SC&amp;quot;, &amp;quot;HanHei SC&amp;quot;, STHeitiSC-Light, &amp;quot;Microsoft Yahei&amp;quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;职位描述&lt;/h3&gt;&lt;h1 style=&quot;outline: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: &amp;quot;microsoft yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Verdana,arial&amp;quot;, &amp;quot;sans-serif&amp;quot;; color: rgb(96, 98, 102); text-wrap: wrap; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(64, 158, 255);&quot;&gt;&lt;span style=&quot;color: rgb(96, 98, 102); background-color: rgb(255, 255, 255);&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;br/&gt;&lt;/h1&gt;&lt;pre id=&quot;examineSensitiveWordsContent&quot; style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; background-color: rgb(255, 255, 255); font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); text-wrap: wrap; overflow-wrap: break-word;&quot;&gt;岗位职责：\r\n1、根据公司经营计划，完成下达的各项业务拓展指标\r\n2、负责客户关系的建立、管理、维护；基于对公司平台、业务的理解，进行市场研究分析，深度挖掘客户需求\r\n3、完成商务合作的沟通、谈判，制定合作方案，跟进整个合作过程，对结果负责；\r\n4、及时了解市场走势及竞争对手最新动态，对市场行为进行综合分析，为市场策略调整提供决策依据\r\n5、建立与行业内合作伙伴的广泛联系，形成长期、互信的良好合作关系；\r\n\r\n岗位要求：\r\n1、全日制本科及以上学历；&amp;nbsp;\r\n2、有从事农业、原材料大宗商品贸易的工作经验优先；\r\n3、有较强的责任心和敬业精神，勤奋好学，创新灵活，团队合作能力强；\r\n4、具备良好的销售意识及客户服务意识；\r\n5、学习能力强，适应能力强，能在一定压力下工作，积极主动，善于沟通。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;员工旅游 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;员工培训&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;text-wrap: wrap;&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '业务部', '¥ 6-12K', '南宁', '广西壮族自治区 | 南宁市 | 青秀区 | 学历大专 | 经验不限 | 招聘3人');
