; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 14px; line-height: 30px; font-family: &amp;quot;Microsoft YaHei&amp;quot;, tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;\\\\5b8b体&amp;quot;, sans-serif; color: rgb(76, 76, 76); margin-top: 0px; margin-bottom: 0px; padding: 0px; text-wrap: wrap; overflow-wrap: break-word; background-color: rgb(255, 255, 255);&quot;&gt;岗位职责：\r\n1、负责监督并指导公司项目的全过程风险管理工作；\r\n2、负责组织公司经营事项的风险评估、协调相关职能部门针对具体事项制定重大风险应对方案，并监督风险应对方案的实施\r\n3、建立与完善风险评估模型与分析工具，提高风险管理水平；\r\n\r\n岗位要求：\r\n1、本科以上学历，内控/内审/销售类风险管理相关工作经验，有互联网背景优先考虑；\r\n2、掌握风险识别、分析、评估等内控方法论及操作技能，能够独立领导团队的风险管理工作，并有良好的业务感知和理解能力；\r\n3、了解投资、财务、金融、企业管理相关法律法规政策；\r\n4、具备良好的职业操守，较强的业务分析能力和沟通协调能力，工作严谨，作风细致，逻辑思维清晰，善于跨部门沟通，团队合作和抗压能力强。&lt;/pre&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; color: rgb(0, 0, 0);&quot;&gt;周末双休 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;五险 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;带薪年假 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;年终奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;绩效奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;季度奖金 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;节日福利 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;交通补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;差旅费补贴 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;员工旅游 |&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;员工培训&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '平台支撑部', '¥ 8-15K', '南宁', '广西壮族自治区/南宁市/青秀区 | 学历本科 | 经验不限 | 招聘1人');
