INSERT INTO `ey_single_content` VALUES ('1', '1', '1', '&lt;p&gt;某某市老年人体育协会是根据国务院国办发[1983]47号（国务院办公厅转发国家体育运动委员会关于成立中国老年人体育协会的报告的通知）文件的要求，成立于2003年5月。本会是某某市老年体育活动的群众性社会团体，由某某市各涉老单位发起、组成，是代表某某市参加全省全国老年人体育协会及其相关活动的合法组织。&lt;br style=&quot;box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: 微软雅黑, Helvetica, Arial, Tahoma, SimSun, sans-serif; font-size: 14px;&quot;/&gt;&lt;br style=&quot;box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: 微软雅黑, Helvetica, Arial, Tahoma, SimSun, sans-serif; font-size: 14px;&quot;/&gt;本会宗旨是在国家体育方针、政策指导下，推动某某市老年人积极开展体育活动，积极参加各种交流、展示、比赛，从而让更多的老年人参加到体育活动中来，更好地促进老年人的身心健康，促进社会和谐发展。&lt;br style=&quot;box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: 微软雅黑, Helvetica, Arial, Tahoma, SimSun, sans-serif; font-size: 14px;&quot;/&gt;&lt;br style=&quot;box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: 微软雅黑, Helvetica, Arial, Tahoma, SimSun, sans-serif; font-size: 14px;&quot;/&gt;本会开展的老年人体育项目主要有：柔力球、老年排球、门球、小场地门球、健身球操、健身秧歌、太极拳（剑）、可乐球、健身舞、钓鱼、乒乓球、羽毛球、老年网球等。&lt;br style=&quot;box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: 微软雅黑, Helvetica, Arial, Tahoma, SimSun, sans-serif; font-size: 14px;&quot;/&gt;&lt;br style=&quot;box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: 微软雅黑, Helvetica, Arial, Tahoma, SimSun, sans-serif; font-size: 14px;&quot;/&gt;本会会员为团体会员、各区老年人体育协会、市属单位、驻深单位老年体育组织、老年团体、均可申请加入本会为团体会员。&lt;br style=&quot;box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: 微软雅黑, Helvetica, Arial, Tahoma, SimSun, sans-serif; font-size: 14px;&quot;/&gt;&lt;br style=&quot;box-sizing: border-box; white-space: normal; color: rgb(51, 51, 51); font-family: 微软雅黑, Helvetica, Arial, Tahoma, SimSun, sans-serif; font-size: 14px;&quot;/&gt;本会成立以来，在某某市委、市政府的大力支持下，每年进行老年体育项目的推广与培训工作，开展各种老年项目的展示与交流活动，组队参加省和国内各种老年比赛交流活动，取得了显著成绩，为老年人健康幸福、社会和谐做出了贡献。&lt;/p&gt;', '', '1675846987', '1675846987');
INSERT INTO `ey_single_content` VALUES ('2', '2', '8', '&lt;p&gt;常务副会长：刘先生&amp;nbsp;&lt;/p&gt;&lt;p&gt;驻会副会长、法人：陈先生&lt;/p&gt;&lt;p&gt;副会长：刘先生&lt;/p&gt;&lt;p&gt;秘书长：周先生&lt;/p&gt;&lt;p&gt;办公室主任：林先生（兼出纳）&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '1675847085', '1675847085');
