INSERT INTO `ey_weapp_ask` VALUES ('12', '2', '1', '轻质隔墙板技术指标和安装流程规范来自来师傅的回答', '0', '1', '262', '1', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;技术指标和安装流程规范&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&amp;nbsp;工程设计单位或建筑承包商应提前向隔墙条板安装企业提供施工图中的墙体平面布置图和隔墙相关技术指标，必须包括以下内容：&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 一. 采购方便,省心,省力,省时。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 二.无需批荡抹灰,节省大量施工时间及施工成本。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 三.材料损耗率极低,可拆卸两次以上使用,不产生建筑垃圾。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 四.轻质隔墙板可任意切割,调整规格。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 五.节省运输费,同样面积的轻质隔墙板运输重量仅是其它材料的1/6-1/2。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 六.施工场地整洁,施工状况基本干工作,装备式,文明,快捷,简便。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 七、说明选用隔墙条板的种类和轴线分布，墙体的厚度要求、门窗分布位置和洞口尺寸，管线分布位置和开槽尺寸；&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 八、为确保工程质量，要求工程设计单位应对条板墙体建筑功能、使用功能提出基本指标要求，使隔墙性能达到**指标。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 九、针对不同功能房间的具体要求应该有详细说明。隔建筑物内部空间的墙，隔墙不承重，一般要求轻、薄，有良好的隔声性能。对于不同功能房间的隔墙有不同的要求，如厨房的隔墙应具有耐火性能；盥洗室的隔墙应具有防潮能力。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 十、明确轻质隔墙板的使用功能要求，有无防水、吊挂重物要求及应采取的措施等；&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 十一、规定轻质隔墙板的防火、隔声指标等；&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 十二、明确轻质隔墙板的抗冲击、抗震功能要求。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;郑州市经济技术开发区郑州隔墙板厂,是目前华中地区**的集新型轻质节能墙体材料的生产、销售、安装于一体的专业化生产企业之一。年生产各类质节能墙体材料30万平米。 公司响应国家的墙改政策，充分吸收国内外先进技术，成功研发生产了满足现代节能建筑需求的节能墙体材料：空心隔墙板（GRC）、复合夹芯条板（FPB）、实心条板（SPB）、陶粒空心条板。 公司生产的节能型建筑隔墙用轻质条条板，其特点是高强度、轻质、实心、薄体、隔声、隔热、保温、防火。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '115.60.180.145', '1', '0', '1645342121', '22', '100', '1645342079', '1679532122', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('8', '1', '1', '轻质隔墙板可以在卫生间用吗？怕不怕水', '0', '1', '272', '1', '&lt;p&gt;轻质隔墙板可以在卫生间用吗？怕不怕水。&lt;/p&gt;&lt;p&gt;能不能直接贴瓷砖，之前用过带面板的那种，没多久就脱落了，很吓人。&lt;br/&gt;&lt;/p&gt;', '', '115.60.180.145', '1', '0', '1645325622', '19', '100', '1645325431', '1679525513', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('9', '2', '1', '轻质隔墙板厚度都有多厚的', '0', '1', '286', '1', '&lt;p&gt;轻质隔墙板厚度都有多厚的，哪些厚度可以用在外墙，哪些厚度可以用到内墙呢？&lt;/p&gt;', '', '115.60.180.145', '1', '0', '1645342453', '23', '100', '1645340986', '1679525452', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('10', '3', '1', '郑州轻质隔墙板厂生产的轻质隔墙板多少钱一平方呢？', '0', '1', '265', '1', '&lt;p&gt;郑州轻质隔墙板厂生产的轻质隔墙板多少钱一平方呢？&lt;/p&gt;&lt;p&gt;量是怎么算的，是按块，还是按平方，或者是怎么说的呢。&lt;/p&gt;', '', '115.60.180.145', '1', '0', '1645341526', '20', '100', '1645341070', '1679556033', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('11', '2', '1', '轻质隔墙板检测指标参数,知道的师傅请回复下，在线等', '0', '1', '277', '1', '&lt;p&gt;轻质隔墙板检测指标参数,知道的师傅请回复下，在线等&lt;/p&gt;&lt;p&gt;尽量说的详细点，最好能给点资料。&lt;/p&gt;', '', '115.60.180.145', '1', '0', '1645341791', '21', '100', '1645341703', '1679525150', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('13', '2', '1', '轻质隔墙板在安装和验收中都有哪些要注意的方面', '0', '1', '273', '1', '&lt;p&gt;轻质隔墙板在安装和验收中都有哪些要注意的方面&lt;/p&gt;', '', '115.60.180.145', '1', '0', '1645342608', '24', '100', '1645342576', '1679525182', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('14', '2', '1', '老师傅对你讲轻质隔墙板的功能和技术指标', '0', '0', '275', '0', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&amp;nbsp;轻质隔墙板是一种新式的墙体资料，它是由无害化磷石膏、轻质钢渣、粉煤灰等多种工业废渣组合而成，依照制造技术和资料的不一样，资料干湿度的不一样，能够分有很多种，GRC轻质隔墙板从原料上可分为，水泥原料隔墙板，石膏原料隔墙板，陶粒混凝土隔墙板，纤维水泥隔墙板；从制造布局上可分为，实心发泡隔墙板，夹芯板隔墙板，中空管状隔墙板。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 轻质隔墙板的夹心板墙还有很多种，有的是以夹胀大苯板、挤塑板等有机保温隔音资料为填充物的，有的是以发泡水泥、岩棉等无机资料为首要填充物的。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;strong style=&quot;margin: 0px; padding: 0px;&quot;&gt;轻质隔墙板&lt;/strong&gt;具有质量轻、强度高、多重环保、保温隔热、隔音、呼吸调湿、防火、疾速施工、下降墙体本钱等长处；&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;strong style=&quot;margin: 0px; padding: 0px;&quot;&gt;轻质隔墙板&lt;/strong&gt;工程的运用功用需求，系指隔声、保温、防火、防水、抗震及墙面平坦、无开裂等需求。耐久性需求板材化学成分的稳定性，应确保条板后期的物理力学性能不下降，不发生翘曲、裂缝表象。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;在满意工程设计需求及修建运用功用、耐久性需求的一起，还应契合国家现行的有关商品规范及规范规则。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;GRC轻质隔墙板选用低碱硫酸盐水泥加炉灰渣等敷料混合出产的环保型商品。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 90mm厚的墙板性能与240mm砖墙适当,可添加修建运用面积每百平方米添加10-13平方米运用空间。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;轻质隔墙板全体荷载比砖混墙分量削减60%左右，整个梁柱及地基可削减造价十分可观，可下降归纳造价20%以上。施工速度大大提高，墙体可直接刮大白、粘瓷砖，与同类商品比较可加速施工速度3-5倍。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;轻质隔墙板抗压强度、抗弯荷载、抗冲击、隔音、保温、防火、干缩短值超越国家建材行业规则的目标。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 干法操作、可钉、可锯、可钻、切开简单、埋管走线便利、装置便利。归纳以资料剖析及优势比照，GRC隔墙板全体优势十分显着，与同类商品比较，具有很大的发展潜力并契合国家修建环保的需求。&lt;/p&gt;', '', '115.60.180.145', '1', '0', '0', '0', '100', '1645342684', '1679553106', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('15', '2', '1', '轻质隔墙板安装工程验收中不肯说的秘密', '0', '0', '247', '0', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;作为新型建筑材料，轻质隔墙板因其优良性能已经成为内隔墙不可缺少的材料。好的产品需要安装标准、施工专业、验收严格，才能给人高产品高享受的感觉。在这里郑州轻质隔墙板为您提供几个技巧：&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 1、轻质隔墙板安装应垂直、平整、位置正确，转角应规正，板材不得有缺边、掉角、开裂等缺陷。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 检验方法：观察，尺量检查。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 2、轻质隔墙板的品种、规格、物理力学性能应符合设计要求。有隔声、保温、隔热、阻燃、防潮等特殊要求的工程,板材应有满足相应性能等级的检测报告。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 检验方法：观察，检查产品合格证书、进场验收记录和性能检测报告。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 3、轻质隔墙板安装所需预埋件、连接件的位置、数量和连接方法应符合设计要求。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 检验方法：观察，尺量检查；检查隐蔽工程验收纪录。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 4、轻质隔墙板上开的孔洞、槽、盒应位置准确、套割方正、边缘整齐。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 检验方法：观察。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 5、轻质隔墙板与轻质隔墙板之间、轻质隔墙板与建筑结构间结合应牢固、稳定，连接方法应符合设计要求。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 检验方法：观察，手扳检查。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 6、轻质隔墙板安装所用接缝材料的品种及接缝方法应符合设计要求。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 检验方法：观察，检查产品合格证书和施工记录。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 7、轻质隔墙板安装完成后表面应平整、接缝应顺直。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 检验方法：观察，手摸检查。&lt;/span&gt;&lt;/p&gt;', '', '115.60.180.145', '1', '0', '0', '0', '100', '1645342785', '1679525156', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('16', '2', '1', '为什么很多轻质隔墙板安装中都避免不了裂缝', '0', '1', '242', '1', '&lt;p&gt;请有经验的老师傅给详细的讲讲，喷子就不需要了。&lt;/p&gt;', '', '115.60.180.145', '1', '0', '1645343107', '25', '100', '1645343005', '1679525521', '0', '0');
INSERT INTO `ey_weapp_ask` VALUES ('17', '2', '1', '老板你真的了解新型轻质隔墙板吗看看老师怎么说吧', '0', '0', '279', '1', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;新型轻质隔墙板另有这精良的隔音成果，没有至于你终日被路上的车辆所打搅到，防潮防水，隔热保温关于一个屋子来讲也是很须要的成绩，说也没有心愿本人的屋子漏风四处渗水，当然关于新型轻质隔墙板这种的资料优点太多，有很年夜的卖点，以是不少无良厂家会违反本人的良知消费一些劣质的产物，以是各人正在筛选的时分肯定要去正轨的经销商去正轨的公司采办，否则您的屋子只需应用一段工夫后必然会呈现一些成绩，到时分您就是赔了夫人又折兵了。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;环保：轻质防火隔墙板100%没有含对人体无害的物资，餍足国度《修建用轻质隔墙条板》（GB23451-2009）规范，属喷射性修建主体资料以及A类装修资料，应用范畴没有受任何限度。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;  防火：轻质防火隔墙板正在1000摄氏度的低温下的耐火极限超越4小时，并且没有分发有毒气体，没有燃功能达到国度A级规范。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;  增年夜屋宇应用面积：轻质防火隔墙板分为内墙以及外墙，内墙的隔墙板能够充沛的扩展屋宇的空间。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;  轻质经济：轻质防火隔墙板施工简略便捷，升高休息强度，放慢施工进度，节约工程总造价，餍足了没有同客户对古代修建室表里环境的要求。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;  隔音：轻质防火隔墙板具备精良的隔音成果，其隔音成果合乎国度室第的隔音要求，年夜年夜高于其余砌砖墙体的隔音成果。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;&amp;nbsp;留意事项三：将轻质隔墙板保留正在干燥之处。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;&amp;nbsp; &amp;nbsp; 假如临时没有会应用到，咱们能够将其寄存正在干燥之处备用，假如高空有水或许四周环境比拟湿润，就会影响轻质隔墙板的应用成果。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;&amp;nbsp; &amp;nbsp; 轻质隔墙板的厚度是纷歧样的，当搬运厚度年夜的轻质隔墙板的时分，咱们能够一块一块地搬运，然而正在搬运低于8cm厚度的轻质隔墙板的时分，咱们能够将两块墙板放正在一同搬运，这样搬运的速率要比一块搬运的快，节流工作工夫，也没有会对其造成侵害。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;喷发技巧&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; list-style: none; font-size: 16px;&quot;&gt;包罗手艺喷发以及自动喷发。20世纪70年月初英国建筑钻研院(BRE)最早用此方法制作玻璃纤维加强水泥(GRC)制品。无论它依然是一个机器工艺喷发喷发，喷发的技巧，经过经营商以及公用设施的专门培训需要。操作或没有正确的办法明显影响GRC产物的强度以及持久性。对于喷发技巧，玻璃纤维以二维乱向随机散布于水泥沙浆之中，有用的行使率高纤维，该产物的物感性能也较好。&lt;/span&gt;&lt;/p&gt;', '', '115.60.180.145', '1', '0', '0', '0', '100', '1645343409', '1679528536', '0', '0');
