INSERT INTO `ey_weapp_ask` VALUES ('22', '2', '1', '圈里经常做酒店客房隔墙说说隔音要求多少分呗', '0', '1', '298', '1', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;说到酒店大家一定都不陌生，对于入住者来说安静的空间和私密，性是尤为重要的。能保户个人空间的一定就是房间与房间的分割墙体了，在选择墙体材料是很多人陷入了困境，有人说应该做很厚的，有人说应该选最重的。也有人说应该按照行业归规范来选择合适的轻质隔墙板材料。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;这个标准究竟是多少呢？&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;有人说是40分贝，有人说是50分贝，究竟谁说的更对，更有科学依据呢？其实以上两者都没错，Why?&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;是的你没有听错，其实按照行业规范这个标准是分白天和夜晚的，白天标准是50分贝，因为白天噪音更多所以要求要稍高一点。夜晚就是40分贝就能够满足条件了。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;知道了吗！亲!&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '115.60.182.189', '1', '0', '1647249262', '31', '100', '1647249203', '1679525381', '0', '0');
