INSERT INTO `ey_weapp_ask_answer` VALUES ('21', '11', '1', '1', '2', '1', 'admin', '0', '115.60.180.145', '&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;轻质隔墙板检测指标参数&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;空气隔声合格标准&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;1、轻质隔墙板空气声隔声量:不小于30dB&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;防火检测合格标准&lt;br style=&quot;box-sizing: border-box; margin: 0px; padding: 0px;&quot;/&gt;2、轻质隔墙板耐火极限:不小于1h&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 11px; padding: 0px; color: rgb(153, 153, 153); font-family: Roboto, &amp;quot;PingFang SC&amp;quot;, &amp;quot;Lantinghei SC&amp;quot;, &amp;quot;Microsoft Yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft Sans Serif&amp;quot;, &amp;quot;WenQuanYi Micro Hei&amp;quot;, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;防火检测合格标准&lt;/span&gt;&lt;br style=&quot;box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;3、燃烧性:为非燃烧体&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;面密度检测合格标准&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;4、面密度;不大于90 千克/平米&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;干缩值检测合格标准&lt;br style=&quot;box-sizing: border-box; margin: 0px; padding: 0px;&quot;/&gt;5、枯燥缩短值:不大于0.8 mm/m&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); border: 0px; list-style: none; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;;&quot;&gt;抗弯曲检测合格标准&lt;br style=&quot;box-sizing: border-box; margin: 0px; padding: 0px;&quot;/&gt;6、轻质隔墙板抗弯损坏荷载:抗弯损坏荷载值不小于板自重的0.75倍。&lt;br style=&quot;box-sizing: border-box; margin: 0px; padding: 0px;&quot;/&gt;7、轻质隔墙板抗冲击强度:接受30kg砂袋落差0.5m的摇摆冲击三次，不呈现贯穿裂纹。&lt;br style=&quot;box-sizing: border-box; margin: 0px; padding: 0px;&quot;/&gt;8、单点吊挂力:受800N单点吊挂力效果24h，不呈现贯穿裂纹。&lt;br style=&quot;box-sizing: border-box; margin: 0px; padding: 0px;&quot;/&gt;轻质隔墙板住宅的物理力学性能应契合如上规则。&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 11px; padding: 0px; color: rgb(153, 153, 153); font-family: Roboto, &amp;quot;PingFang SC&amp;quot;, &amp;quot;Lantinghei SC&amp;quot;, &amp;quot;Microsoft Yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft Sans Serif&amp;quot;, &amp;quot;WenQuanYi Micro Hei&amp;quot;, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br style=&quot;box-sizing: border-box; margin: 0px; padding: 0px;&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 11px; padding: 0px; color: rgb(153, 153, 153); font-family: Roboto, &amp;quot;PingFang SC&amp;quot;, &amp;quot;Lantinghei SC&amp;quot;, &amp;quot;Microsoft Yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft Sans Serif&amp;quot;, &amp;quot;WenQuanYi Micro Hei&amp;quot;, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); color: rgb(255, 0, 0);&quot;&gt;如果想获取更多的相关知识请加微信：15515532955&amp;nbsp; 发送获取资料&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1', '0', '0', '0', '1645341739', '1645341852');
INSERT INTO `ey_weapp_ask_answer` VALUES ('20', '10', '1', '1', '3', '1', 'admin', '0', '115.60.180.145', '&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 正常情况下这个量是按照平方来计算的，因为每个工程的高度不一样有差别，有些是2.9米高的墙，有些要用到4米多甚至5米多，很显然这样对于生产或者是客户都是不公平的。&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 常规的规格是60公分宽，用的相对多的尺寸是2.8米，3.0米，3.2米，厚度的话优选9公分的。&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 价格的话这个是没法直接订的，这个也是会受季节的影响，冬季来说温度低，出板量小，水泥要选用高标号的，并且量要比夏季多加。&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 如果需要获得准确得价格可以电话：15515532955&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 这样报的价格会比较准确。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1', '0', '0', '0', '1645341522', '1645341522');
