INSERT INTO `ey_weapp_ask_answer` VALUES ('23', '9', '1', '1', '2', '1', 'admin', '0', '115.60.180.145', '&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;常用的厚度是9公分和12公分的，说句真心话，内墙外墙都可以用，为啥这么说呢，9公分的虽然薄了点，但是如果站在综合造价和整体效果来言，用9公分或者12公分的做好以后，用砂浆粉一下，这样成本即低但是效果确很好。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;如果你还是拿不准的话，可以打电话15515532955，详细的给你讲解分析，供你参考。&lt;/p&gt;', '1', '0', '0', '0', '1645342449', '1645342449');
INSERT INTO `ey_weapp_ask_answer` VALUES ('24', '13', '1', '1', '2', '1', 'admin', '0', '115.60.180.145', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;轻质隔墙板安装工程验注意事项&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 3px 0px; border: 0px; list-style: none; font-size: 14px; color: rgb(51, 51, 51); line-height: 24px; font-family: &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;一、 工程应对板的甲醛含量进行复验。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;二、轻质隔墙工程应对下列荫蔽工程项目进行查验&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　1.&amp;nbsp; 骨架隔墙中设备管线的装置及水管试压。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　2.&amp;nbsp; 木龙骨防火、防腐处置。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　3.&amp;nbsp; 预埋件或拉结筋。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　4.&amp;nbsp; 龙骨装置。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　5.&amp;nbsp; 填充资料的设置。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;三、&lt;strong style=&quot;margin: 0px; padding: 0px;&quot;&gt;轻质隔墙板&lt;/strong&gt;工程查验时应查看下列文件和记载：&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　1. 描绘说明及其他描绘文件。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　2. 资料的商品合格证书、功能检测陈述、出场查验记载和复验陈述。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　3.&amp;nbsp; 荫蔽工程查验记载。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　4.&amp;nbsp; 施工记载。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;四、各分项工程的查验批应按下列规则区分：&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　&amp;nbsp;&amp;nbsp; 同一种类的轻质隔墙工程每50间(大面积房间和走廊按轻质隔墙的墙面30m2为一间)应区分为一个查验批，缺乏50间也应区分为一个查验批。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;五、轻质复合墙板与顶棚和其他墙体的交接处应采纳防开裂办法。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;六、民用建筑轻质隔墙工程的隔声功能应契合现行国家标准《民用建筑隔声描绘规范》的规则。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 板材隔墙工程的查看数量应契合下列规则： 每个查验批应至少查看10%，并不得少于3间，缺乏3间时应全数查看。七、主控项目&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　1.&amp;nbsp; 复合墙板材的种类、标准、功能、色彩应契合描绘需求。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　2.&amp;nbsp; 装置复合墙板材所需预埋件、衔接件的方位、数量及衔接办法应契合描绘需求。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　3.&amp;nbsp; 复合墙板材装置有必要结实。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　4.&amp;nbsp; 复合墙板材所用接缝资料的种类及接缝办法应契合描绘需求。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;八、通常项目&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　1. 复合&lt;strong style=&quot;margin: 0px; padding: 0px;&quot;&gt;墙板&lt;/strong&gt;材装置应笔直、平坦、方位正确，板材不该有裂缝或残缺。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　2. 板材隔墙外表应平坦润滑、色泽共同、洁净，接缝应均匀、顺直。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　3.&amp;nbsp; 隔墙上的孔洞、槽、盒应方位正确、套割方正、边际规整。&lt;br style=&quot;margin: 0px; padding: 0px;&quot;/&gt;　　4.&amp;nbsp;&amp;nbsp;&lt;strong style=&quot;margin: 0px; padding: 0px;&quot;&gt;板材隔墙&lt;/strong&gt;装置的对接缝的误差。&lt;/p&gt;', '1', '0', '0', '0', '1645342603', '1645342603');
INSERT INTO `ey_weapp_ask_answer` VALUES ('25', '16', '1', '1', '2', '1', 'admin', '0', '115.60.180.145', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;解决您安装轻质隔墙板时的连接问题&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;　安装轻质隔墙板的时候，都是一块一块的，在使用的时候都是拼接的，所以在拼接轻质隔墙板的时候就要掌握一定的技巧，来避免板材连接不严实的问题，同时了解产生这样问题的原因是什么，才能找到有效的解决办法。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;既然是拼接肯定会有缝隙，可是板材的边缘在运输或者施工的时候受到损害，肯定是不平不直的，这样施工好的墙体缝隙可能更大，所以作为隔墙板是需要封堵住的，于条板长度生产误差，梁、柱底面高度模板误差,两者上下缝间一般在3-8cm范围内，该缝间可用水泥砂浆和板头、砖块等硬物填充，但不允许挤实保持和梁隔1cm沉降空隙，靠梁下的阴角砂浆用园抹灰板压实成外八字形，等装饰面处理时用弹性乳液制作成弹性砂浆腻子将空隙和阴角内填实补齐刮平，可保证纵向裂缝不超过5%。两板接缝水泥砂浆必须饱满挤紧，挤出的多余砂浆及时刮平，板边调节处理槽必须等接缝内水泥砂浆、墙板干透后抹灰时一同处理。&lt;/span&gt;&lt;br style=&quot;margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px;&quot;&gt;轻质隔墙板由于它是利用无害化处理的磷石膏进行湿法生产，不需要对磷石膏进行脱水及烘干处理，所以不需要昂贵的设备投入，故此可以说轻质隔墙板技术的问世将揭开磷石膏综合利用的新篇章，具有突出的环保意义。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;楼主如果你受这个问题困扰请联系我，15515532955刘经理，不管你买不买我们的产品都免费帮你解决。&lt;/p&gt;', '1', '0', '0', '0', '1645343103', '1645343120');
