INSERT INTO `ey_weapp_ask_answer` VALUES ('19', '8', '1', '1', '1', '1', 'admin', '1', '115.60.180.145', '&lt;p&gt;轻质隔墙板用于卫生间隔墙有以下几大优势特点：&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;text-size-adjust: none; margin: 0px; padding: 0px;&quot;/&gt;&lt;/p&gt;&lt;p&gt;1、质隔墙具有体薄，轻质，隔音，防水，防火、保温、防潮等优点。因此在卫浴安装方面也有着不小的优势。&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;text-size-adjust: none; margin: 0px; padding: 0px;&quot;/&gt;&lt;/p&gt;&lt;p&gt;2、卫生间轻质隔墙可减少噪音：洗澡水流声会严重影响到家人的休息，卫生间轻质隔墙具有良好的隔音效果，其隔音效果符合国家住宅的隔音要求，大大高于其他砌砖墙体的隔音效果。&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;text-size-adjust: none; margin: 0px; padding: 0px;&quot;/&gt;&lt;/p&gt;&lt;p&gt;3、卫生间轻质隔墙防水防潮：轻质隔墙板的面板是专业的防水板，有良好的防水，防潮性能，可适用于厨房、卫生间、地下室等潮湿区域。&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;text-size-adjust: none; margin: 0px; padding: 0px;&quot;/&gt;&lt;/p&gt;&lt;p&gt;4、卫生间轻质隔墙环保：使用原料不含对人体有害物质，无放射性A类产品，符合国标准。&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;text-size-adjust: none; margin: 0px; padding: 0px;&quot;/&gt;&lt;/p&gt;&lt;p&gt;5、卫生间轻质隔墙防火：在1000摄氏度的高温下的耐火极限不低于3小时，而且不散发有毒气体，不燃性能达到标准。&lt;/p&gt;&lt;p&gt;所以可以放心使用。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1', '0', '0', '0', '1645325524', '1645325628');
INSERT INTO `ey_weapp_ask_answer` VALUES ('32', '23', '1', '1', '1', '1', 'admin', '0', '115.60.177.219', '&lt;p&gt;对于板材类型的选择，这个题目是没有固定答案的，首先要根据自己的选择来定。&lt;/p&gt;&lt;p&gt;我给大家提供几个思路。&lt;/p&gt;&lt;p&gt;1，对外观的要求。&lt;/p&gt;&lt;p&gt;2，对隔音的要求。&lt;/p&gt;&lt;p&gt;3，对防火等几的要求。&lt;/p&gt;&lt;p&gt;4，对耐火极限的要求。&lt;/p&gt;', '1', '0', '0', '0', '1669033345', '1669033345');
