INSERT INTO `ey_weapp_recruits` VALUES ('29', 'C1驾照货车司机', '10', '', '5978', '5981', '0', '33', '0', '0', '2', '0', '0', '0', '100', '1', '1695114258', '1695116898', '0', '1,C1及以上驾照，1年以上驾龄2，年龄25-40岁3，能吃苦耐劳，有客户服务意识薪资待遇:1, 保底8000元/月，加提成 多劳多得2， 月均收入10000- 15000元/月3，每月18号准时发放工资4，入职购买社保/五险车辆要求:1， 货运版面包车2, 3年内车龄3, 车补/电补最高5000元/月', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('12', '京东商城', '13', '/uploads/allimg/20230919/4-230919161353a2.jpg', '4027', '0', '0', '1', '0', '0', '3', '0', '0', '0', '100', '1', '1693826399', '1695111837', '1', '京东是中国的综合网络零售商，是中国电子商务领域受消费者欢迎和具有影响力的电子商务网站之一，在线销售家电、数码通讯、电脑、家居百货、服装服饰、母婴、图书、食品、在线旅游等12大类数万个品牌百万种优质商品。京东在2012年的中国自营B2C市场占据49%的份额，凭借全供应链继续扩大在中国电子商务市场的优势。京东已经建立华北、华东、华南、西南、华中、东北六大物流中心，同时在全国超过360座城市建立核心城市', '', '', '0', '0');
