INSERT INTO `ey_weapp_recruits` VALUES ('19', '海南某某网络科技有限公司', '7', '/uploads/allimg/20230919/4-230919150I1G9.jpg', '6280', '6281', '6301', '1', '4', '0', '3', '0', '0', '0', '100', '1', '1695107789', '1695108868', '0', '智讯通内容管理系统(EyouCms) 隶属于海南赞赞网络科技有限公司，新闻通以模板多、智讯通化、开源而闻名，是国内新锐的PHP开源网站管理系统，也是受用户好评的PHP类CMS系统，在经历多年的发展，目前的版本无论在功能，还是在后台易用性方面，都有了长足的发展和进步，eyoucms免费版的主要目标用户锁定在有企业建站需求的群体，当然也不乏有个人用户和学校等在使用该系统。企业网站，无论大型还是中小型企', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('20', '北京英才网科技有限公司', '8', '/uploads/allimg/20230919/4-230919160046145.png', '4008', '4016', '0', '2', '0', '0', '3', '0', '0', '0', '100', '1', '1695110417', '1695457814', '1', '北京英才网科技有限公司成立于2018年3月，是一家基于人力资源行业，为客户提供一站式、标准化人力资源解决方案的专业化公司，是国内较早从事人力资源外包的专业人才服务机构之一。同时也是区域招聘网站——北京英才网的运营商。', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('21', '阿里巴巴集团', '10', '/uploads/allimg/20230919/4-230919160549194.jpg', '4958', '4959', '4975', '32', '0', '0', '3', '0', '0', '0', '100', '1', '1695110735', '1695111019', '0', '阿里巴巴集团的使命是让天下没有难做的生意。我们旨在赋能企业改变营销、销售和经营的方式。我们为商家、品牌及其他企业提供基本的互联网基础设施以及营销平台，让其可借助互联网的力量与用户和客户互动。我们的业务包括核心电商、云计算、数字媒体和娱乐以及创新项目和其他业务。我们并通过子公司菜鸟网络及所投资的关联公司口碑，参与物流和本地服务行业，同时与蚂蚁金融服务集团有战略合作，该金融服务集团主要通过中国领先的第', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('22', '北京百度网讯科技有限公司', '11', '/uploads/allimg/20230919/4-230919160UMa.png', '4008', '4016', '0', '35', '0', '0', '3', '0', '0', '0', '100', '1', '1695110922', '1695115152', '1', '北京百度网讯科技有限公司成立于2001年06月05日，注册地位于北京市海淀区上地十街10号百度大厦2层，法定代表人为梁志祥。经营范围包括技术转让、技术咨询、技术服务、技术培训、技术推广;设计、开发、销售计算机软件;经济信息咨询;利用www.baidu.com、www.hao123.com(www.hao222.net、www.hao222.com)网站发布广告;设计、制作、代理、发布广告;货物进出', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('23', '北京腾讯网', '12', '/uploads/allimg/20230919/4-230919161314222.png', '5978', '5981', '6024', '31', '0', '0', '3', '0', '0', '0', '100', '1', '1695111024', '1695457821', '1', '深圳市腾讯计算机系统有限公司成立于1998年11月，由马化腾、张志东、许晨晔、陈一丹、曾李青五位创始人共同创立。 腾讯多元化的服务包括：社交和通信服务QQ及微信/WeChat、社交网络平台QQ空间、腾讯游戏旗下QQ游戏平台、门户网站腾讯网、腾讯新闻客户端和网络视频服务腾讯视频等。  2004年腾讯公司在香港联交所主板公开上市（股票代号00700），董事会主席兼首席执行官是马化腾。 2018年6月2', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('26', '京东商城运营', '13', '/public/static/common/images/dfboy.png', '5978', '5979', '0', '1', '4', '0', '2', '0', '0', '0', '100', '1', '0', '1695700424', '1', '1、负责整理客户资料；2、接受客户订单，制作销售订单，并与财务对接；3、负责联络沟通客户；4、协助主管完善部门规章制度和操作流程与规范，做好销售的后台支持；5、相关的销售协议、合同等存档管理。', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('27', '市场专员', '14', '', '4363', '0', '0', '1', '4', '0', '2', '0', '0', '0', '100', '1', '1695113906', '1695455764', '0', '1、市场营销、广告或相关专业大专以上学历。2、受过市场营销、广告策划、产品知识等方面的培训。3、1年以上的销售工作经验。4、对市场营销工作有较深刻认知；5、熟悉广告程序、熟练操作办公软件。', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('28', '传感器开发工程师', '11', '', '6280', '0', '0', '33', '0', '0', '2', '0', '0', '0', '100', '1', '1695114031', '1695116820', '0', '工作职责1，按照项目要求完成车规级Camera成像系统光路设计、二级器件选型、内外参标定、产线生产测试方案设计，Camera模组试产问题跟踪、解决2，作为技术接口支持并解决项目过程中Camera相关问题，必要时进行客户现场支持3，基于感知算法和客户要求，完成车规级Camera ISP画质调试及测试工作4，制定车载传感器（Camera/Lidar/Radar等）评测计划，并根据其特性搭建评测体系，完', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('30', '抖音短视频', '15', '/uploads/allimg/20230919/4-2309191G03b61.jpg', '4008', '4016', '0', '31', '0', '0', '3', '0', '0', '0', '100', '1', '1695114553', '1695115151', '1', '北京抖音信息服务有限公司，成立于2012年3月9日，2021年全年的营业收入约为580亿美元， [89] 地址位于北京市海淀区北三环西路甲23号院1号楼2层222 [103] 。公司以建设“全球创作与交流平台”为愿景 [1] 。字节跳动的全球化布局始于2015年 [2] ，“技术出海”是字节跳动全球化发展的核心战略 [3] ，其旗下产品有今日头条、西瓜视频、抖音、头条百科、皮皮虾、懂车帝、悟空问答', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('31', '客服专员', '15', '', '5183', '5189', '0', '31', '0', '0', '2', '0', '0', '0', '100', '1', '1695114812', '1695114812', '0', '岗位职责：1.接听客服热线，为用户提供满意的专业服务，提高用户满意度；2.处理用户问题咨询，进行及时有效的跟进；3.对用户的意见、建议及投诉进行有效的记录与后期跟进处理；4.协调各部门反馈处理结果，并与客户及时沟通，给予有效反馈；5.保持与公司相关部门间的沟通以确保服务质量；6.客服其他日常工作支持。任职要求：1.具备良好的服务意识与服务技巧，以及较强的沟通能力，应变能力；2.普通话流利，能够熟练', '', '', '0', '0');
INSERT INTO `ey_weapp_recruits` VALUES ('32', '行政助理', '15', '', '5724', '5736', '0', '2', '0', '0', '2', '0', '0', '0', '100', '1', '1695114998', '1695700404', '1', '岗位职责1、公司成立、变更、注销等业务办理；2、公司日常行政管理的运作（包括运送安排、邮件和固定的供给等等）；3、负责公司的档案管理及各类文件、合同资料存档保管校对；4、负责各类会务的安排工作、客户接待工作安排；5、公文撰写发布，团建活动组织、员工福利的工作；6、协助上级对各项行政事务的安排及执行；7、完成上级交给的其它事务性工作。', '', '', '0', '0');
