INSERT INTO `ey_weapp_recruits` VALUES ('37', '拼多多', '14', '/uploads/allimg/20230919/4-230919161509245.png', '4817', '4821', '0', '1', '7', '0', '3', '0', '0', '0', '100', '1', '1696755175', '1696755175', '0', '上海寻梦信息技术有限公司成立于2014年，2015年4月，创办新电商平台拼多多，拼多多现为公司旗下主要产品。目前，拼多多平台已汇聚7.313亿年度活跃买家和510万活跃商户，平台年交易额达人民币14576亿元，迅速发展成为中国第二大电商平台。拼多多以独创的社交拼团为核心模式，主打百亿补贴、农货上行、产地好货等，致力于服务中国最广大的普通消费者。拼多多平台以“好货不贵”为运营理念，为消费者提供补贴折', '', '', '0', '0');
