INSERT INTO `ey_weapp_recruits_company_content` VALUES ('2', '12', '&lt;p&gt;京东是中国的综合网络零售商，是中国电子商务领域受消费者欢迎和具有影响力的电子商务网站之一，在线销售家电、数码通讯、电脑、家居百货、服装服饰、母婴、图书、食品、在线旅游等12大类数万个品牌百万种优质商品。京东在2012年的中国自营B2C市场占据49%的份额，凭借全供应链继续扩大在中国电子商务市场的优势。京东已经建立华北、华东、华南、西南、华中、东北六大物流中心，同时在全国超过360座城市建立核心城市配送站。2012年8月14日，京东与苏宁开打&amp;quot;史上最惨烈价格战&amp;quot; 。2013年3月30日19点整正式切换了域名，并且更换新的logo&lt;/p&gt;', '刘先生', '020-88888888', '天津市', '20人以下', '/uploads/allimg/20230919/4-230919150F0L2.jpg', '1693826399', '1695111837', '朝九晚五,加班补助,包食宿,管理规范,有提成');
INSERT INTO `ey_weapp_recruits_company_content` VALUES ('4', '19', '&lt;p style=&quot;white-space: normal;&quot;&gt;智讯通内容管理系统(EyouCms) 隶属于海南赞赞网络科技有限公司，新闻通以模板多、智讯通化、开源而闻名，是国内新锐的PHP开源网站管理系统，也是受用户好评的PHP类CMS系统，在经历多年的发展，目前的版本无论在功能，还是在后台易用性方面，都有了长足的发展和进步，eyoucms免费版的主要目标用户锁定在有企业建站需求的群体，当然也不乏有个人用户和学校等在使用该系统。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;企业网站，无论大型还是中小型企业，利用网络传递信息在一定程度上提高了办事的效率，提高企业的竞争力。EyouCms网站建设系统适合做各类型网站，EyouCms是什么，EyouCms是一个自由和开放源码的内容管理系统，它是一个可以独立使用的内容发布系统（CMS）。在中国，EyouCms属于人们喜爱的CMS系统。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;政府机关，通过建立政府门户，有利于各种信息和资源的整合，为政府和社会公众之间加强联系和沟通，从而使政府可以更快、更便捷、更有效开展工作。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;教育机构，通过网络信息的引入，使得教育机构之间及教育机构内部和教育者之间进行信息传递，全面提升教育类网站的层面。&lt;br data-filtered=&quot;filtered&quot;/&gt;&lt;br data-filtered=&quot;filtered&quot;/&gt;我们的愿景：成为模板建站行业的领跑者&lt;br data-filtered=&quot;filtered&quot;/&gt;企业的使命：让天下没有难做的网站&lt;br data-filtered=&quot;filtered&quot;/&gt;企业价值观：拥抱变化，创造价值！&lt;/p&gt;', '小菜', '0898-88888888', '海南省海口市龙华区城西镇龙昆南路146号', '20人以下', '/uploads/allimg/20230919/4-230919150F0L2.jpg', '0', '1695107790', '环境好,年终奖,双休,加班费,朝九晚五');
INSERT INTO `ey_weapp_recruits_company_content` VALUES ('5', '20', '&lt;p&gt;北京英才网科技有限公司成立于2018年3月，是一家基于人力资源行业，为客户提供一站式、标准化人力资源解决方案的专业化公司，是国内较早从事人力资源外包的专业人才服务机构之一。同时也是区域招聘网站——北京英才网的运营商。&lt;/p&gt;', '小菜', '0898-12345678', '北京市海淀区安宁庄西路9号院2号楼-1层01', '20人以下', '/public/static/common/images/not_adv.jpg', '1695110417', '1695110417', '年终奖,五险一金,加班费,加班补助,旅游');
INSERT INTO `ey_weapp_recruits_company_content` VALUES ('6', '21', '&lt;p&gt;阿里巴巴集团的使命是让天下没有难做的生意。&lt;br/&gt;我们旨在赋能企业改变营销、销售和经营的方式。我们为商家、品牌及其他企业提供基本的互联网基础设施以及营销平台，让其可借助互联网的力量与用户和客户互动。我们的业务包括核心电商、云计算、数字媒体和娱乐以及创新项目和其他业务。我们并通过子公司菜鸟网络及所投资的关联公司口碑，参与物流和本地服务行业，同时与蚂蚁金融服务集团有战略合作，该金融服务集团主要通过中国领先的第三方网上支付平台支付宝运营。&lt;br/&gt;&lt;br/&gt;我们的愿景&lt;br/&gt;我们旨在构建未来的商务生态系统。我们的愿景是让客户相会、工作和生活在阿里巴巴，并持续发展最少102年。&lt;/p&gt;', '阿里', '020-88888888', '浙江省杭州市滨江区网商路699号', '20-99人', '/public/static/common/images/not_adv.jpg', '1695110735', '1695111019', '加班费,朝九晚五,加班补助,管理规范,有年假');
INSERT INTO `ey_weapp_recruits_company_content` VALUES ('7', '22', '&lt;p&gt;北京百度网讯科技有限公司成立于2001年06月05日，注册地位于北京市海淀区上地十街10号百度大厦2层，法定代表人为梁志祥。经营范围包括技术转让、技术咨询、技术服务、技术培训、技术推广;设计、开发、销售计算机软件;经济信息咨询;利用www.baidu.com、www.hao123.com(www.hao222.net、www.hao222.com)网站发布广告;设计、制作、代理、发布广告;货物进出口、技术进出口、代理进出口;医疗软件技术开发;委托生产电子产品、玩具、照相器材;销售家用电器、机械设备、五金交电(不含电动自行车)、电子产品、文化用品、照相器材、计算机、软件及辅助设备、化妆品、卫生用品、体育用品、纺织品、服装、鞋帽、日用品、家具、首饰、避孕器具、工艺品、钟表、眼镜、玩具、汽车及摩托车配件、仪器仪表、塑料制品、花、草及观赏植物、建筑材料、通讯设备、汽车电子产品、器件和元件、自行开发后的产品;预防保健咨询;公园门票、文艺演出、体育赛事、展览会票务代理;翻译服务;通讯设备和电子产品的技术开发;计算机系统服务;车联网技术开发;汽车电子产品设计、研发、制造(北京市中心城区除外);演出经纪;人才中介服;经营电信业务;利用信息网络经营音乐娱乐产品、演出剧(节)目、动漫产品、游戏产品(含网络游戏虚拟货币发行)、表演、网络游戏技法展示或解说(网络文化经营许可证有效期至2020年04月17日);因特网信息服务业务(除出版、教育、医疗保健以外的内容);图书、电子出版物、音像制品批发、零售、网上销售。(市场主体依法自主选择经营项目,开展经营活动;演出经纪、人才中介服务、利用信息网络经营音乐娱乐产品、演出剧(节)目、动漫产品、游戏产品(含网络游戏虚拟货币发行)、表演、网络游戏技法展示或解说、经营电信业务以及依法须经批准的项目,经相关部门批准后依批准的内容开展经营活动;不得从事国家和本市产业政策禁止和限制类项目的经营活动。)北京百度网讯科技有限公司对外投资53家公司，具有9处分支机构。&lt;/p&gt;', '小度', '020-88888888', '北京市海淀区上地十街10号百度大厦2层', '1000-9999人', '/public/static/common/images/not_adv.jpg', '1695110922', '1695110922', '年终奖,双休,五险一金,加班费,朝九晚五');
INSERT INTO `ey_weapp_recruits_company_content` VALUES ('8', '23', '&lt;p&gt;深圳市腾讯计算机系统有限公司成立于1998年11月，由马化腾、张志东、许晨晔、陈一丹、曾李青五位创始人共同创立。 腾讯多元化的服务包括：社交和通信服务QQ及微信/WeChat、社交网络平台QQ空间、腾讯游戏旗下QQ游戏平台、门户网站腾讯网、腾讯新闻客户端和网络视频服务腾讯视频等。&amp;nbsp; 2004年腾讯公司在香港联交所主板公开上市（股票代号00700），董事会主席兼首席执行官是马化腾。 2018年6月20日，世界品牌实验室（World Brand Lab）在北京发布了2018年《中国500最具价值品牌》分析报告。腾讯居第二位。2018年12月，世界品牌实验室编制的《2018世界品牌500强》揭晓，排名第39。&amp;nbsp; 2019年7月，发布2019《财富》世界500强：位列237位。&amp;nbsp; 2019年8月，入选2019年中国最佳董事会50强。2019年9月1日，2019中国服务业企业500强榜单在济南发布，腾讯控股有限公司排名第32位。 2019年10月，2019福布斯全球数字经济100强榜位列14位。&amp;nbsp; 2019年10月23日， 2019《财富》未来50强榜单公布，腾讯控股有限公司排名第12。 [7]&amp;nbsp;&amp;nbsp;“一带一路”中国企业100强榜单排名第14位。2019年12月，腾讯入选2019中国品牌强国盛典榜样100品牌。 [9]&amp;nbsp;&amp;nbsp;2019年12月18日，人民日报发布中国品牌发展指数100榜单，腾讯排名第4位。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '小腾', '020-99999999', '深圳市南山区粤海街道麻岭社区科技中一路腾讯大厦35层', '1000-9999人', '/public/static/common/images/not_adv.jpg', '1695111024', '1695111024', '环境好,年终奖,加班费');
INSERT INTO `ey_weapp_recruits_company_content` VALUES ('11', '30', '&lt;p&gt;北京抖音信息服务有限公司，成立于2012年3月9日，2021年全年的营业收入约为580亿美元， [89] 地址位于北京市海淀区北三环西路甲23号院1号楼2层222 [103] 。公司以建设“全球创作与交流平台”为愿景 [1] 。字节跳动的全球化布局始于2015年 [2] ，“技术出海”是字节跳动全球化发展的核心战略 [3] ，其旗下产品有今日头条、西瓜视频、抖音、头条百科、皮皮虾、懂车帝、悟空问答等。&lt;/p&gt;', '小抖', '020-00000000', '北京市海淀区中关村南大街36号12号楼16层1611号', '100-499人', '/public/static/common/images/not_adv.jpg', '1695114553', '1695114553', '环境好,年终奖,双休,加班费,交通方便');
INSERT INTO `ey_weapp_recruits_company_content` VALUES ('12', '37', '&lt;p style=&quot;white-space: normal;&quot;&gt;上海寻梦信息技术有限公司成立于2014年，2015年4月，创办新电商平台拼多多，拼多多现为公司旗下主要产品。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;目前，拼多多平台已汇聚7.313亿年度活跃买家和510万活跃商户，平台年交易额达人民币14576亿元，迅速发展成为中国第二大电商平台。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;拼多多以独创的社交拼团为核心模式，主打百亿补贴、农货上行、产地好货等，致力于服务中国最广大的普通消费者。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;拼多多平台以“好货不贵”为运营理念，为消费者提供补贴折扣大牌商品、原产地农产品、工厂产品和新品牌商品等。其中，拼多多独创发起的百亿补贴创造了中国电商行业活动规模和持续时长的新纪录。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;拼多多脱胎于农产品电商拼好货。人民网此前发布报告显示，拼多多已经成为中国最大的农产品上行平台。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;2018年7月，拼多多在美国纳斯达克证券交易所正式挂牌上市。&lt;/p&gt;', '李先生', '400-1234-5678', '上海市长宁区娄山关路533号2902-2913室', '1000-9999人', '/uploads/allimg/20230919/4-230919150F0L2.jpg', '1696755175', '1696755175', '双休,全勤奖,旅游');
