INSERT INTO `ey_weapp_recruits_recruit_content` VALUES ('1', '10', '&lt;p&gt;一、&amp;nbsp;负责公司来访客人的接待。&amp;nbsp;&amp;nbsp;二、&amp;nbsp;做好后勤日常工作。&amp;nbsp;&amp;nbsp;三、&amp;nbsp;负责公司信息的收集、整理、打印、分发工作。&amp;nbsp;&amp;nbsp;四、&amp;nbsp;负责公司部分经销商管理工作。&amp;nbsp;&amp;nbsp;五、&amp;nbsp;负责各级文件及会议安排等工作。&amp;nbsp;&amp;nbsp;六、&amp;nbsp;负责接听公司内部电话和收发传真、七、完成总经理交办的其他工作。&lt;/p&gt;', '面议', '实习', '博后', '10年以上', '年终奖,车贴,房贴,技术培训,旅游', '许先生', '13000000000', '江苏扬州', '女', '261', '1693818423', '1695114225');
INSERT INTO `ey_weapp_recruits_recruit_content` VALUES ('7', '29', '&lt;p&gt;1,C1及以上驾照，1年以上驾龄&lt;br/&gt;2，年龄25-40岁&lt;br/&gt;3，能吃苦耐劳，有客户服务意识&lt;br/&gt;薪资待遇:&lt;br/&gt;1, 保底8000元/月，加提成 多劳多得&lt;br/&gt;2， 月均收入10000- 15000元/月&lt;br/&gt;3，每月18号准时发放工资&lt;br/&gt;4，入职购买社保/五险&lt;br/&gt;车辆要求:&lt;br/&gt;1， 货运版面包车&lt;br/&gt;2, 3年内车龄&lt;br/&gt;3, 车补/电补最高5000元/月&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2000~3000/月', '兼职', '小学', '5-10年', '年终奖,双休', '许先生', '13222222222', '广东省深圳市', '男', '23', '1695114258', '1695114258');
INSERT INTO `ey_weapp_recruits_recruit_content` VALUES ('4', '26', '&lt;p&gt;1、负责整理客户资料；&lt;br style=&quot;white-space: normal;&quot;/&gt;2、接受客户订单，制作销售订单，并与财务对接；&lt;br style=&quot;white-space: normal;&quot;/&gt;3、负责联络沟通客户；&lt;br style=&quot;white-space: normal;&quot;/&gt;4、协助主管完善部门规章制度和操作流程与规范，做好销售的后台支持；&lt;br style=&quot;white-space: normal;&quot;/&gt;5、相关的销售协议、合同等存档管理。&lt;/p&gt;', '5000~10000/月', '全职', '本科', '1-3年', '双休,五险一金,加班费,朝九晚五', '许先生', '13988888888', '广东省广州市', '不限', '26', '1695114258', '1695114258');
INSERT INTO `ey_weapp_recruits_recruit_content` VALUES ('5', '27', '&lt;p&gt;1、市场营销、广告或相关专业大专以上学历。&lt;br/&gt;2、受过市场营销、广告策划、产品知识等方面的培训。&lt;br/&gt;3、1年以上的销售工作经验。&lt;br/&gt;4、对市场营销工作有较深刻认知；&lt;br/&gt;5、熟悉广告程序、熟练操作办公软件。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '3000~5000/月', '兼职', '中专', '1-3年', '双休,五险一金,交通方便', '黎女士', '12233333333', '内蒙古某某区', '男', '10', '1695113906', '1695455764');
INSERT INTO `ey_weapp_recruits_recruit_content` VALUES ('6', '28', '&lt;p&gt;工作职责&lt;br/&gt;1，按照项目要求完成车规级Camera成像系统光路设计、二级器件选型、内外参标定、产线生产测试方案设计，Camera模组试产问题跟踪、解决&lt;br/&gt;2，作为技术接口支持并解决项目过程中Camera相关问题，必要时进行客户现场支持&lt;br/&gt;3，基于感知算法和客户要求，完成车规级Camera ISP画质调试及测试工作&lt;br/&gt;4，制定车载传感器（Camera/Lidar/Radar等）评测计划，并根据其特性搭建评测体系，完成竞品分析，积累评测数据&lt;br/&gt;5，跟踪车载前沿光学成像、视觉感知技术的发展，参与自动驾驶竞争力规划、路标设计和方案制定&lt;br/&gt;任职要求&lt;br/&gt;1，计算机、电子、或光学等相关工科专业本科及以上，3年以上工作经验（博士要求1年以上工作经验）&lt;br/&gt;2，熟悉相机模组定制、器件选型和测试，了解相机图像质量评测原理和测试方法&lt;br/&gt;3，具备扎实的镜头、sensor、ISP等技术知识，具备调试Sony/OV/Onsemi 等主流camera sensor经验&lt;br/&gt;4，具备多个项目ISP调试、3A、图像处理、深度学习等相关算法开发经验者优先&lt;br/&gt;5，熟悉Camera，Lidar，Radar，Ultrasonic，IMU，GPS/RTK原理及关键选型指标，有从事上述传感器驱动调试经验或算法开发经验者优先&lt;br/&gt;6，具备Qualcomm，Intel，Nvidia，Renesas，TI，NXP，Infineon等主流硬件平台研发经验者优先&lt;br/&gt;7，有很好的团队合作精神，善于交流，学习能力强&lt;/p&gt;&lt;h3&gt;公司介绍&lt;/h3&gt;&lt;div&gt;“百度”二字，来自于八百年前南宋词人辛弃疾的一句词：众里寻他千百度。这句话描述了词人对理想的执着追求。&lt;br/&gt;百度拥有数万名研发工程师，这是中国乃至全球最为优秀的技术团队。这支队伍掌握着世界上最为先进的搜索引擎技术，使百度成为中国掌握世界尖端科学核心技术的中国高科技企业，也使中国&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '5000~10000/月', '全职', '初中', '1-3年', '年终奖,五险一金,交通方便,旅游', '张先生', '0898-88888888', '海南省海口市龙华区城西镇龙昆南路', '男', '10', '1695114031', '1695114183');
INSERT INTO `ey_weapp_recruits_recruit_content` VALUES ('8', '31', '&lt;p&gt;岗位职责：1.接听客服热线，为用户提供满意的专业服务，提高用户满意度；2.处理用户问题咨询，进行及时有效的跟进；3.对用户的意见、建议及投诉进行有效的记录与后期跟进处理；4.协调各部门反馈处理结果，并与客户及时沟通，给予有效反馈；5.保持与公司相关部门间的沟通以确保服务质量；6.客服其他日常工作支持。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;任职要求：1.具备良好的服务意识与服务技巧，以及较强的沟通能力，应变能力；2.普通话流利，能够熟练使用office办公软件；3.具备2年以上客户服务工作经验，有投诉处理经验者优先；4.能承受一定工作压力，保持良好工作心态；5.对工作认真、负责、具有团队协作精神，有责任感。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '3000~5000/月', '全职', '高中', '1-3年', '年终奖,加班费,加班补助,包食宿,有提成', '张女士', '13900000000', '福建省漳州', '女', '30', '1695114812', '1695114812');
INSERT INTO `ey_weapp_recruits_recruit_content` VALUES ('9', '32', '&lt;p&gt;岗位职责&lt;/p&gt;&lt;p&gt;1、公司成立、变更、注销等业务办理；&lt;/p&gt;&lt;p&gt;2、公司日常行政管理的运作（包括运送安排、邮件和固定的供给等等）；&lt;/p&gt;&lt;p&gt;3、负责公司的档案管理及各类文件、合同资料存档保管校对；&lt;/p&gt;&lt;p&gt;4、负责各类会务的安排工作、客户接待工作安排；&lt;/p&gt;&lt;p&gt;5、公文撰写发布，团建活动组织、员工福利的工作；&lt;/p&gt;&lt;p&gt;6、协助上级对各项行政事务的安排及执行；&lt;/p&gt;&lt;p&gt;7、完成上级交给的其它事务性工作。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2000~3000/月', '兼职', '初中', '1-3年', '双休,五险一金,加班费,朝九晚五,交通方便', '张女士', '13222222222', '湖北随州', '女', '2', '1695114998', '1695114998');
INSERT INTO `ey_weapp_recruits_recruit_content` VALUES ('10', '38', '&lt;p&gt;主要需要掌握检修打印机、复印机及多功能一体机等机器的技术！！！&lt;br/&gt;1、负责网络及其设备的维护、管理、故障排除等日常工作，确保公司网络日常的正常运作；&lt;br/&gt;2、负责公司办公环境的软硬件和桌面系统的日常维护；&lt;br/&gt;3、维护和监控公司局域网、广域网，保证其正常运行，确保局域网、广域网在工作期间内安全稳定运行；&lt;br/&gt;4、安装和维护公司计算机、服务器系统软件和应用软件，打印机、复印机及一体机等，同时为其他部门提供软硬件技术支持；&lt;br/&gt;5、解决排除各种软硬件故障，做好记录，定期制作系统运行报告；&lt;br/&gt;6、维护数据中心，对系统数据进行备份。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '5000~10000/月', '全职', '本科', '5-10年', '专车接送,有补助,晋升快,车贴', '汪女士', '020-88888888', '广东省广州市番禺区', '不限', '10', '1696755375', '1696755375');
