INSERT INTO `ey_ycnhad_content` VALUES ('1', '106', '1583990544', '1583990544', '整体成型,6功能阀,6功能阀', '/uploads/allimg/20200312/1-200312131034325.jpg', '444意萬仕的创新设计和先进技术提供优越的过滤性能，和純淨清澈的水。Max系列过滤器采用高密度聚乙烯，整体吹塑而成，具有重型性能和可靠性。', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('2', '107', '1583990716', '1583990716', '整体成型,6功能阀,易于操作', '/uploads/allimg/20200312/1-200312132439321.jpg', 'Volumetric过滤器能过滤出最佳清晰度的水，是市場中擁有卓越壓力標準的產品。', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('3', '108', '1583991702', '1583991702', '超大 過濾面積,可特别定制,適合 大規模設施', '/uploads/allimg/20200312/1-200312131034325.jpg', '商用砂过滤器适用于任何规模的商业游泳池，水族馆，水上樂园，水景和水处理项目。 意萬仕提供各种型号和规格，及特別定制服务，\r\n以满足閣下商业项目的任何设备要求。', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('4', '109', '1583991842', '1583991842', '超級宁静,节省能源,耐用可靠', '/uploads/allimg/20200312/1-200312132439321.jpg', '意萬仕 E-Power变速水泵可减少游泳池，SPA，瀑布或喷泉的能源消耗。 除了因效率提高而节省成本，還可以节省过度使用和降低设备维护成本。', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('5', '110', '1583991981', '1583991981', '自动化程序,平衡PH值,容易安装', '/uploads/allimg/20200312/1-20031213460N59.jpg', '盐氯化泳池是享受舒适浴的最佳选择之一，但这类系统往往会提高pH值。 使用SSCone，其自动加药泵注入酸液，以达到最有效的氯氣和适当的pH平衡。', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('6', '116', '1584082239', '1584082239', 'UNIQUE ONE-PIECE,6-WAY VALVE,EASY- OPERATION', '/uploads/allimg/20200312/1-200312131034325.jpg', 'Emaux\'s innovative design and advanced technology offer superior filtration performance and crystal clear water. Max Series Filters are made of high-density polyethylene by blow molding for making the one-piece hollow part which contributes its heavy-duty performance and high reliability.', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('7', '117', '1584082430', '1584082430', 'UNIQUE ONE-PIECE,6-WAY VALVE,EASY- OPERATION', '/uploads/allimg/20200312/1-200312132439321.jpg', 'The Volumetric Filter is engineered for the best clarity of filtered water and an outstanding pressure standard among the market benchmarks.', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('8', '118', '1584082486', '1584082486', 'LARGE FILTRATION AREA,CUSTOM- MADE,FOR LARGE FACILITIES', '/uploads/allimg/20200312/1-20031213460N59.jpg', 'The commercial sand filters are designed to suit any sizes of commercial swimming pools, aquariums, water parks, water features, and water treatment projects. Emaux offers various models and specifications together with our custom-made service\r\nto for all the equipment requirements of your commercial projects.', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('9', '119', '1584082536', '1584082536', 'SUPER QUIET,ENERGY SAVE,ROBUST AND RELIABLE', '/uploads/allimg/20200312/1-200312132439321.jpg', 'Emaux E-Power Variable Speed Pump reduces the energy usage of your pool, spa, waterfalls or fountains. The saving due to higher efficiency, it provides saving from over-usage and lower equipment maintenance cost.', '####');
INSERT INTO `ey_ycnhad_content` VALUES ('10', '120', '1584082581', '1584082581', 'AUTO PROGRAM,PH BALANCE,EASY SETUP', '/uploads/allimg/20200312/1-200312125F6231.jpg', 'Salt chlorinated pools are probably the best to enjoy a comfortable bath, but such systems tend to raise pH. With SSCone its automatic dosing pump injects acid to achieve the proper pH balance, the most efficient chlorine production generated by electrolytic cell.', '####');
